B.Wc=new A.e(B.c,["\u090f\u0935\u092e\u094d \u092c\u0939\u0941\u0935\u093f\u0927\u093e \u092f\u091c\u094d\u091e\u093e \u0935\u093f\u0924\u0924\u093e \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b \u092e\u0941\u0916\u0947 \u0964\n\u0915\u0930\u094d\u092e\u091c\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0924\u093e\u0928\u094d \u0938\u0930\u094d\u0935\u093e\u0928\u094d \u090f\u0935\u092e\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0935\u093f\u092e\u094b\u0915\u094d\u0937\u094d\u092f\u0938\u0947 \u0965 \u0969\u0968 \u0965","In this way, many varieties of worship were elaborated as ways in which we can realize the Self. Know them all to be born out of activity. Knowing this, you will attain Moksha ."],t.w)
B.Nh=new A.e(B.c,["\u0936\u094d\u0930\u0947\u092f\u093e\u0928\u094d \u0926\u094d\u0930\u0935\u094d\u092f \u092e\u092f\u093e\u0924\u094d \u092f\u091c\u094d\u091e\u093e\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092f\u091c\u094d\u091e\u0903 \u092a\u0930\u0928\u094d\u0924\u092a \u0964\n\u0938\u0930\u094d\u0935\u092e\u094d \u0915\u0930\u094d\u092e\u093e\u0916\u093f\u0932\u092e\u094d \u092a\u093e\u0930\u094d\u0925 \u091c\u094d\u091e\u093e\u0928\u0947 \u092a\u0930\u093f\u0938\u092e\u093e\u092a\u094d\u092f\u0924\u0947 \u0965 \u0969\u0969 \u0965","Arjuna, the knowledge embedded in worship is more significant than worship that\u2019s full of material offerings. Arjuna, every activity, without exception, culminates in knowledge."],t.w)
B.V2=new A.e(B.c,["\u0924\u0926\u094d\u0935\u093f\u0926\u094d\u0927\u093f \u092a\u094d\u0930\u0923\u093f\u092a\u093e\u0924\u0947\u0928 \u092a\u0930\u093f\u092a\u094d\u0930\u0936\u094d\u0928\u0947\u0928 \u0938\u0947\u0935\u092f\u093e \u0964\n\u0909\u092a\u0926\u0947\u0915\u094d\u0937\u094d\u092f\u0928\u094d\u0924\u093f \u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u093f\u0928\u0903 \u0924\u0924\u094d\u0924\u094d\u0935 \u0926\u0930\u094d\u0936\u093f\u0928\u0903 \u0965 \u0969\u096a \u0965","Know this by surrendering, by cross questioning, by rendering service and by listening to a teacher. Those who know and show the way will preach this knowledge to you."],t.w)
B.Sr=new A.e(B.c,["\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0928 \u092a\u0941\u0928\u0930\u094d\u092e\u094b\u0939\u092e\u094d \u090f\u0935\u092e\u094d \u092f\u093e\u0938\u094d\u092f\u0938\u093f \u092a\u093e\u0923\u094d\u0921\u0935 \u0964\n\u092f\u0947\u0928 \u092d\u0942\u0924\u093e\u0928\u094d\u092f\u0936\u0947\u0937\u0947\u0923 \u0926\u094d\u0930\u0915\u094d\u0937\u094d\u092f\u0938\u093f \u0906\u0924\u094d\u092e\u0928\u094d\u092f\u0925\u094b \u092e\u092f\u093f \u0965 \u0969\u096b \u0965","Arjuna, after knowing this, you will never be confused in this way again. With this knowledge, you will see all beings, without exception within your Self, and then in Me."],t.w)
B.Rh=new A.e(B.c,["\u0905\u092a\u093f \u091a\u0947\u0926\u0938\u093f \u092a\u093e\u092a\u0947\u092d\u094d\u092f\u0903 \u0938\u0930\u094d\u0935\u0947\u092d\u094d\u092f\u0903 \u092a\u093e\u092a\u0915\u0943\u0924\u094d\u0924\u092e\u0903 \u0964\n\u0938\u0930\u094d\u0935\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092a\u094d\u0932\u0935\u0947\u0928\u0948\u0935 \u0935\u0943\u091c\u093f\u0928\u092e\u094d \u0938\u0928\u094d\u0924\u0930\u093f\u0937\u094d\u092f\u0938\u093f \u0965 \u0969\u096c \u0965","Even if you are the most miserable among all those who have done wrong, you will cross over all the misery by the boat of knowledge alone."],t.w)
B.Ns=new A.e(B.c,["\u092f\u0925\u0948\u0927\u093e\u092e\u094d\u0938\u093f \u0938\u092e\u093f\u0926\u094d\u0927\u094b\u0917\u094d\u0928\u093f\u0903 \u092d\u0938\u094d\u092e\u0938\u093e\u0924\u094d \u0915\u0941\u0930\u0941\u0924\u0947\u093d\u0930\u094d\u091c\u0941\u0928 \u0964\n\u091c\u094d\u091e\u093e\u0928\u093e\u0917\u094d\u0928\u093f\u0903 \u0938\u0930\u094d\u0935\u0915\u0930\u094d\u092e\u093e\u0923\u093f \u092d\u0938\u094d\u092e\u0938\u093e\u0924\u094d \u0915\u0941\u0930\u0941\u0924\u0947 \u0924\u0925\u093e \u0965 \u0969\u096d \u0965","Arjuna, just as a well-burning fire annihilates fuel, in the same way, the fire of knowledge will burn down all your past actions."],t.w)
B.Oq=new A.e(B.c,["\u0928 \u0939\u093f \u091c\u094d\u091e\u093e\u0928\u0947\u0928 \u0938\u0926\u0943\u0936\u092e\u094d \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u093f\u0939 \u0935\u093f\u0926\u094d\u092f\u0924\u0947 \u0964\n\u0924\u0924\u094d\u0938\u094d\u0935\u092f\u092e\u094d \u092f\u094b\u0917\u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u0903 \u0915\u093e\u0932\u0947\u0928\u093e\u0924\u094d\u092e\u0928\u093f \u0935\u093f\u0928\u094d\u0926\u0924\u093f \u0965 \u0969\u096e \u0965","There is nothing in this world, which is equal to knowledge in its flawlessness. A person who has attained maturity by working without being driven by attachments will find that knowledge in his own Self, over time."],t.w)
B.OD=new A.e(B.c,["\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093e\u0928\u094d \u0932\u092d\u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u0924\u094d\u092a\u0930\u0903 \u0938\u092e\u094d\u092f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0903 \u0964\n\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0932\u092c\u094d\u0927\u094d\u0935\u093e \u092a\u0930\u093e\u092e\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0905\u091a\u093f\u0930\u0947\u0923\u093e\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0969\u096f \u0965","A person who trusts, is eagerly engaged and has his sense organs under control will obtain knowledge. Having obtained this knowledge, he will quickly attain the ultimate composure."],t.w)
B.Re=new A.e(B.c,["\u0905\u091c\u094d\u091e\u0936\u094d\u091a \u0905\u0936\u094d\u0930\u0926\u094d\u0926\u0927\u093e\u0928\u0936\u094d\u091a \u0938\u092e\u094d\u0936\u092f\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u0928\u0936\u094d\u092f\u0924\u093f \u0964\n\u0928\u093e\u092f\u092e\u094d \u0932\u094b\u0915\u094b\u093d\u0938\u094d\u0924\u093f \u0928 \u092a\u0930\u094b \u0928 \u0938\u0941\u0916\u092e\u094d \u0938\u092e\u094d\u0936\u092f\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u096a\u0966 \u0965","A person without this knowledge, who has suspicion in his mind and is not dedicated will perish. He is not eligible for anything in this world nor in any other world."],t.w)
B.Oy=new A.e(B.c,["\u092f\u094b\u0917 \u0938\u0902\u0928\u094d\u092f\u0938\u094d\u0924 \u0915\u0930\u094d\u092e\u093e\u0923\u092e\u094d \u091c\u094d\u091e\u093e\u0928 \u0938\u0928\u094d\u091b\u093f\u0928\u094d\u0928 \u0938\u0902\u0936\u092f\u092e\u094d \u0964\n\u0906\u0924\u094d\u092e\u0935\u0928\u094d\u0924\u092e\u094d \u0928 \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0928\u093f\u092c\u0927\u094d\u0928\u0928\u094d\u0924\u093f \u0927\u0928\u0928\u094d\u091c\u092f \u0965 \u096a\u0967 \u0965","Arjuna, activities do not limit a person who is free from possessiveness towards his work. With the knowledge of the Self, such a person is rid of doubts and stays focused on the Self."],t.w)
B.Wo=new A.e(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0905\u091c\u094d\u091e\u093e\u0928 \u0938\u092e\u094d\u092d\u0942\u0924\u092e\u094d \u0939\u0943\u0924\u094d\u0938\u094d\u0925\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u093e\u0938\u093f\u0928\u093e\u0924\u094d\u092e\u0928\u0903 \u0964\n\u091b\u093f\u0924\u094d\u0935\u0948\u0928\u092e\u094d \u0938\u0902\u0936\u092f\u092e\u094d \u092f\u094b\u0917\u092e\u093e\u0924\u093f\u0937\u094d\u0920 \u0909\u0924\u094d\u0924\u093f\u0937\u094d\u0920 \u092d\u093e\u0930\u0924 \u0965 \u096a\u0968 \u0965","Arjuna, that\u2019s why you must cut off this suspicion, which has taken its place in your heart due to ignorance. Cut it off using the knowledge of the Self as a sword. Having done this, follow the path of working without being driven by attachments and get up."],t.w)
B.P9=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u092e\u094d \u0915\u0930\u094d\u092e\u0923\u093e\u092e\u094d \u0915\u0943\u0937\u094d\u0923 \u092a\u0941\u0928\u0930\u094d\u092f\u094b\u0917\u092e\u094d \u091a \u0936\u092e\u094d\u0938\u0938\u093f \u0964\n\u092f\u091a\u094d\u091b\u094d\u0930\u0947\u092f \u090f\u0924\u092f\u094b\u0930\u0947\u0915\u092e\u094d \u0924\u0928\u094d\u092e\u0947 \u092c\u094d\u0930\u0942\u0939\u093f \u0938\u0941\u0928\u093f\u0936\u094d\u091a\u093f\u0924\u092e\u094d \u0965 \u0967 \u0965","Arjuna says: O Krishna, You recommend giving up actions. You also recommend determined and skillful action, without being driven by attachments. Among these two paths, which one is preferred? Tell that to me clearly."],t.w)
B.Pv=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0903 \u0915\u0930\u094d\u092e\u092f\u094b\u0917\u0936\u094d\u091a \u0928\u093f\u0903\u0936\u094d\u0930\u0947\u092f\u0938\u0915\u0930\u094c \u0909\u092d\u094c \u0964\n\u0924\u092f\u094b\u0938\u094d\u0924\u0941 \u0915\u0930\u094d\u092e \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u093e\u0924\u094d \u0915\u0930\u094d\u092e\u092f\u094b\u0917\u094b \u0935\u093f\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0965 \u0968 \u0965","Lord Krishna said- Both techniques- giving up actions and working without being driven by attachments - lead to moksha . Among them, work that\u2019s not driven by desire stands out in preference to giving up work itself."],t.w)
B.Uq=new A.e(B.c,["\u091c\u094d\u091e\u0947\u092f\u0903 \u0938 \u0928\u093f\u0924\u094d\u092f \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0940 \u092f\u094b \u0928 \u0926\u094d\u0935\u0947\u0937\u094d\u091f\u093f \u0928 \u0915\u093e\u0919\u094d\u0915\u094d\u0937\u0924\u093f \u0964\n\u0928\u093f\u0930\u094d\u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935\u094b \u0939\u093f \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0938\u0941\u0916\u092e\u094d \u092c\u0928\u094d\u0927\u093e\u0924\u094d \u092a\u094d\u0930\u092e\u0941\u091a\u094d\u092f\u0924\u0947 \u0965 \u0969 \u0965","Arjuna, The person who is not addicted to desires and is not carried away by hatred \u2013 he has overcome dualities. it is to be known, that he stays beyond desire. He alone is easily freed from the limitations of this world."],t.w)
B.WF=new A.e(B.c,["\u0938\u093e\u0919\u094d\u0916\u094d\u092f \u092f\u094b\u0917\u094c \u092a\u0943\u0925\u0915\u094d \u092c\u093e\u0932\u093e\u0903 \u092a\u094d\u0930\u0935\u0926\u0928\u094d\u0924\u093f \u0928 \u092a\u0923\u094d\u0921\u093f\u0924\u093e\u0903 \u0964\n\u090f\u0915\u092e\u094d \u0905\u092a\u094d\u092f\u093e\u0938\u094d\u0925\u093f\u0924\u0903 \u0938\u092e\u094d\u092f\u0915\u094d \u0909\u092d\u092f\u094b\u0930\u094d \u0935\u093f\u0928\u094d\u0926\u0924\u0947 \u092b\u0932\u092e\u094d \u0965 \u096a \u0965","Na\xefve people say that the two techniques \u2013 Knowing by contemplation and the technique of working independent of desire - are different in terms of the results they yield. Learned people do not say that. A person who properly practices any one among the two will obtain the result."],t.w)
B.OC=new A.e(B.c,["\u092f\u0924\u094d\u0938\u093e\u0919\u094d\u0916\u094d\u092f\u0948\u0903 \u092a\u094d\u0930\u093e\u092a\u094d\u092f\u0924\u0947 \u0938\u094d\u0925\u093e\u0928\u092e\u094d \u0924\u0924\u094d \u092f\u094b\u0917\u0948\u0930\u092a\u093f \u0917\u092e\u094d\u092f\u0924\u0947 \u0964\n\u090f\u0915\u092e\u094d \u0938\u093e\u0919\u094d\u0916\u094d\u092f\u092e\u094d \u091a \u092f\u094b\u0917\u092e\u094d \u091a \u092f\u0903 \u092a\u0936\u094d\u092f\u0924\u093f \u0938 \u092a\u0936\u094d\u092f\u0924\u093f \u0965 \u096b \u0965","The state of Self-realization gained by people who contemplate exclusively is also reached by people who work without being driven . The one who sees both of them as one is the person who realizes."],t.w)
B.U2=new A.e(B.c,["\u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0938\u094d\u0924\u0941 \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0926\u0941\u0903\u0916\u092e\u094d \u0906\u092a\u094d\u0924\u0941\u092e\u094d \u0905\u092f\u094b\u0917\u0924\u0903 \u0964\n\u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u094b \u092e\u0941\u0928\u093f\u0930\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0928 \u091a\u093f\u0930\u0947\u0923 \u0905\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u096c \u0965","Arjuna, giving up everything else to contemplate exclusively is extremely difficult to achieve without activity. A person who works without being driven by desire, who has the intention to realize the Self, will realize the true nature of the Self without delay."],t.w)
B.Pz=new A.e(B.c,["\u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u094b \u0935\u093f\u0936\u0941\u0926\u094d\u0927\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u091c\u093f\u0924\u093e\u0924\u094d\u092e\u093e \u091c\u093f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0903 \u0964\n\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0924\u094d\u092e \u092d\u0942\u0924\u093e\u0924\u094d\u092e\u093e \u0915\u0941\u0930\u094d\u0935\u0928\u094d\u0928\u092a\u093f \u0928 \u0932\u093f\u092a\u094d\u092f\u0924\u0947 \u0965 \u096d \u0965","A person who has dedicated himself to work without being driven by desire purifies himself, conquers his mind and keeps his organs under control. He considers the Self that\u2019s present in all beings as being equal to his own Self and is not stuck to anything, even though he keeps doing his work."],t.w)
B.V7=new A.e(B.c,["\u0928\u0948\u0935 \u0915\u093f\u0928\u094d\u091a\u093f\u0924\u094d \u0915\u0930\u094b\u092e\u0940\u0924\u093f \u092f\u0941\u0915\u094d\u0924\u094b \u092e\u0928\u094d\u092f\u0947\u0924 \u0924\u0924\u094d\u0935\u0935\u093f\u0924\u094d \u0964\n\u092a\u0936\u094d\u092f\u0928\u094d \u0936\u0943\u0923\u094d\u0935\u0928\u094d \u0938\u094d\u092a\u0943\u0936\u0928\u094d \u091c\u093f\u0918\u094d\u0930\u0928\u094d \u0905\u0936\u094d\u0928\u0928\u094d \u0917\u091a\u094d\u091b\u0928\u094d \u0938\u094d\u0935\u092a\u0928\u094d \u0936\u094d\u0935\u0938\u0928\u094d \u0965 \u096e \u0965\n\u092a\u094d\u0930\u0932\u092a\u0928\u094d \u0935\u093f\u0938\u0943\u091c\u0928\u094d \u0917\u0943\u0939\u094d\u0923\u0928\u094d \u0909\u0928\u094d\u092e\u093f\u0937\u0928\u094d \u0928\u093f\u092e\u093f\u0937\u0928\u094d\u0928\u092a\u093f \u0964\n\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0923\u093f \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0930\u094d\u0925\u0947\u0937\u0941 \u0935\u0930\u094d\u0924\u0928\u094d\u0924 \u0907\u0924\u093f \u0927\u093e\u0930\u092f\u0928\u094d \u0965 \u096f \u0965","A person who knows the nature of the Self, who has dedicated himself to worship to the Lord with activity will consider that his organs will remain among things that stimulate them, and knows that \u2018I do not do anything\u2019 while seeing, hearing, touching, smelling, eating, moving around, sleeping, breathing, talking, letting go, holding, when his eyes are open and when they are shut."],t.w)
B.Vo=new A.e(B.c,["\u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094d\u092f\u093e\u0927\u093e\u092f \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0938\u0919\u094d\u0917\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0915\u0930\u094b\u0924\u093f \u092f\u0903 \u0964\n\u0932\u093f\u092a\u094d\u092f\u0924\u0947 \u0928 \u0938 \u092a\u093e\u092a\u0947\u0928 \u092a\u0926\u094d\u092e \u092a\u0924\u094d\u0930\u092e\u094d \u0907\u0935\u093e\u092e\u094d\u092d\u0938\u093e \u0965 \u0967\u0966 \u0965","The person who places all deeds in nature itself and works while giving up all attachments is not bound by any fault, like a lotus leaf in water."],t.w)
B.Ss=new A.e(B.c,["\u0915\u093e\u092f\u0947\u0928 \u092e\u0928\u0938\u093e \u092c\u0941\u0926\u094d\u0927\u094d\u092f\u093e \u0915\u0947\u0935\u0932\u0948\u0930\u093f\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0948\u0930\u092a\u093f \u0964\n\u092f\u094b\u0917\u093f\u0928\u0903 \u0915\u0930\u094d\u092e \u0915\u0941\u0930\u094d\u0935\u0928\u094d\u0924\u093f \u0938\u0919\u094d\u0917\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0906\u0924\u094d\u092e \u0936\u0941\u0926\u094d\u0927\u092f\u0947 \u0965 \u0967\u0967 \u0965","People who worship Me with their activities do their work using their bodies, their minds, their intellect or just with their organs, while giving up attachments to purify the Self."],t.w)
B.P2=new A.e(B.c,["\u092f\u0941\u0915\u094d\u0924\u0903 \u0915\u0930\u094d\u092e \u092b\u0932\u092e\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0906\u092a\u094d\u0928\u094b\u0924\u093f \u0928\u0948\u0937\u094d\u0920\u093f\u0915\u0940\u092e\u094d \u0964\n\u0905\u092f\u0941\u0915\u094d\u0924\u0903 \u0915\u093e\u092e\u0915\u093e\u0930\u0947\u0923 \u092b\u0932\u0947 \u0938\u0915\u094d\u0924\u094b \u0928\u093f\u092c\u0927\u094d\u092f\u0924\u0947 \u0965 \u0967\u0968 \u0965","A person who is intent and engaged will give up the attachment to outcomes and will obtain the joy of experiencing the Self in its pure form. A person who does not do this is attached to the outcome of his activities. Being driven by desire, he is tied down to the stimuli of this world."],t.w)
B.Tn=new A.e(B.c,["\u0938\u0930\u094d\u0935 \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u092e\u0928\u0938\u093e \u0938\u0902\u0928\u094d\u092f\u0938\u094d\u092f\u093e\u0938\u094d\u0924\u0947 \u0938\u0941\u0916\u092e\u094d \u0935\u0936\u0940 \u0964\n\u0928\u0935\u0926\u094d\u0935\u093e\u0930\u0947 \u092a\u0941\u0930\u0947 \u0926\u0947\u0939\u0940 \u0928\u0948\u0935 \u0915\u0941\u0930\u094d\u0935\u0928\u094d \u0928 \u0915\u093e\u0930\u092f\u0928\u094d \u0965 \u0967\u0969 \u0965","Having given up all actions in the city with nine gates (the body) using the mind, the Self, which is the owner of the body will control his organs and stay content without committing any action directly or indirectly."],t.w)
B.Rb=new A.e(B.c,["\u0928 \u0915\u0930\u094d\u0924\u0943\u0924\u094d\u0935\u0935\u094d\u092e\u094d \u0928 \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0932\u094b\u0915\u0938\u094d\u092f \u0938\u0943\u091c\u0924\u093f \u092a\u094d\u0930\u092d\u0941\u0903 \u0964\n\u0928 \u0915\u0930\u094d\u092e \u092b\u0932 \u0938\u092e\u094d\u092f\u094b\u0917\u092e\u094d \u0938\u094d\u0935\u092d\u093e\u0935\u0938\u094d\u0924\u0941 \u092a\u094d\u0930\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0967\u096a \u0965","The Self does not create the impression of making things happen, an impression associated with this material world. Neither does it create the actions of this material world, nor the impression that outcomes are inseparably linked with these actions. The nature of this material world prevails."],t.w)
B.Q1=new A.e(B.c,["\u0928\u093e\u0926\u0924\u094d\u0924\u0947 \u0915\u0938\u094d\u092f\u091a\u093f\u0924\u094d \u092a\u093e\u092a\u092e\u094d \u0928 \u091a\u0948\u0935 \u0938\u0941\u0915\u0943\u0924\u092e\u094d \u0935\u093f\u092d\u0941\u0903 \u0964\n\u0905\u091c\u094d\u091e\u093e\u0928\u0947\u0928 \u0906\u0935\u0943\u0924\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u0947\u0928 \u092e\u0941\u0939\u094d\u092f\u0928\u094d\u0924\u093f \u091c\u0928\u094d\u0924\u0935\u0903 \u0965 \u0967\u096b \u0965","The omnipresent Self does not take up anyone\u2019s sinful deeds. Nor does it take up any virtuous deeds. The inherent knowledge in the Self is concealed by ignorance. Due to this, the various beings are misled into believing that the body is their Self."],t.w)
B.SX=new A.e(B.c,["\u091c\u094d\u091e\u093e\u0928\u0947\u0928 \u0924\u0941 \u0924\u0926\u094d \u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092f\u0947\u0937\u093e\u092e\u094d \u0928\u093e\u0936\u093f\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u0928\u0903 \u0964\n\u0924\u0947\u0937\u093e\u092e\u094d \u0906\u0926\u093f\u0924\u094d\u092f\u0935\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092a\u094d\u0930\u0915\u093e\u0936\u092f\u0924\u093f \u0924\u0924\u094d\u092a\u0930\u092e\u094d \u0965 \u0967\u096c \u0965","Knowledge shines like the sun in people whose ignorance is destroyed by the knowledge of the Self. This knowledge is their ultimate goal."],t.w)
B.Te=new A.e(B.c,["\u0924\u0924\u094d \u092c\u0941\u0926\u094d\u0927\u092f\u0903 \u0924\u0926\u093e\u0924\u094d\u092e\u093e\u0928\u0903 \u0924\u0928\u094d\u0928\u093f\u0937\u094d\u0920\u093e\u0903 \u0924\u0924\u094d\u092a\u0930\u093e\u092f\u0923\u093e\u0903 \u0964\n\u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u0905\u092a\u0941\u0928\u0930\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u091c\u094d\u091e\u093e\u0928 \u0928\u093f\u0930\u094d\u0927\u0942\u0924 \u0915\u0932\u094d\u092e\u0937\u093e\u0903 \u0965 \u0967\u096d \u0965","While being deprived of the state of ultimate knowledge, while being flawed, those who have dedicated their intellect, who dedicate their thoughts\u200b to fully believe in the goal, considering their goal to be supreme - they will reach that state, from which they will not fall again."],t.w)
B.Wq=new A.e(B.c,["\u0935\u093f\u0926\u094d\u092f\u093e \u0935\u093f\u0928\u092f \u0938\u092e\u094d\u092a\u0928\u094d\u0928\u0947 \u092d\u093e\u0939\u094d\u092e\u0923\u0947 \u0917\u0935\u093f \u0939\u0938\u094d\u0924\u093f\u0928\u093f \u0964\n\u0936\u0941\u0928\u093f \u091a\u0948\u0935 \u0936\u094d\u0935\u092a\u093e\u0915\u0947 \u091a \u092a\u0923\u094d\u0921\u093f\u0924\u093e\u0903 \u0938\u092e \u0926\u0930\u094d\u0936\u093f\u0928\u0903 \u0965 \u0967\u096e \u0965","People who know the true nature of the Self see equality in a person who is endowed with knowledge and humility, in someone who is just a Brahmin, in a cow, in an elephant, even in a dog and even in a person who eats the meat of a dog."],t.w)
B.P0=new A.e(B.c,["\u0907\u0939\u0948\u0935 \u0924\u0948\u0930\u094d\u091c\u093f\u0924\u0903 \u0938\u0930\u094d\u0917\u0903 \u092f\u0947\u0937\u093e\u092e\u094d \u0938\u093e\u092e\u094d\u092f\u0947 \u0938\u094d\u0925\u093f\u0924\u092e\u094d \u092e\u0928\u0903 \u0964\n\u0928\u093f\u0930\u094d\u0926\u094b\u0937\u092e\u094d \u0939\u093f \u0938\u092e\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0924\u0938\u094d\u092e\u093e\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u093f \u0924\u0947 \u0938\u094d\u0925\u093f\u0924\u093e\u0903 \u0965 \u0967\u096f \u0965","This material creation has been conquered here itself, by those whose minds are situated in this equality. When devoid of faults, the Self is indeed whole and complete. Thus, they are all situated in the Lord."],t.w)
B.Og=new A.e(B.c,["\u0928 \u092a\u094d\u0930\u0939\u0943\u0937\u094d\u092f\u0947\u0924\u094d \u092a\u094d\u0930\u093f\u092f\u092e\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928 \u0909\u0926\u094d\u0935\u093f\u091c\u0947\u0924\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u091a\u093e\u092a\u094d\u0930\u093f\u092f\u092e\u094d \u0964\n\u0938\u094d\u0925\u093f\u0930 \u092c\u0941\u0926\u094d\u0927\u093f\u0930\u094d \u0905\u0938\u092e\u094d\u092e\u0942\u0922\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0935\u093f\u0926\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u093f \u0938\u094d\u0925\u093f\u0924\u0903 \u0965\u0968\u0966 \u0965","He doesn\u2019t\u200b get excited on obtaining something he likes and doesn\u2019t\u200b get agitated on getting something he does not like. His intellect is firm and he does not get confused. He knows the nature of the Self and the Lord. He is situated in the quest for the Self."],t.w)
B.Wf=new A.e(B.c,["\u092c\u093e\u0939\u094d\u092f \u0938\u094d\u092a\u0930\u094d\u0936\u0947\u0937\u0941 \u0905\u0938\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u0928\u094d\u0926\u0924\u094d\u092f\u093e\u0924\u094d\u092e\u0928\u093f \u092f\u0903 \u0938\u0941\u0916\u092e\u094d \u0964\n\u0938 \u092c\u094d\u0930\u0939\u094d\u092e\u092f\u094b\u0917 \u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0938\u0941\u0916\u092e\u094d \u0905\u0915\u094d\u0937\u092f\u092e\u094d \u0905\u0936\u094d\u0928\u0941\u0924\u0947 \u0965 \u0968\u0967 \u0965","The one who derives fulfillment in the Self, while remaining disinterested in external stimuli - he will have focus in the quest for the Self and the Lord and will enjoy un-ending joy."],t.w)
B.UY=new A.e(B.c,["\u092f\u0947 \u0939\u093f \u0938\u092e\u094d\u0938\u094d\u092a\u0930\u094d\u0936\u091c\u093e \u092d\u094b\u0917\u093e \u0926\u0941\u0903\u0916\u092f\u094b\u0928\u092f \u090f\u0935 \u0924\u0947 \u0964\n\u0906\u0926\u094d\u092f\u0928\u094d\u0924\u0935\u0928\u094d\u0924\u0903 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0928 \u0924\u0947\u0937\u0941 \u0930\u092e\u0924\u0947 \u092c\u0941\u0927\u0903 \u0965 \u0968\u0968 \u0965","Arjuna, those enjoyments that are born out of stimuli supplied to the sense organs will inevitably lead to difficulties. They have a beginning and an end. The person who knows their true nature will not indulge in them."],t.w)
B.NP=new A.e(B.c,["\u0936\u0915\u094d\u0928\u094b\u0924\u093f \u0907\u0939\u0948\u0935 \u092f\u0903 \u0938\u094b\u0922\u0941\u092e\u094d \u092a\u094d\u0930\u093e\u0915\u094d \u0936\u0930\u0940\u0930 \u0935\u093f\u092e\u094b\u0915\u094d\u0937\u0923\u093e\u0924\u094d \u0964\n\u0915\u093e\u092e \u0915\u094d\u0930\u094b\u0927\u094b\u0926\u094d\u092d\u0935\u092e\u094d \u0935\u0947\u0917\u092e\u094d \u0938 \u092f\u0941\u0915\u094d\u0924\u0903 \u0938 \u0938\u0941\u0916\u0940 \u0928\u0930\u0903 \u0965 \u0968\u0969 \u0965","Before separating from the body, the person who is able to overcome the rush born out of desire and anger, while still being in this material world is the focused one. He is a fulfilled person."],t.w)
B.TN=new A.e(B.c,["\u092f\u094b \u0905\u0928\u094d\u0924\u0938\u094d\u0938\u0941\u0916\u094b \u0905\u0928\u094d\u0924\u0930\u093e\u0930\u093e\u092e\u0903 \u0924\u0925\u093e \u0905\u0928\u094d\u0924\u0930\u094d\u091c\u094d\u092f\u094b\u0924\u093f\u0930\u0947\u0935 \u092f\u0903 \u0964\n\u0938 \u092f\u094b\u0917\u0940 \u092c\u094d\u0930\u0939\u094d\u092e \u0928\u093f\u0930\u094d\u0935\u093e\u0923\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u092d\u0942\u0924\u094b\u093d\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0968\u096a \u0965","The person who is content with his Self, who delights in his Self, and the one who is illuminated from the inside works without attachment while being situated in his Self. He will attain the infinite joy present in the Self and the Lord."],t.w)
B.Pt=new A.e(B.c,["\u0932\u092d\u0928\u094d\u0924\u0947 \u092c\u094d\u0930\u0939\u094d\u092e \u0928\u093f\u0930\u094d\u0935\u093e\u0923\u092e\u094d \u090b\u0937\u092f\u0903 \u0915\u094d\u0937\u0940\u0923 \u0915\u0932\u094d\u092e\u0937\u093e\u0903 \u0964\n\u091b\u093f\u0928\u094d\u0928 \u0926\u094d\u0935\u0948\u0927\u093e \u092f\u0924\u093e\u0924\u094d\u092e\u093e\u0928\u0903 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924 \u0939\u093f\u0924\u0947 \u0930\u0924\u093e\u0903 \u0965 \u0968\u096b \u0965","Those who are committed to the realization of the Self are free of the dualities of this world. They have focused their mind exclusively on the Self. They delight in the affection among all beings, get rid of all faults that come in the way of realizing the Self and obtain the infinite joy present in the Lord."],t.w)
B.P3=new A.e(B.c,["\u0915\u093e\u092e \u0915\u094d\u0930\u094b\u0927 \u0935\u093f\u092f\u0941\u0915\u094d\u0924\u093e\u0928\u093e\u092e\u094d \u092f\u0924\u0940\u0928\u093e\u092e\u094d \u092f\u0924\u091a\u0947\u0924\u0938\u093e\u092e\u094d \u0964\n\u0905\u092d\u093f\u0924\u094b \u092c\u094d\u0930\u0939\u094d\u092e \u0928\u093f\u0930\u094d\u0935\u093e\u0923\u092e\u094d \u0935\u0930\u094d\u0924\u0924\u0947 \u0935\u093f\u091c\u093f\u0924\u093e\u0924\u094d\u092e\u0928\u093e\u092e\u094d \u0965 \u0968\u096c \u0965","The joy of experiencing the Self and the Lord stays with people who disengage from desire and anger, who strive to realize the Self, who have gained control over their consciousness and who have conquered their mind."],t.w)
B.Rk=new A.e(B.c,["\u0938\u094d\u092a\u0930\u094d\u0936\u093e\u0928\u094d \u0915\u0943\u0924\u094d\u0935\u093e \u092c\u0939\u093f\u0930\u094d\u092c\u093e\u0939\u094d\u092f\u093e\u0928\u094d \u091a\u0915\u094d\u0937\u0941\u0936\u094d\u091a\u0948\u0935 \u0905\u0928\u094d\u0924\u0930\u0947 \u092d\u094d\u0930\u0941\u0935\u094b\u0903 \u0964\n\u092a\u094d\u0930\u093e\u0923\u093e\u092a\u093e\u0928\u094c \u0938\u092e\u094c \u0915\u0943\u0924\u094d\u0935\u093e \u0928\u093e\u0938\u093e\u092d\u094d\u092f\u0928\u094d\u0924\u0930 \u091a\u093e\u0930\u093f\u0923\u094c \u0965 \u0968\u096d \u0965\n\u092f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u092e\u0928\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u092e\u0941\u0928\u093f\u0930\u094d\u092e\u094b\u0915\u094d\u0937 \u092a\u0930\u093e\u092f\u0923\u0903 \u0964\n\u0935\u093f\u0917\u0924\u0947\u091a\u094d\u091b\u093e \u092d\u092f \u0915\u094d\u0930\u094b\u0927\u094b \u092f\u0938\u094d\u0938\u0926\u093e \u092e\u0941\u0915\u094d\u0924 \u090f\u0935 \u0938\u0903 \u0965 \u0968\u096e \u0965","A person having the intention to realize the Self, who has moksha as his only goal, keeps external stimuli outside and the eyes focused in-between the eye-brows. Balancing inhalation and exhalation through the nose, he takes charge of his organs, mind and his intellect. He is beyond desire, fear and anger. Such a person stays liberated from this material world."],t.w)
B.Pi=new A.e(B.c,["\u092d\u094b\u0915\u094d\u0924\u093e\u0930\u092e\u094d \u092f\u091c\u094d\u091e \u0924\u092a\u0938\u093e\u092e\u094d \u0938\u0930\u094d\u0935 \u0932\u094b\u0915 \u092e\u0939\u0947\u0936\u094d\u0935\u0930\u092e\u094d \u0964\n\u0938\u0941\u0939\u0943\u0926\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u092e\u093e\u092e\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u0943\u091a\u094d\u091b\u0924\u093f \u0965 \u0968\u096f \u0965","He will attain peace by knowing me, the enjoyer of worship and prayer, the Lord of all the worlds, a friend and ally of all beings."],t.w)
B.R8=new A.e(B.c,["\u0905\u0928\u093e\u0936\u094d\u0930\u093f\u0924\u0903 \u0915\u0930\u094d\u092e \u092b\u0932\u092e\u094d \u0915\u093e\u0930\u094d\u092f\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u0930\u094b\u0924\u093f \u092f\u0903 \u0964\n\u0938 \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0940 \u091a \u092f\u094b\u0917\u0940 \u091a \u0928 \u0928\u093f\u0930\u093e\u0917\u094d\u0928\u093f\u0930\u094d\u0928 \u091a\u093e\u0915\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967 \u0965","The person who does the work\u200b that's to be done without depending on the outcome to drive him is the one who has renounced outcomes. He works without being driven. He is not without fire, neither is he idle."],t.w)
B.T1=new A.e(B.c,["\u092f\u092e\u094d \u0938\u0902\u0928\u094d\u092f\u093e\u0938 \u0907\u0924\u093f \u092a\u094d\u0930\u093e\u0939\u0941\u0903 \u092f\u094b\u0917\u092e\u094d \u0924\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092a\u093e\u0923\u094d\u0921\u0935 \u0964\n\u0928 \u0939\u093f \u0905\u0938\u0902\u0928\u094d\u092f\u0938\u094d\u0924 \u0938\u0919\u094d\u0915\u0932\u094d\u092a\u094b \u092f\u094b\u0917\u0940 \u092d\u0935\u0924\u093f \u0915\u0936\u094d\u091a\u0928 \u0965 \u0968 \u0965","Arjuna, know that what\u2019s called renunciation is activity that isn\u2019t driven by desire. Anyone who doesn\u2019t give up expectations cannot practice such activity."],t.w)
B.PK=new A.e(B.c,["\u0906\u0930\u0941\u0930\u0941\u0915\u094d\u0937\u094b\u0903 \u092e\u0941\u0928\u0947\u0930\u094d\u092f\u094b\u0917\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u093e\u0930\u0923\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0964\n\u092f\u094b\u0917\u093e\u0930\u0942\u0922\u0938\u094d\u092f \u0924\u0938\u094d\u092f\u0948\u0935 \u0936\u092e\u0903 \u0915\u093e\u0930\u0923\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0969 \u0965","To the enthusiast who wants to ascend to realization, activity is said to be the means. To a person who is well-established in the realization of his Self, tranquility and meditation are said to be the principle of existence."],t.w)
B.TJ=new A.e(B.c,["\u092f\u0926\u093e \u0939\u093f \u0928\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0930\u094d\u0925\u0947\u0937\u0941 \u0928 \u0915\u0930\u094d\u092e\u0938\u0941 \u0905\u0928\u0941\u0937\u091c\u094d\u091c\u0924\u0947 \u0964\n\u0938\u0930\u094d\u0935 \u0938\u0919\u094d\u0915\u0932\u094d\u092a \u0938\u0902\u0928\u094d\u092f\u093e\u0938\u0940 \u092f\u094b\u0917\u093e\u0930\u0942\u0922\u0903 \u0924\u0926\u094b\u091a\u094d\u092f\u0924\u0947 \u0965 \u096a \u0965","When a person is not attached to sensual things, nor to the activities associated with those stimuli, then, he is free from attachments towards desires. He is said to be firmly situated in the realization of the Self."],t.w)
B.SR=new A.e(B.c,["\u0909\u0926\u094d\u0927\u0930\u0947\u0924\u094d \u0906\u0924\u094d\u092e\u0928\u093e\u093d\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0928 \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0905\u0935\u0938\u093e\u0926\u092f\u0947\u0924\u094d \u0964\n\u0906\u0924\u094d\u092e\u0948\u0935 \u0939\u093f \u0906\u0924\u094d\u092e\u0928\u094b \u092c\u0928\u094d\u0927\u0941\u0903 \u0906\u0924\u094d\u092e\u0948\u0935 \u0930\u093f\u092a\u0941\u0930\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u096b \u0965","With his own intent, detached from material desires, he needs to achieve progress in his own self. He must not get disheartened and give up in defeat. His own intention is his friend. His intentions can be his enemies."],t.w)
B.WE=new A.e(B.c,["\u092c\u0928\u094d\u0927\u0941\u0930\u093e\u0924\u094d\u092e\u093e\u093d\u0924\u094d\u092e\u0928\u0938\u094d\u0924\u0938\u094d\u092f \u092f\u0947\u0928 \u0906\u0924\u094d\u092e\u0948\u0935 \u0906\u0924\u094d\u092e\u0928\u093e \u091c\u093f\u0924\u0903 \u0964\n\u0905\u0928\u093e\u0924\u094d\u092e\u0928\u0938\u094d\u0924\u0941 \u0936\u0924\u094d\u0930\u0941\u0924\u094d\u0935\u0947 \u0935\u0930\u094d\u0924\u0947\u0924\u094d \u0906\u0924\u094d\u092e\u0948\u0935 \u0936\u0924\u094d\u0930\u0941\u0935\u0924\u094d \u0965 \u096c \u0965","The intentions of a being are favorable when his own mind and intentions have been won over by the Self in him. However, to a person who has not won over his mind, his very intentions stand as his foe and remain to work against him."],t.w)
B.Qq=new A.e(B.c,["\u091c\u093f\u0924\u093e\u0924\u094d\u092e\u0928\u0903 \u092a\u094d\u0930\u0936\u093e\u0928\u094d\u0924\u0938\u094d\u092f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u092e\u093e\u0939\u093f\u0924\u0903 \u0964\n\u0936\u0940\u0924\u094b\u0937\u094d\u0923 \u0938\u0941\u0916 \u0926\u0941\u0903\u0916\u0947\u0937\u0941 \u0924\u0925\u093e \u092e\u093e\u0928 \u0905\u092a\u092e\u093e\u0928\u092f\u094b\u0903 \u0965 \u096d \u0965","Having conquered his mind, a person who is at peace is completely focused on the Self, which has the Lord as the basis for its existence in situations of cold, heat, comfort, difficulties, during fame and insult too."],t.w)
B.UG=new A.e(B.c,["\u091c\u094d\u091e\u093e\u0928 \u0935\u093f\u091c\u094d\u091e\u093e\u0928 \u0924\u0943\u092a\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0915\u0942\u091f\u0938\u094d\u0925\u094b \u0935\u093f\u091c\u093f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u0941\u0915\u094d\u0924 \u0907\u0924\u094d\u092f\u0941\u091a\u094d\u092f\u0924\u0947 \u092f\u094b\u0917\u0940 \u0938\u092e \u0932\u094b\u0937\u094d\u0920\u093e\u0936\u094d\u092e \u0915\u093e\u0928\u094d\u091a\u0928\u0903 \u0965 \u096e \u0965","A person whose mind is content in the knowledge of the Self and the awareness to distinguish it from the environment has conquered his organs, knowing that he is the unchanging Self. This person works without being driven by desire. He views a lump of clay, a stone and gold with equanimity. He is said to be focused and engaged."],t.w)
B.Qs=new A.e(B.c,["\u0938\u0941\u0939\u0943\u0928\u094d \u092e\u093f\u0924\u094d\u0930\u093e\u0930\u093f \u0909\u0926\u093e\u0938\u0940\u0928 \u092e\u0927\u094d\u092f\u0938\u094d\u0925 \u0926\u094d\u0935\u0947\u0937\u094d\u092f \u092c\u0928\u094d\u0927\u0941\u0937\u0941 \u0964\n\u0938\u093e\u0927\u0941\u0937\u094d\u0935\u092a\u093f \u091a \u092a\u093e\u092a\u0947\u0937\u0941 \u0938\u092e \u092c\u0941\u0926\u094d\u0927\u093f\u0930\u094d \u0935\u093f\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0965 \u096f \u0965","A person is distinguished and superior when he is level-headed among friends, foes, the affectionate, companions of the same age, enemies, disinterested people, neutrals, even among the good people and the offenders."],t.w)
B.V8=new A.e(B.c,["\u092f\u094b\u0917\u0940 \u092f\u0941\u0928\u094d\u091c\u0940\u0924 \u0938\u0924\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0930\u0939\u0938\u093f \u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u090f\u0915\u093e\u0915\u0940 \u092f\u0924\u091a\u093f\u0924\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0928\u093f\u0930\u093e\u0936\u0940\u0930\u092a\u0930\u093f\u0917\u094d\u0930\u0939\u0903 \u0965 \u0967\u0966 \u0965","Such a person, who works without being driven by desire must meditate on the true nature of the Self daily in a place that is not public, being by himself, keeping his mind and intellect under control, not being interested in anything else and not giving into possessiveness."],t.w)
B.Rs=new A.e(B.c,["\u0936\u0941\u091a\u094c \u0926\u0947\u0936\u0947 \u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u093e\u092a\u094d\u092f \u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0906\u0938\u0928\u092e\u094d \u0906\u0924\u094d\u092e\u0928\u0903 \u0964\n\u0928\u093e\u0924\u094d\u092f\u0941\u091a\u094d\u091b\u094d\u0930\u093f\u0924\u092e\u094d \u0928\u093e\u0924\u093f \u0928\u0940\u091a\u092e\u094d \u091a\u0947\u0932\u093e\u091c\u093f\u0928 \u0915\u0941\u0936\u094b\u0924\u094d\u0924\u0930\u092e\u094d \u0965 \u0967\u0967 \u0965\n\u0924\u0924\u094d\u0930\u0948\u0915\u093e\u0917\u094d\u0930\u092e\u094d \u092e\u0928\u0903 \u0915\u0943\u0924\u094d\u0935\u093e \u092f\u0924 \u091a\u093f\u0924\u094d\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0915\u094d\u0930\u093f\u092f\u0903 \u0964\n\u0909\u092a\u0935\u093f\u0936\u094d\u092f\u093e\u0938\u0928\u0947 \u092f\u0941\u0928\u094d\u091c\u094d\u092f\u093e\u0924\u094d \u092f\u094b\u0917\u092e\u094d \u0906\u0924\u094d\u092e \u0935\u093f\u0936\u0941\u0926\u094d\u0927\u092f\u0947 \u0965 \u0967\u0968 \u0965","Setting up a stable seat for himself in a place that is clean, not too high, not too low, keeping cloth, fur and straw on it, sitting there, keeping his mind focused controlling the works of the organs and the intellect, he employs his body to work without being driven by desire to purify his Self."],t.w)
B.Rn=new A.e(B.c,["\u0938\u092e\u092e\u094d \u0915\u093e\u092f \u0936\u093f\u0930\u094b\u0917\u094d\u0930\u0940\u0935\u092e\u094d \u0927\u093e\u0930\u092f\u0928\u094d \u0905\u091a\u0932\u092e\u094d \u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0964\n\u0938\u092e\u094d\u092a\u094d\u0930\u0947\u0915\u094d\u0937\u094d\u092f \u0928\u093e\u0938\u093f\u0915\u093e\u0917\u094d\u0930\u092e\u094d \u0938\u094d\u0935\u092e\u094d \u0926\u093f\u0936\u0936\u094d\u091a \u0905\u0928\u0935\u0932\u094b\u0915\u092f\u0928\u094d \u0965 \u0967\u0969 \u0965\n\u092a\u094d\u0930\u0936\u093e\u0928\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u0917\u0924 \u092d\u0940\u0903 \u092c\u094d\u0930\u0939\u094d\u092e\u091a\u093e\u0930\u093f \u0935\u094d\u0930\u0924\u0947 \u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u092e\u0928\u0938\u094d\u0938\u092e\u094d\u092f\u092e\u094d\u092f \u092e\u091a\u094d\u091a\u093f\u0924\u094d\u0924\u094b \u092f\u0941\u0915\u094d\u0924 \u0906\u0938\u0940\u0924 \u092e\u0924\u094d\u092a\u0930\u0903 \u0965 \u0967\u096a \u0965","Keeping the body, the head and the neck in line, stable, without changing position, looking at the uppermost part of his nose, without looking in different directions, with a peaceful mind, without being afraid of anything, situated in the vow of celibacy, keeping his mind under control, with the consciousness dedicated to Me, a person must remain focused on the Self, knowing that I pervade everything ultimately."],t.w)
B.UL=new A.e(B.c,["\u092f\u0941\u0928\u094d\u091c\u0928\u094d\u0928\u0947\u0935\u092e\u094d \u0938\u0926\u093e \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092f\u094b\u0917\u0940 \u0928\u093f\u092f\u0924 \u092e\u093e\u0928\u0938\u0903 \u0964\n\u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0928\u093f\u0930\u094d\u0935\u093e\u0923 \u092a\u0930\u092e\u093e\u092e\u094d \u092e\u0924\u094d\u0938\u092e\u094d\u0938\u094d\u0925\u093e\u092e\u094d \u0905\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0967\u096b \u0965","The person who offers his work as worship to Me will fix his mind in this way always. Controlling his mind to focus on Me, he reaches the ultimate joy and peace that resides in Me."],t.w)
B.Pq=new A.e(B.c,["\u0928\u093e\u0924\u094d\u092f\u0936\u094d\u0928\u0924\u0938\u094d\u0924\u0941 \u092f\u094b\u0917\u094b\u093d\u0938\u094d\u0924\u093f \u0928 \u091a\u0948\u0915\u093e\u0928\u094d\u0924\u092e\u094d \u0905\u0928\u0936\u094d\u0928\u0924\u0903 \u0964\n\u0928 \u091a\u093e\u0924\u093f \u0938\u094d\u0935\u092a\u094d\u0928 \u0936\u0940\u0932\u0938\u094d\u092f \u091c\u093e\u0917\u094d\u0930\u0924\u094b \u0928\u0948\u0935 \u091a \u0905\u0930\u094d\u091c\u0941\u0928 \u0965 \u0967\u096c \u0965\n\u092f\u0941\u0915\u094d\u0924 \u0906\u0939\u093e\u0930 \u0935\u093f\u0939\u093e\u0930\u0938\u094d\u092f \u092f\u0941\u0915\u094d\u0924 \u091a\u0947\u0937\u094d\u091f\u0938\u094d\u092f \u0915\u0930\u094d\u092e\u0938\u0941 \u0964\n\u092f\u0941\u0915\u094d\u0924 \u0938\u094d\u0935\u092a\u094d\u0928\u093e\u0935\u092c\u094b\u0927\u0938\u094d\u092f \u092f\u094b\u0917\u094b \u092d\u0935\u0924\u093f \u0926\u0941\u0903\u0916 \u0939\u093e \u0965 \u0967\u096d \u0965","Arjuna, the quest for the realization of the Self is not for one who eats excessively. A person who does not eat will not have a singularity of purpose either. It is not for a person who sleeps excessively either. Neither is it for a person who is awake all the time. This quest will be the destroyer of sorrow for one who eats and enjoys appropriately, and exerts himself appropriately in his work."],t.w)
B.Px=new A.e(B.c,["\u092f\u0926\u093e \u0935\u093f\u0928\u093f\u092f\u0924\u092e\u094d \u091a\u093f\u0924\u094d\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u0928\u094d\u092f\u0947\u0935 \u0905\u0935\u0924\u093f\u0937\u094d\u0920\u0924\u0947 \u0964\n\u0928\u093f\u0903\u0938\u094d\u092a\u0943\u0939\u0903 \u0938\u0930\u094d\u0935 \u0915\u093e\u092e\u0947\u092d\u094d\u092f\u094b \u092f\u0941\u0915\u094d\u0924 \u0907\u0924\u094d\u092f\u0941\u091a\u094d\u092f\u0924\u0947 \u0924\u0926\u093e \u0965 \u0967\u096e \u0965","When a person\u2019s consciousness stays firm in the Self alone, without attachments towards any desires, then the person is said to be focused and deserves to realize the Self."],t.w)
B.RJ=new A.e(B.c,["\u092f\u0925\u093e \u0926\u0940\u092a\u094b \u0928\u093f\u0935\u093e\u0924\u0938\u094d\u0925\u094b \u0928\u0947\u0919\u094d\u0917\u0924\u0947 \u0938\u094b\u092a\u092e\u093e \u0938\u094d\u092e\u0943\u0924\u093e \u0964\n\u092f\u094b\u0917\u093f\u0928\u094b \u092f\u0924\u091a\u093f\u0924\u094d\u0924\u0938\u094d\u092f \u092f\u0941\u0928\u094d\u091c\u0924\u094b \u092f\u094b\u0917\u092e\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u0967\u096f \u0965","The Self in a person who works purely as worship to the Lord , who controls his consciousness, who is dedicated and focused in his quest to realize the Self is considered similar to a flame that stays without shaking in a place without winds."],t.w)
B.QD=new A.e(B.c,["\u092f\u0924\u094d\u0930 \u0909\u092a\u0930\u092e\u0924\u0947 \u091a\u093f\u0924\u094d\u0924\u092e\u094d \u0928\u093f\u0930\u0941\u0926\u094d\u0927\u092e\u094d \u092f\u094b\u0917 \u0938\u0947\u0935\u092f\u093e \u0964\n\u092f\u0924\u094d\u0930 \u091a\u0948\u0935\u093e\u0924\u094d\u092e\u0928\u093e \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092a\u0936\u094d\u092f\u0928\u094d \u0906\u0924\u094d\u092e\u0928\u093f \u0924\u0941\u0937\u094d\u092f\u0924\u093f \u0965 \u0968\u0966 \u0965\n\u0938\u0941\u0916\u092e\u094d \u0905\u0924\u094d\u092f\u0928\u094d\u0924\u093f\u0915\u092e\u094d \u092f\u0924\u094d\u0924\u0926\u094d \u092c\u0941\u0926\u094d\u0927\u093f\u0917\u094d\u0930\u093e\u0939\u094d\u092f\u092e\u094d \u0905\u0924\u0940\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u092e\u094d \u0964\n\u0935\u0947\u0924\u094d\u0924\u093f \u092f\u0924\u094d\u0930 \u0928 \u091a\u0948\u0935\u093e\u092f\u092e\u094d \u0938\u094d\u0925\u093f\u0924\u0903 \u091a\u0932\u0924\u093f \u0924\u0924\u094d\u0924\u094d\u0935\u0924\u0903 \u0965 \u0968\u0967 \u0965\n\u092f\u092e\u094d \u0932\u092c\u094d\u0927\u094d\u0935\u093e \u091a\u093e\u092a\u0930\u092e\u094d \u0932\u093e\u092d\u092e\u094d \u092e\u0928\u094d\u092f\u0924\u0947 \u0928\u093e\u0927\u093f\u0915\u092e\u094d \u0924\u0924\u0903 \u0964\n\u092f\u0938\u094d\u092e\u093f\u0928\u094d \u0938\u094d\u0925\u093f\u0924\u0903 \u0928 \u0926\u0941\u0903\u0916\u0947\u0928 \u0917\u0941\u0930\u0941\u0923\u093e\u093d\u092a\u093f \u0935\u093f\u091a\u093e\u0932\u094d\u092f\u0924\u0947 \u0965 \u0968\u0968 \u0965\n\u0924\u092e\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u0924\u094d \u0926\u0941\u0903\u0916\u0938\u092e\u094d\u092f\u094b\u0917 \u0935\u093f\u092f\u094b\u0917\u092e\u094d \u092f\u094b\u0917 \u0938\u0928\u094d\u091c\u094d\u091e\u093f\u0924\u092e\u094d \u0964\n\u0938 \u0928\u093f\u0936\u094d\u091a\u092f\u0947\u0928 \u092f\u094b\u0915\u094d\u0924\u0935\u094d\u092f\u094b \u092f\u094b\u0917\u094b\u093d\u0928\u093f\u0930\u094d\u0935\u093f\u0923\u094d\u0923 \u091a\u0947\u0924\u0938\u093e \u0965 \u0968\u0969 \u0965","The state of being, in which the consciousness, controlled and focused for the purpose of realizing the Self and the Lord experiences ultimate joy, in which the consciousness sees the Self by using the mind and is content in the knowledge of the Self alone, in which it knows the unparalleled joy, which can only be grasped by knowledge , being beyond the reach of the senses - indeed, when it is situated in that state, it does not move from this ultimate reality. Further, having attained that state, it does not consider other benefits to be more valuable. While being in this state it does not get toppled even by huge difficulties and sorrows. Know that this state of being, which detaches you from bondage and sorrow is called \u2018yoga\u2019. This yoga is to be practiced with enthusiasm, without doubt."],t.w)
B.ND=new A.e(B.c,["\u0938\u0919\u094d\u0915\u0932\u094d\u092a \u092a\u094d\u0930\u092d\u0935\u093e\u0928\u094d \u0915\u093e\u092e\u093e\u0928\u094d \u0924\u094d\u092f\u0915\u094d\u0924\u094d\u0935\u093e \u0938\u0930\u094d\u0935\u093e\u0928\u094d \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u092e\u0928\u0938\u094d\u092f\u0948\u0935 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0935\u093f\u0928\u093f\u092f\u092e\u094d\u092f \u0938\u092e\u0928\u094d\u0924\u0924\u0903 \u0965 \u0968\u096a \u0965\n\u0936\u0928\u0948\u0903 \u0936\u0928\u0948\u0930\u0941\u092a\u0930\u092e\u0947\u0924\u094d \u092c\u0941\u0926\u094d\u0927\u094d\u092f\u093e \u0927\u0943\u0924\u093f \u0917\u0943\u0939\u0940\u0924\u092f\u093e \u0964\n\u0906\u0924\u094d\u092e\u0938\u092e\u094d\u0938\u094d\u0925\u092e\u094d \u092e\u0928\u0903 \u0915\u0943\u0924\u094d\u0935\u093e \u0928 \u0915\u093f\u0928\u094d\u091a\u093f\u0926\u092a\u093f \u091a\u093f\u0928\u094d\u0924\u092f\u0947\u0924\u094d \u0965 \u0968\u096b \u0965","Giving up all desires that arise out of our intentions without exceptions, controlling the group of organs in all ways using the mind itself, stationing the mind in the Self giving up, little by little, things other than the Self, using the knowledge grasped by perseverance, do not be anxious about anything."],t.w)
B.Vj=new A.e(B.c,["\u092f\u0924\u094b \u092f\u0924\u094b \u0928\u093f\u0936\u094d\u091a\u0930\u0924\u093f \u092e\u0928\u0903 \u091a\u0928\u094d\u091a\u0932\u092e\u094d \u0905\u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0964\n\u0924\u0924\u0938\u094d\u0924\u0924\u094b \u0928\u093f\u092f\u092e\u094d\u092f\u0948\u0924\u0924\u094d \u0906\u0924\u094d\u092e\u0928\u094d\u092f\u0947\u0935 \u0935\u0936\u092e\u094d \u0928\u092f\u0947\u0924\u094d \u0965 \u0968\u096c \u0965","The ever-wandering unstable mind needs to be brought under control among things that make it wander. Constrain it in the Self alone."],t.w)
B.Rg=new A.e(B.c,["\u092a\u094d\u0930\u0936\u093e\u0928\u094d\u0924 \u092e\u0928\u0938\u092e\u094d \u0939\u094d\u092f\u0947\u0928\u092e\u094d \u092f\u094b\u0917\u093f\u0928\u092e\u094d \u0938\u0941\u0916\u092e\u094d \u0909\u0924\u094d\u0924\u092e\u092e\u094d \u0964\n\u0909\u092a\u0948\u0924\u093f \u0936\u093e\u0928\u094d\u0924\u0930\u091c\u0938\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u092d\u0942\u0924\u092e\u094d \u0905\u0915\u0932\u094d\u092e\u0937\u092e\u094d \u0965 \u0968\u096d \u0965","Ultimate joy will definitely come to this person, who is in the quest for the Self , whose mind is at peace, whose passions have subsided , who is situated in the true nature of the Self, who is rid of all his faults."],t.w)
B.Ur=new A.e(B.c,["\u092f\u0941\u091e\u094d\u091c\u0928\u094d\u0928\u0947\u0935\u092e\u094d \u0938\u0926\u093e\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092f\u094b\u0917\u0940 \u0935\u093f\u0917\u0924 \u0915\u0932\u094d\u092e\u0937\u0903 \u0964\n\u0938\u0941\u0916\u0947\u0928 \u092c\u094d\u0930\u0939\u094d\u092e \u0938\u092e\u094d\u0938\u094d\u092a\u0930\u094d\u0936\u092e\u094d \u0905\u0924\u094d\u092f\u0928\u094d\u0924\u092e\u094d \u0938\u0941\u0916\u092e\u094d \u0905\u0936\u094d\u0928\u0941\u0924\u0947 \u0965 \u0968\u096e \u0965","In this way, a person who works without being driven stays in the quest for the Self. He easily experiences the ultimate joy of being in touch with the Self always, flawlessly."],t.w)
B.Q6=new A.e(B.c,["\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0938\u094d\u0925\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093f \u091a\u093e\u0924\u094d\u092e\u0928\u093f \u0964\n\u0908\u0915\u094d\u0937\u0924\u0947 \u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0938\u0930\u094d\u0935\u0924\u094d\u0930 \u0938\u092e\u0926\u0930\u094d\u0936\u0928\u0903 \u0965 \u0968\u096f \u0965","A person who is firm in his quest for the Self sees himself as being present within every being, and all the beings in his Self. He has an equal outlook everywhere."],t.w)
B.SZ=new A.e(B.c,["\u092f\u094b \u092e\u093e\u092e\u094d \u092a\u0936\u094d\u092f\u0924\u093f \u0938\u0930\u094d\u0935\u0924\u094d\u0930 \u0938\u0930\u094d\u0935\u092e\u094d \u091a \u092e\u092f\u093f \u092a\u0936\u094d\u092f\u0924\u093f \u0964\n\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0928 \u092a\u094d\u0930\u0923\u0936\u094d\u092f\u093e\u092e\u093f \u0938 \u091a \u092e\u0947 \u0928 \u092a\u094d\u0930\u0923\u0936\u094d\u092f\u0924\u093f \u0965 \u0969\u0966 \u0965","For the one who sees me everywhere and sees everything in me, I will not go unseen. He does not go unseen to me either."],t.w)
B.OB=new A.e(B.c,["\u0938\u0930\u094d\u0935\u092d\u0942\u0924\u0938\u094d\u0925\u093f\u0924\u092e\u094d \u092f\u094b \u092e\u093e\u092e\u094d \u092d\u091c\u0924\u093f \u090f\u0915\u0924\u094d\u0935\u092e\u093e\u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u0938\u0930\u094d\u0935\u0925\u093e \u0935\u0930\u094d\u0924\u092e\u093e\u0928\u094b\u093d\u092a\u093f \u0938 \u092f\u094b\u0917\u0940 \u092e\u092f\u093f \u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0969\u0967 \u0965","The person who worships Me, the one who is situated in all beings, believes in My uniqueness and exists in one-ness with Me. This person, who is in the quest for the Self resides in Me, even though he exists in all kinds of situations."],t.w)
B.Nk=new A.e(B.c,["\u0906\u0924\u094d\u092e\u094c\u092a\u092e\u094d\u092f\u0947\u0928 \u0938\u0930\u094d\u0935\u0924\u094d\u0930 \u0938\u092e\u092e\u094d \u092a\u0936\u094d\u092f\u0924\u093f \u092f\u094b\u093d\u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0938\u0941\u0916\u092e\u094d \u0935\u093e \u092f\u0926\u093f \u0935\u093e \u0926\u0941\u0903\u0916\u092e\u094d \u0938 \u092f\u094b\u0917\u0940 \u092a\u0930\u092e\u094b \u092e\u0924\u0903 \u0965 \u0969\u0968 \u0965","Arjuna, the person who sees equality everywhere, whether in happiness or in difficulties due to the equivalence of the Self in everyone, this person, who is in the quest for realizing the Self is the ultimate \u2013 that is my opinion."],t.w)
B.PU=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092f\u094b\u093d\u092f\u092e\u094d \u092f\u094b\u0917\u0938\u094d\u0924\u094d\u0935\u092f\u093e \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u0903 \u0938\u093e\u092e\u094d\u092f\u0947\u0928 \u092e\u0927\u0941\u0938\u0942\u0927\u0928 \u0964\n\u090f\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0928 \u092a\u0936\u094d\u092f\u093e\u092e\u093f \u091a\u0928\u094d\u091a\u0932\u0924\u094d\u0935\u093e\u0924\u094d \u0938\u094d\u0925\u093f\u0924\u093f\u092e\u094d \u0938\u094d\u0925\u093f\u0930\u093e\u092e\u094d \u0965 \u0969\u0969 \u0965\n\u091a\u0928\u094d\u091a\u0932\u092e\u094d \u0939\u093f \u092e\u0928\u0903 \u0915\u0943\u0937\u094d\u0923 \u092a\u094d\u0930\u092e\u093e\u0925\u093f \u092c\u0932\u0935\u0924\u094d \u0926\u0943\u0922\u092e\u094d \u0964\n\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0928\u093f\u0917\u094d\u0930\u0939\u092e\u094d \u092e\u0928\u094d\u092f\u0947 \u0935\u093e\u092f\u094b\u0930\u093f\u0935 \u0938\u0941\u0926\u0941\u0937\u094d\u0915\u0930\u092e\u094d \u0965 \u0969\u096a \u0965","Arjuna said Krishna, due to the mind being volatile, I do not see this yoga, which was told by you as equanimity, as a state with any stability. Krishna, the mind is indeed unstable. As if by force, it causes diversions that are very strong. I am of the opinion that it is extremely difficult to gain control over it, just as it is difficult to gain control over the wind."],t.w)
B.Qx=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0905\u0938\u0902\u0936\u092f\u092e\u094d \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u092e\u0928\u094b \u0926\u0941\u0930\u094d\u0928\u093f\u0917\u094d\u0930\u0939\u092e\u094d \u091a\u0932\u092e\u094d \u0964\n\u0905\u092d\u094d\u092f\u093e\u0938\u0947\u0928 \u0924\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0935\u0948\u0930\u093e\u0917\u094d\u092f\u0947\u0923 \u091a \u0917\u0943\u0939\u094d\u092f\u0924\u0947 \u0965 \u0969\u096b \u0965\n\u0905\u0938\u092e\u094d\u092f\u0924\u093e\u0924\u094d\u092e\u0928\u093e \u092f\u094b\u0917\u094b \u0926\u0941\u0937\u094d\u091f\u094d\u0930\u093e\u092a \u0907\u0924\u093f \u092e\u0947 \u092e\u0924\u093f\u0903 \u0964\n\u0935\u0936\u094d\u092f\u093e\u0924\u094d\u092e\u0928\u093e \u0924\u0941 \u092f\u0924\u0924\u093e \u0936\u0915\u094d\u092f\u094b\u093d\u0935\u093e\u092a\u094d\u0924\u0941\u092e\u094d \u0909\u092a\u093e\u092f\u0924\u0903 \u0965 \u0969\u096c \u0965","Lord Krishna said: O one with powerful arms, there is no doubt that the mind keeps wandering and is difficult to control. However, Arjuna, by practice and by preventing oneself from being driven by desire, it can be brought under our grip. Someone who doesn\u2019t\u200b have his mind under control would find it impossible to pursue the Self - this is my opinion. On the other hand, it is achievable by a person who has control, who perseveres according to the described methods."],t.w)
B.R0=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0905\u092f\u0924\u093f\u0903 \u0936\u094d\u0930\u0926\u094d\u0927\u092f\u094b\u092a\u0947\u0924\u094b \u092f\u094b\u0917\u093e\u0924\u094d \u091a\u0932\u093f\u0924 \u092e\u093e\u0928\u0938\u0903 \u0964\n\u0905\u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092f\u094b\u0917 \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u093f\u092e\u094d \u0915\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0915\u0943\u0937\u094d\u0923 \u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0969\u096d \u0965\n\u0915\u091a\u094d\u091a\u093f\u0924\u094d \u0928 \u0909\u092d\u092f \u0935\u093f\u092d\u094d\u0930\u0937\u094d\u091f\u0903 \u091b\u093f\u0928\u094d\u0928\u093e\u092d\u094d\u0930\u092e\u093f\u0935 \u0928\u0936\u094d\u092f\u0924\u093f \u0964\n\u0905\u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u094b \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0935\u093f\u092e\u0942\u0922\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u0903 \u092a\u0925\u093f \u0965 \u0969\u096e \u0965\n\u090f\u0924\u092e\u094d \u092e\u0947 \u0938\u0902\u0936\u092f\u092e\u094d \u0915\u0943\u0937\u094d\u0923! \u091b\u0947\u0924\u094d\u0924\u0941\u092e\u094d \u0905\u0930\u094d\u0939\u0938\u093f \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u0924\u094d\u0935\u0926\u0928\u094d\u092f\u0903 \u0938\u092e\u094d\u0937\u092f\u0938\u094d\u092f\u093e\u0938\u094d\u092f \u091b\u0947\u0924\u094d\u0924\u093e \u0928\u0939\u094d\u092f\u0941\u092a\u092a\u0926\u094d\u092f\u0924\u0947 \u0965 \u0969\u096f \u0965","Arjuna said: Krishna, a person with the best intentions and sufficient dedication without perseverance and proper efforts will have his mind wander from the path of realizing the Self. Without attaining the goal of realizing the Self, what will be his state? Will he not go wasted, being ineffective on both sides, like a small piece of cloud that gets separated from a big thunder-cloud? He would have nothing to rest on, having deviated from the path of realizing the Self and the Lord. O Krishna, this is my doubt! You have the ability to get rid of it completely. Other than You, there is indeed nobody who can get rid of this doubt."],t.w)
B.T7=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092a\u093e\u0930\u094d\u0925 \u0928\u0948\u0935\u0947\u0939 \u0928\u093e\u092e\u0941\u0924\u094d\u0930 \u0935\u093f\u0928\u093e\u0936\u0938\u094d\u0924\u0938\u094d\u092f \u0935\u093f\u0926\u094d\u092f\u0924\u0947 \u0964\n\u0928 \u0939\u093f \u0915\u0932\u094d\u092f\u093e\u0923 \u0915\u0943\u0924\u094d \u0915\u0936\u094d\u091a\u093f\u0924\u094d \u0926\u0941\u0930\u094d\u0917\u0924\u093f\u092e\u094d \u0924\u093e\u0924 \u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u096a\u0966 \u0965","Lord Krishna said \u2013 Arjuna, there is no destruction for this person - not here, not anywhere else. Any person who does virtuous deeds shall not fall into misfortune, my friend."],t.w)
B.OP=new A.e(B.c,["\u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092a\u0941\u0923\u094d\u092f\u0915\u0943\u0924\u093e\u0928\u094d \u0932\u094b\u0915\u093e\u0928\u094d \u0909\u0937\u093f\u0924\u094d\u0935\u093e \u0936\u093e\u0936\u094d\u0935\u0924\u0940\u0903 \u0938\u092e\u093e\u0903 \u0964\n\u0936\u0941\u091a\u0940\u0928\u093e\u092e\u094d \u0936\u094d\u0930\u0940\u092e\u0924\u093e\u092e\u094d \u0917\u0947\u0939\u0947 \u092f\u094b\u0917 \u092d\u094d\u0930\u0937\u094d\u091f\u094b\u093d\u092d\u093f\u091c\u093e\u092f\u0924\u0947 \u0965 \u096a\u0967 \u0965","A person who has started on the path to realize the Self but has slipped obtains fortunate environments, lives there for a long time and will be born to a family of open and affectionate people, who are endowed with good material comforts."],t.w)
B.TB=new A.e(B.c,["\u0905\u0925\u0935\u093e \u092f\u094b\u0917\u093f\u0928\u093e\u092e\u094d \u090f\u0935 \u0915\u0941\u0932\u0947 \u092d\u0935\u0924\u093f \u0927\u0940\u092e\u0924\u093e\u092e\u094d \u0964\n\u090f\u0924\u0926\u094d\u0927\u093f \u0926\u0941\u0930\u094d\u0932\u092d\u0924\u0930\u092e\u094d \u0932\u094b\u0915\u0947 \u091c\u0928\u094d\u092e \u092f\u0926\u0940\u0926\u0943\u0936\u092e\u094d \u0965 \u096a\u0968 \u0965","A person who slipped after going further on the path to realize the Self is born to a family of wise people who are capable of teaching, and who themselves practice the realization of the Self. This type of birth is extremely rare and difficult to get in this world."],t.w)
B.RL=new A.e(B.c,["\u0924\u0924\u094d\u0930 \u0924\u092e\u094d \u092c\u0941\u0926\u094d\u0927\u093f\u0938\u0902\u092f\u094b\u0917\u092e\u094d \u0932\u092d\u0924\u0947 \u092a\u094c\u0930\u094d\u0935 \u0926\u0948\u0939\u093f\u0915\u092e\u094d \u0964\n\u092f\u0924\u0924\u0947 \u091a \u0924\u0924\u094b \u092d\u0942\u092f\u0903 \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u094c \u0915\u0941\u0930\u0941\u0928\u0928\u094d\u0926\u0928 \u0965 \u096a\u0969 \u0965\n\u092a\u0942\u0930\u094d\u0935\u093e\u092d\u094d\u092f\u093e\u0938\u0947\u0928 \u0924\u0947\u0928\u0948\u0935 \u0939\u094d\u0930\u093f\u092f\u0924\u0947 \u0939\u094d\u092f\u0935\u0936\u094b\u093d\u092a\u093f \u0938\u0903 \u0964","Arjuna, in this birth (mentioned in the previous two Shlokas), he will regain the same knowledge of the Self, as he had in his previous body. Then, he strives for realizing the Self with greater strength. He will definitely get pulled towards the realization of the Self due to the same practice he was involved in previously, even though he has not controlled his mind to focus upon it entirely."],t.w)
B.Sq=new A.e(B.c,["\u091c\u093f\u091c\u094d\u091e\u093e\u0938\u0941\u0930\u092a\u093f \u092f\u094b\u0917\u0938\u094d\u092f \u0936\u092c\u094d\u0926\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0924\u093f\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u096a\u096a \u0965","Even a person who wants to know the nature of yoga will overcome the influence of material stimuli."],t.w)
B.S7=new A.e(B.c,["\u092a\u094d\u0930\u092f\u0924\u094d\u0928\u093e\u0924\u094d \u092f\u0924\u092e\u093e\u0928\u0938\u094d\u0924\u0941 \u092f\u094b\u0917\u0940 \u0938\u092e\u094d\u0936\u0941\u0926\u094d\u0927 \u0915\u093f\u0932\u094d\u092c\u093f\u0937\u0903 \u0964\n\u0905\u0928\u0947\u0915 \u091c\u0928\u094d\u092e \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u0903 \u0924\u0924\u094b \u092f\u093e\u0924\u093f \u092a\u0930\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0965 \u096a\u096b \u0965","Hence, a person who has set out on the path to realize the Self obtains the ultimate goal accomplished over several births by persevering with efforts, having been cleaned of all flaws."],t.w)
B.Qw=new A.e(B.c,["\u0924\u092a\u0938\u094d\u0935\u093f\u092d\u094d\u092f\u094b\u093d\u0927\u093f\u0915\u094b \u092f\u094b\u0917\u0940 \u091c\u094d\u091e\u093e\u0928\u093f\u092d\u094d\u092f\u094b\u093d\u092a\u093f \u092e\u0924\u094b\u093d\u0927\u093f\u0915\u0903 \u0964\n\u0915\u0930\u094d\u092e\u093f\u092d\u094d\u092f\u0903 \u091a\u093e\u0927\u093f\u0915\u094b \u092f\u094b\u0917\u0940 \u0924\u0938\u094d\u092e\u093e\u0924\u094d \u092f\u094b\u0917\u0940 \u092d\u0935\u093e\u0930\u094d\u091c\u0941\u0928 \u0965 \u096a\u096c \u0965","A person who practices yoga is higher than people who perform penance. He is considered to be higher than learned people as well. The person who practices yoga is also higher than people who work hard to get results. Hence, Arjuna, practice yoga ."],t.w)
B.SW=new A.e(B.c,["\u092f\u094b\u0917\u093f\u0928\u093e\u092e\u094d \u0905\u092a\u093f \u0938\u0930\u094d\u0935\u0947\u0937\u093e\u092e\u094d \u092e\u0926\u094d\u0917\u0924\u0947\u0928 \u0905\u0928\u094d\u0924\u0930\u093e\u0924\u094d\u092e\u0928\u093e \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093e\u0928\u094d \u092d\u091c\u0924\u0947 \u092f\u094b \u092e\u093e\u092e\u094d \u0938 \u092e\u0947 \u092f\u0941\u0915\u094d\u0924\u0924\u092e\u094b \u092e\u0924\u0903 \u0965 \u096a\u096d \u0965","The person who worships Me, having placed himself within Me with complete trust, I consider him to be the most focused, even in comparison to all those who persevere to realize the Self."],t.w)
B.Wz=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a -\n\u092e\u092f\u094d\u092f\u093e\u0938\u0915\u094d\u0924 \u092e\u0928\u093e\u0903 \u092a\u093e\u0930\u094d\u0925 \u092f\u094b\u0917\u092e\u094d \u092f\u0941\u0928\u094d\u091c\u0928\u094d \u092e\u0926\u093e\u0936\u094d\u0930\u092f\u0903 \u0964\n\u0905\u0938\u0902\u0936\u092f\u092e\u094d \u0938\u092e\u0917\u094d\u0930\u092e\u094d \u092e\u093e\u092e\u094d \u092f\u0925\u093e \u091c\u094d\u091e\u093e\u0938\u094d\u092f\u0938\u093f \u0924\u0924\u094d \u0936\u0943\u0923\u0941 \u0965 \u0967 \u0965","The Lord said: Arjuna, listen to the way in which you will know me entirely without any doubt, with a mind filled with eagerness towards Me, embarking on the journey to join Me, having taken refuge in Me"],t.w)
B.Ww=new A.e(B.c,["\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u0947\u093d\u0939\u092e\u094d \u0938\u0935\u093f\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0907\u0926\u092e\u094d \u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u0905\u0936\u0947\u0937\u0924\u0903 \u0964\n\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0928\u0947\u0939 \u092d\u0942\u092f\u094b \u0905\u0928\u094d\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u0935\u094d\u092f\u092e\u094d \u0905\u0935\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0965 \u0968 \u0965","I will now tell you this knowledge along with the ability to distinguish, in completeness. After knowing this there is nothing else, which remains over here to be learnt any more."],t.w)
B.Sm=new A.e(B.c,["\u092e\u0928\u0941\u0937\u094d\u092f\u093e\u0923\u093e\u092e\u094d \u0938\u0939\u0938\u094d\u0930\u0947\u0937\u0941 \u0915\u0936\u094d\u091a\u093f\u0924\u094d \u092f\u0924\u0924\u093f \u0938\u093f\u0926\u094d\u0927\u092f\u0947 \u0964\n\u092f\u0924\u0924\u093e\u092e\u092a\u093f \u0938\u093f\u0926\u094d\u0927\u093e\u0928\u093e\u092e\u094d \u0915\u0936\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u092e\u094d \u0935\u0947\u0924\u094d\u0924\u093f \u0924\u0924\u094d\u0935\u0924\u0903 \u0965 \u0969 \u0965","Among thousands of people, someone persists in his endeavor to achieve supreme knowledge. Even among those who persevere to achieve this knowledge, someone among them will know Me in My true form."],t.w)
B.Wl=new A.e(B.c,["\u092d\u0942\u092e\u093f\u0930\u093e\u092a\u094b\u093d\u0928\u0932\u094b \u0935\u093e\u092f\u0941\u0903 \u0916\u092e\u094d \u092e\u0928\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0930\u0947\u0935 \u091a \u0964\n\u0905\u0939\u0919\u094d\u0915\u093e\u0930 \u0907\u0924\u0940\u092f\u092e\u094d \u092e\u0947 \u092d\u093f\u0928\u094d\u0928\u093e \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0930\u0937\u094d\u091f\u0927\u093e \u0965 \u096a \u0965","This universe of mine is divided into eight categories: Solids, liquids, gasses, energy, space, mind, the gross collections and the notion of individuality."],t.w)
B.Wy=new A.e(B.c,["\u0905\u092a\u0930\u0947\u092f\u092e\u094d \u0907\u0924\u0938\u094d\u0924\u094d\u0935\u0928\u094d\u092f\u093e\u092e\u094d \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u0947 \u092a\u0930\u093e\u092e\u094d \u0964\n\u091c\u0940\u0935\u092d\u0942\u0924\u093e\u092e\u094d \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u092f\u092f\u093e \u0907\u0926\u092e\u094d \u0927\u093e\u0930\u094d\u092f\u0924\u0947 \u091c\u0917\u0924\u094d \u0965 \u096b \u0965","Arjuna, the universe that I just described is not the ultimate one. Know My ultimate nature, which is something distinct from this one, in the form of a conscious being by whom this world is sustained."],t.w)
B.PL=new A.e(B.c,["\u090f\u0924\u0924\u094d \u092f\u094b\u0928\u0940\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u0938\u0930\u094d\u0935\u093e\u0923\u093f \u0907\u0924\u094d\u092f\u0941\u092a\u0927\u093e\u0930\u092f \u0964\n\u0905\u0939\u092e\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u0938\u094d\u092f \u091c\u0917\u0924\u0903 \u092a\u094d\u0930\u092d\u0935\u0903 \u092a\u094d\u0930\u0932\u092f\u0938\u094d\u0924\u0925\u093e \u0965 \u096c \u0965","Bear in mind that all beings owe their existence to the two natures. In this way, I am the creator and the destroyer of the entire universe."],t.w)
B.Ut=new A.e(B.c,["\u092e\u0924\u094d\u0924\u0903 \u092a\u0930\u0924\u0930\u092e\u094d \u0928\u093e\u0928\u094d\u092f\u0924\u094d \u0915\u093f\u0928\u094d\u091a\u093f\u0924\u094d \u0905\u0938\u094d\u0924\u093f \u0927\u0928\u0928\u094d\u091c\u092f \u0964\n\u092e\u092f\u093f \u0938\u0930\u094d\u0935\u092e\u094d \u0907\u0926\u092e\u094d \u092a\u094d\u0930\u094b\u0924\u092e\u094d \u0938\u0942\u0924\u094d\u0930\u0947 \u092e\u0923\u093f\u0917\u0923\u093e \u0907\u0935 \u0965 \u096d \u0965","Arjuna, there is absolutely nothing else that is beyond Me. All of this is mounted in Me just as beads are strung in a string,"],t.w)
B.Oa=new A.e(B.c,["\u0930\u0938\u094b\u093d\u0939\u092e\u094d \u0905\u092a\u094d\u0938\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u094d\u0930\u092d\u093e\u093d\u0938\u094d\u092e\u093f \u0936\u0936\u093f \u0938\u0942\u0930\u094d\u092f\u092f\u094b\u0903 \u0964\n\u092a\u094d\u0930\u0923\u0935\u0903 \u0938\u0930\u094d\u0935 \u0935\u0947\u0926\u0947\u0937\u0941 \u0936\u092c\u094d\u0926\u0903 \u0916\u0947 \u092a\u094c\u0930\u0941\u0937\u092e\u094d \u0928\u0943\u0937\u0941 \u0965 \u096e \u0965\n\u092a\u0941\u0923\u094d\u092f\u094b \u0917\u0928\u094d\u0927\u0903 \u092a\u0943\u0925\u093f\u0935\u094d\u092f\u093e\u092e\u094d \u091a \u0924\u0947\u091c\u0936\u094d\u091a \u0905\u0938\u094d\u092e\u093f \u0935\u093f\u092d\u093e\u0935\u0938\u094c \u0964\n\u091c\u0940\u0935\u0928\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0947\u0937\u0941 \u0924\u092a\u0936\u094d\u091a\u093e\u0938\u094d\u092e\u093f \u0924\u092a\u0938\u094d\u0935\u093f\u0937\u0941 \u0965 \u096f \u0965\n\u092c\u0940\u091c\u092e\u094d \u092e\u093e\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092a\u093e\u0930\u094d\u0925 \u0938\u0928\u093e\u0924\u0928\u092e\u094d \u0964\n\u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u092c\u0941\u0926\u094d\u0927\u093f\u092e\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0924\u0947\u091c\u0903 \u0924\u0947\u091c\u0938\u094d\u0935\u093f\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0967\u0966 \u0965\n\u092c\u0932\u092e\u094d \u092c\u0932\u0935\u0924\u093e\u092e\u094d \u091a\u093e\u0939\u092e\u094d \u0915\u093e\u092e \u0930\u093e\u0917 \u0935\u093f\u0935\u0930\u094d\u091c\u093f\u0924\u092e\u094d \u0964\n\u0927\u0930\u094d\u092e \u0905\u0935\u093f\u0930\u0941\u0926\u094d\u0927\u094b \u092d\u0942\u0924\u0947\u0937\u0941 \u0915\u093e\u092e\u094b\u0938\u094d\u092e\u093f \u092d\u0930\u0924\u0930\u094d\u0937\u092d \u0965 \u0967\u0967 \u0965","Arjuna, I am the taste in all liquids, the radiance in the moon and the sun, I am the sacred syllable (Om) in all the Vedas, the waves in space, capability in humans. I am the pleasant fragrance of this Earth and the energy in a fire. I am the life in all living beings and thoughts in the people who focus their intellect. Arjuna, know Me as the primary cause of all beings, existing since beginning-less time. I am the intellect of intelligent beings, the brilliance in brilliant people. Arjuna, I am the power in powerful people, free of desire and indulgence. I am the love, which does not oppose My principles, in the beings of this world."],t.w)
B.Pu=new A.e(B.c,["\u092f\u0947 \u091a\u0948\u0935 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u093e \u092d\u093e\u0935\u093e \u0930\u093e\u091c\u0938\u093e\u0903 \u0924\u093e\u092e\u0938\u093e\u0936\u094d\u091a \u092f\u0947 \u0964\n\u092e\u0924\u094d\u0924 \u090f\u0935\u0947\u0924\u093f \u0924\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0928 \u0924\u094d\u0935\u0939\u092e\u094d \u0924\u0947\u0937\u0941 \u0924\u0947 \u092e\u092f\u093f \u0965 \u0967\u0968 \u0965","All these feelings of wisdom and virtue, passion and activity, ignorance and laziness - know that they originate from Me. However, I am not bound in them. They are situated in Me."],t.w)
B.TM=new A.e(B.c,["\u0924\u094d\u0930\u093f\u092d\u093f\u0903 \u0917\u0941\u0923\u092e\u092f\u0948\u0903 \u092d\u093e\u0935\u0948\u0903 \u090f\u092d\u093f\u0903 \u0938\u0930\u094d\u0935\u092e\u094d \u0907\u0926\u092e\u094d \u091c\u0917\u0924\u094d \u0964\n\u092e\u094b\u0939\u093f\u0924\u092e\u094d \u0928\u093e\u092d\u093f\u091c\u093e\u0928\u093e\u0924\u093f \u092e\u093e\u092e\u0947\u092d\u094d\u092f\u0903 \u092a\u0930\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0967\u0969 \u0965","Being deluded by these ways of thinking and feeling that are pervaded by the three qualities , this whole world does not know Me, who is above them, who stays unchanged."],t.w)
B.Ou=new A.e(B.c,["\u0926\u0948\u0935\u0940 \u0939\u094d\u092f\u0947\u0937\u093e \u0917\u0941\u0923\u092e\u092f\u0940 \u092e\u092e \u092e\u093e\u092f\u093e \u0926\u0941\u0930\u0924\u094d\u092f\u092f\u093e \u0964\n\u092e\u093e\u092e\u0947\u0935 \u092f\u0947 \u092a\u094d\u0930\u092a\u0926\u094d\u092f\u0928\u094d\u0924\u0947 \u092e\u093e\u092f\u093e\u092e\u0947\u0924\u093e\u092e\u094d \u0924\u0930\u0928\u094d\u0924\u093f \u0924\u0947 \u0965 \u0967\u096a \u0965","These divine creations of Mine are pervaded by the three qualities . They are indeed impossible to cross over. The people who surrender exclusively to Me - they will cross over this material world."],t.w)
B.RI=new A.e(B.c,["\u0928 \u092e\u093e\u092e\u094d \u0926\u0941\u0937\u094d\u0915\u0943\u0924\u093f\u0928\u094b \u092e\u0942\u0922\u093e\u0903 \u092a\u094d\u0930\u092a\u0926\u094d\u092f\u0928\u094d\u0924\u0947 \u0928\u0930\u093e\u0927\u092e\u093e\u0903 \u0964\n\u092e\u093e\u092f\u092f\u093e \u0905\u092a\u0939\u0943\u0924 \u091c\u094d\u091e\u093e\u0928\u093e\u0903 \u0905\u0938\u0941\u0930\u092e\u094d \u092d\u093e\u0935\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u093e\u0903 \u0965 \u0967\u096b \u0965","People who do not value virtue are ignorant. They do not take refuge in Me. Even though they consider Me to be ordinary, they do not approach Me. The material world and its perceptions have stolen awareness in them. Yet others know about My vast powers, possessions and My knowledge, but that only builds jealousy and hatred towards Me."],t.w)
B.PS=new A.e(B.c,["\u091a\u0924\u0941\u0930\u094d\u0935\u093f\u0927\u093e \u092d\u091c\u0928\u094d\u0924\u0947 \u092e\u093e\u092e\u094d \u091c\u0928\u093e\u0903 \u0938\u0941\u0915\u0943\u0924\u093f\u0928\u0903 \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0906\u0930\u094d\u0924\u094b \u091c\u093f\u091c\u094d\u091e\u093e\u0938\u0941\u0903 \u0905\u0930\u094d\u0925\u093e\u0930\u094d\u0925\u0940 \u091c\u094d\u091e\u093e\u0928\u0940 \u091a \u092d\u0930\u0924\u0930\u094d\u0937\u092d \u0965 \u0967\u096c \u0965","Arjuna, four types of virtuous people worship Me: The distressed, who want to regain what they lost, those who are curious, those who want to acquire wealth and those who know."],t.w)
B.RC=new A.e(B.c,["\u0924\u0947\u0937\u093e\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u0940 \u0928\u093f\u0924\u094d\u092f\u092f\u0941\u0915\u094d\u0924\u0903 \u090f\u0915\u092d\u0915\u094d\u0924\u093f\u0903 \u0935\u093f\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0964\n\u092a\u094d\u0930\u093f\u092f\u094b \u0939\u093f \u091c\u094d\u091e\u093e\u0928\u093f\u0928\u0903 \u0905\u0924\u094d\u092f\u0930\u094d\u0925\u092e\u094d \u0905\u0939\u092e\u094d \u0938 \u091a \u092e\u092e \u092a\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967\u096d \u0965","Among them, the one who knows , whose thoughts are always with Me, who is devoted to Me alone is special. I am dear to this wise person, in a way that is entirely beyond description. He is dear to Me as well."],t.w)
B.W4=new A.e(B.c,["\u0909\u0926\u093e\u0930\u093e\u0903 \u0938\u0930\u094d\u0935 \u090f\u0935\u0948\u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u0940 \u0924\u0941 \u0906\u0924\u094d\u092e\u0948\u0935 \u092e\u0947 \u092e\u0924\u092e\u094d \u0964\n\u0906\u0938\u094d\u0925\u093f\u0924\u0903 \u0938 \u0939\u093f \u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u092e\u093e\u092e\u0947\u0935 \u0905\u0928\u0941\u0924\u094d\u0924\u092e\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0965 \u0967\u096e \u0965","All of these people are definitely generous. However, I assert that the one who knows is like Myself. His thoughts are always with Me. He believes and takes refuge in Me alone, the supreme goal."],t.w)
B.To=new A.e(B.c,["\u092c\u0939\u0942\u0928\u093e\u092e\u094d \u091c\u0928\u094d\u092e\u0928\u093e\u092e\u094d \u0905\u0928\u094d\u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u0935\u093e\u0928\u094d \u092e\u093e\u092e\u094d \u092a\u094d\u0930\u092a\u0926\u094d\u092f\u0924\u0947 \u0964\n\u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0903 \u0938\u0930\u094d\u0935\u092e\u094d \u0907\u0924\u093f \u0938 \u092e\u0939\u093e\u0924\u094d\u092e\u093e \u0938\u0941\u0926\u0941\u0930\u094d\u0932\u092d\u0903 \u0965 \u0967\u096f \u0965","At the end of many births, a person who knows will surrender to Me with the conviction that Lord Krishna is everything. Such a great person is extremely difficult to find."],t.w)
B.UX=new A.e(B.c,["\u0915\u093e\u092e\u0948\u0903 \u0924\u0948\u0938\u094d\u0924\u0948\u0903 \u0939\u0943\u0924\u091c\u094d\u091e\u093e\u0928\u093e\u0903 \u092a\u094d\u0930\u092a\u0926\u094d\u092f\u0928\u094d\u0924\u0947 \u0905\u0928\u094d\u092f \u0926\u0947\u0935\u0924\u093e\u0903 \u0964\n\u0924\u092e\u094d \u0924\u092e\u094d \u0928\u093f\u092f\u092e\u092e\u094d \u0906\u0938\u094d\u0925\u093e\u092f \u092a\u094d\u0930\u0915\u0943\u0924\u094d\u092f\u093e \u0928\u093f\u092f\u0924\u093e\u0903 \u0938\u094d\u0935\u092f\u093e \u0965 \u0968\u0966 \u0965","Being controlled by their own nature, their knowledge taken by various desires of that nature, people take refuge in other powers by following various methods, in order to attain those desires."],t.w)
B.Si=new A.e(B.c,["\u092f\u094b \u092f\u094b \u092f\u093e\u092e\u094d \u092f\u093e\u092e\u094d \u0924\u0928\u0941\u092e\u094d \u092d\u0915\u094d\u0924\u0903 \u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e \u0905\u0930\u094d\u091a\u093f\u0924\u0941\u092e\u094d \u0907\u091a\u094d\u091b\u0924\u093f \u0964\n\u0924\u0938\u094d\u092f \u0924\u0938\u094d\u092f \u0905\u091a\u0932\u093e\u092e\u094d \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092e\u094d \u0924\u093e\u092e\u0947\u0935 \u0935\u093f\u0926\u0927\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0965 \u0968\u0967 \u0965","Which ever devotee likes to please what ever form with dedication, I give stability to the same faith in each of them."],t.w)
B.S2=new A.e(B.c,["\u0938 \u0924\u092f\u093e \u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e \u092f\u0941\u0915\u094d\u0924\u0903 \u0924\u0938\u094d\u092f \u0906\u0930\u093e\u0927\u0928\u092e\u094d \u0908\u0939\u0924\u0947 \u0964\n\u0932\u092d\u0924\u0947 \u091a \u0924\u0924\u0903 \u0915\u093e\u092e\u093e\u0928\u094d \u092e\u092f\u093e \u090f\u0935 \u0935\u093f\u0939\u093f\u0924\u093e\u0928\u094d \u0939\u093f \u0924\u093e\u0928\u094d \u0965 \u0968\u0968 \u0965","With that dedication, the person wishes to worship accordingly. By this he obtains the desires he wants. These desires are given by Me alone."],t.w)
B.UK=new A.e(B.c,["\u0905\u0928\u094d\u0924\u0935\u0924\u094d\u0924\u0941 \u092b\u0932\u092e\u094d \u0924\u0947\u0937\u093e\u092e\u094d \u0924\u0926\u094d\u092d\u0935\u0924\u093f \u0905\u0932\u094d\u092a \u092e\u0947\u0927\u0938\u093e\u092e\u094d \u0964\n\u0926\u0947\u0935\u093e\u0928\u094d \u0926\u0947\u0935\u092f\u091c\u094b \u092f\u093e\u0928\u094d\u0924\u093f \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u093e \u092f\u093e\u0928\u094d\u0924\u093f \u092e\u093e\u092e\u094d \u0905\u092a\u093f \u0965 \u0968\u0969 \u0965","However, those results, which are obtained by people with little knowledge are short-lived. People who reach out to various powers will obtain those powers. My devotees will also attain Me."],t.w)
B.NW=new A.e(B.c,["\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u092e\u094d \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u092e\u094d \u0906\u092a\u0928\u094d\u0928\u092e\u094d \u092e\u0928\u094d\u092f\u0928\u094d\u0924\u0947 \u092e\u093e\u092e\u094d \u0905\u092c\u0941\u0926\u094d\u0927\u092f\u0903 \u0964\n\u092a\u0930\u092e\u094d \u092d\u093e\u0935\u092e\u094d \u0905\u091c\u093e\u0928\u0928\u094d\u0924\u094b \u092e\u092e \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0905\u0928\u0941\u0924\u094d\u0924\u092e\u092e\u094d \u0965 \u0968\u096a \u0965","People who are incapable of discerning don\u2019t know My ultimate characteristics of never wearing out and of not having anyone superior. They believe that I am someone who is invisible, who has obtained a visible form."],t.w)
B.V_=new A.e(B.c,["\u0928\u093e\u0939\u092e\u094d \u092a\u094d\u0930\u0915\u093e\u0936\u0903 \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u092f\u094b\u0917 \u092e\u093e\u092f\u093e \u0938\u092e\u093e\u0935\u0943\u0924\u0903 \u0964\n\u092e\u0942\u0922\u0903 \u0905\u092f\u092e\u094d \u0928\u093e\u092d\u093f\u091c\u093e\u0928\u093e\u0924\u093f \u0932\u094b\u0915\u094b \u092e\u093e\u092e\u094d \u0905\u091c\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0968\u096b \u0965","Being covered by My miraculous association with a human form, I am not apparent in My brilliance to everyone. People of this world, being unaware, do not know Me as the one who is without birth, who does not diminish in any way."],t.w)
B.NJ=new A.e(B.c,["\u0935\u0947\u0926\u093e\u0939\u092e\u094d \u0938\u092e\u0924\u0940\u0924\u093e\u0928\u093f \u0935\u0930\u094d\u0924\u092e\u093e\u0928\u093e\u0928\u093f \u091a \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u092d\u0935\u093f\u0937\u094d\u092f\u093e\u0923\u093f \u091a \u092d\u0942\u0924\u093e\u0928\u093f \u092e\u093e\u092e\u094d \u0924\u0941 \u0935\u0947\u0926 \u0928 \u0915\u0936\u094d\u091a\u0928 \u0965 \u0968\u096c \u0965","Arjuna, I know the beings whose time has passed, who are present now and those who will be in the future. However, there isn't anyone who knows Me."],t.w)
B.NR=new A.e(B.c,["\u0907\u091a\u094d\u091b\u093e \u0926\u094d\u0935\u0947\u0937 \u0938\u092e\u0941\u0924\u094d\u0925\u0947\u0928 \u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935 \u092e\u094b\u0939\u0947\u0928 \u092d\u093e\u0930\u0924 \u0964\n\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093f \u0938\u092e\u094d\u092e\u094b\u0939\u092e\u094d \u0938\u0930\u094d\u0917\u0947 \u092f\u093e\u0928\u094d\u0924\u093f \u092a\u0930\u0928\u094d\u0924\u092a \u0965 \u0968\u096d \u0965","Arjuna, the destroyer of enemies, all beings get the state of ignorance at the time of their birth due to the delusion brought on by the dualities in Nature, which arises out of desire and aversion."],t.w)
B.NI=new A.e(B.c,["\u092f\u0947\u0937\u093e\u092e\u094d \u0924\u0941 \u0905\u0928\u094d\u0924\u0917\u0924\u092e\u094d \u092a\u093e\u092a\u092e\u094d \u091c\u0928\u093e\u0928\u093e\u092e\u094d \u092a\u0941\u0923\u094d\u092f\u0915\u0930\u094d\u092e\u0923\u093e\u092e\u094d \u0964\n\u0924\u0947 \u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935 \u092e\u094b\u0939 \u0928\u093f\u0930\u094d\u092e\u0941\u0915\u094d\u0924\u093e \u092d\u091c\u0928\u094d\u0924\u0947 \u092e\u093e\u092e\u094d \u0926\u0943\u0922\u0935\u094d\u0930\u0924\u093e\u0903 \u0965 \u0968\u096e \u0965","However, people who have done virtuous things, whose vile deeds have come to an end get freed from the ignorance that's in the form of the dualities we experience and worship Me with firm resolve."],t.w)
B.O4=new A.e(B.c,["\u091c\u0930\u093e \u092e\u0930\u0923 \u092e\u094b\u0915\u094d\u0937\u093e\u092f \u092e\u093e\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u094d\u092f \u092f\u0924\u0928\u094d\u0924\u093f \u092f\u0947 \u0964\n\u0924\u0947 \u092c\u094d\u0930\u0939\u094d\u092e \u0924\u0926\u094d\u0935\u093f\u0926\u0941\u0903 \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u092e\u094d \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u092e\u094d \u0915\u0930\u094d\u092e \u091a\u093e\u0916\u093f\u0932\u092e\u094d \u0965 \u0968\u096f \u0965","Having taken My refuge, those who endeavor to gain freedom from infirmity and death know the self-existent, the entire environment and all activity."],t.w)
B.Nr=new A.e(B.c,["\u0938\u093e\u0927\u093f\u092d\u0942\u0924 \u0905\u0927\u093f\u0926\u0948\u0935\u092e\u094d \u092e\u093e\u092e\u094d \u0938\u093e\u0927\u093f\u092f\u091c\u094d\u091e\u092e\u094d \u091a \u092f\u0947 \u0935\u093f\u0926\u0941\u0903 \u0964\n\u092a\u094d\u0930\u092f\u093e\u0923 \u0915\u093e\u0932\u0947 \u0905\u092a\u093f \u092e\u093e\u092e\u094d \u0924\u0947 \u0935\u093f\u0926\u0941\u0903 \u092f\u0941\u0915\u094d\u0924 \u091a\u0947\u0924\u0938\u093e\u0903 \u0965 \u0969\u0966 \u0965","Those who know Me, existing with the entire material creation, the divine agent operating in material objects and with the attribute of being above all worship, who have concentrated their thoughts in devotion, they would know Me at the time of leaving their body too."],t.w)
B.WH=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0915\u093f\u092e\u094d \u0924\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0915\u093f\u092e\u094d \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u092e\u094d \u0915\u093f\u092e\u094d \u0915\u0930\u094d\u092e \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0964\n\u0905\u0927\u093f\u092d\u0942\u0924\u092e\u094d \u091a \u0915\u093f\u092e\u094d \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u092e\u094d \u0905\u0927\u093f\u0926\u0948\u0935\u092e\u094d \u0915\u093f\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967 \u0965\n\u0905\u0927\u093f\u092f\u091c\u094d\u091e\u0903 \u0915\u0925\u092e\u094d \u0915\u094b\u093d\u0924\u094d\u0930 \u0926\u0947\u0939\u0947 \u0905\u0938\u094d\u092e\u093f\u0928\u094d \u092e\u0927\u0941\u0938\u0942\u0926\u0928 \u0964\n\u092a\u094d\u0930\u092f\u093e\u0923 \u0915\u093e\u0932\u0947 \u091a \u0915\u0925\u092e\u094d \u091c\u094d\u091e\u0947\u092f\u094b\u093d\u0938\u093f \u0928\u093f\u092f\u0924\u093e\u0924\u094d\u092e\u092d\u093f\u0903 \u0965 \u0968 \u0965","Arjuna said: O best among men, What is that \u2018self-existent\u2019? Which is the environment? Which 'activity' did you mean? What is the entire material creation? and what is meant by 'the divine agent'? O Krishna, what is the purpose of worship in this body? In what manner is it mentioned here? Finally, in what way are You known to the people who focus themselves, when they leave the body?"],t.w)
B.TS=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0905\u0915\u094d\u0937\u0930\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u092a\u0930\u092e\u092e\u094d \u0938\u094d\u0935\u092d\u093e\u0935\u094b\u093d\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u092e\u094d \u0909\u091a\u094d\u092f\u0924\u0947 \u0964\n\u092d\u0942\u0924 \u092d\u093e\u0935\u094b\u0926\u094d\u092d\u0935\u0915\u0930\u094b \u0935\u093f\u0938\u0930\u094d\u0917\u0903 \u0915\u0930\u094d\u092e \u0938\u0928\u094d\u091c\u094d\u091e\u093f\u0924\u0903 \u0965 \u0969 \u0965","The Lord said- The 'self-existent' denotes the one who is beyond everything, who is unchanging. The phrase 'environment' refers to the nature of this material world. The act of creating, which makes all beings and their experiences is meant by the word 'activity'."],t.w)
B.R4=new A.e(B.c,["\u0905\u0927\u093f\u092d\u0942\u0924\u092e\u094d \u0915\u094d\u0937\u0930\u094b \u092d\u093e\u0935\u0903 \u092a\u0941\u0930\u0941\u0937\u0936\u094d\u091a \u0905\u0927\u093f\u0926\u0948\u0935\u0924\u092e\u094d \u0964\n\u0905\u0927\u093f\u092f\u091c\u094d\u091e\u094b \u0905\u0939\u092e\u0947\u0935 \u0905\u0924\u094d\u0930 \u0926\u0947\u0939\u0947 \u0926\u0947\u0939\u092d\u0943\u0924\u093e\u092e\u094d \u0935\u0930 \u0965 \u096a \u0965","O best among the beings who have a body, the entire material creation has the effect of eventually wearing out. Further, the \u2018divine agent' is the person who is above all forces of the universe. The purpose of worship is none other than Me, situated inside the body."],t.w)
B.UB=new A.e(B.c,["\u0905\u0928\u094d\u0924\u0915\u093e\u0932\u0947 \u091a \u092e\u093e\u092e\u0947\u0935 \u0938\u094d\u092e\u0930\u0928\u094d \u092e\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0915\u0932\u0947\u0935\u0930\u092e\u094d \u0964\n\u092f\u0903 \u092a\u094d\u0930\u092f\u093e\u0924\u093f \u0938 \u092e\u0926\u094d\u092d\u093e\u0935\u092e\u094d \u092f\u093e\u0924\u093f \u0928\u093e\u0938\u094d\u0924\u093f \u0905\u0924\u094d\u0930 \u0938\u092e\u094d\u0936\u092f\u0903 \u0965 \u096b \u0965","Finally, at the end of life, the one who passes away while thinking about Me alone will give up his body and attain My state of existence. There is no doubt in this matter."],t.w)
B.Tp=new A.e(B.c,["\u092f\u092e\u094d \u092f\u092e\u094d \u0935\u093e\u093d\u092a\u093f \u0938\u094d\u092e\u0930\u0928\u094d \u092d\u093e\u0935\u092e\u094d \u0924\u094d\u092f\u091c\u0924\u094d\u092f\u0928\u094d\u0924\u0947 \u0915\u0932\u0947\u0935\u0930\u092e\u094d \u0964\n\u0924\u092e\u094d \u0924\u092e\u0947\u0935\u0948\u0924\u093f \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0938\u0926\u093e \u0924\u0926\u094d\u092d\u093e\u0935 \u092d\u093e\u0935\u093f\u0924\u0903 \u0965 \u096c \u0965","Arjuna, whatever a person thinks about when he leaves his body at the end of life, he obtains that very same state of existence that he thought of always."],t.w)
B.NV=new A.e(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u0915\u093e\u0932\u0947\u0937\u0941 \u092e\u093e\u092e\u0928\u0941\u0938\u094d\u092e\u0930 \u092f\u0941\u0927\u094d\u092f \u091a \u0964\n\u092e\u092f\u094d\u092f\u0930\u094d\u092a\u093f\u0924 \u092e\u0928\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u092e\u093e\u092e\u0947\u0935\u0948\u0937\u094d\u092f\u0938\u093f \u0905\u0938\u092e\u094d\u0936\u092f\u0903 \u0965 \u096d \u0965","Hence, remember Me repeatedly, thought after thought and fight. Having given up your mind and intellect in Me, you will certainly attain Me - none other than the Lord."],t.w)
B.Rw=new A.e(B.c,["\u0905\u092d\u094d\u092f\u093e\u0938 \u092f\u094b\u0917 \u092f\u0941\u0915\u094d\u0924\u0947\u0928 \u091a\u0947\u0924\u0938\u093e\u093d\u0928\u0928\u094d\u092f\u0917\u093e\u092e\u093f\u0928\u093e \u0964\n\u092a\u0930\u092e\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u092e\u094d \u0926\u093f\u0935\u094d\u092f\u092e\u094d \u092f\u093e\u0924\u093f \u092a\u093e\u0930\u094d\u0925 \u0905\u0928\u0941\u091a\u093f\u0928\u094d\u0924\u092f\u0928\u094d \u0965 \u096e \u0965","Arjuna, by being with practice and focus, without allowing the consciousness to wander anywhere else, he will attain the supreme divine being by thinking about it all the time."],t.w)
B.Vv=new A.e(B.c,["\u0915\u0935\u093f\u092e\u094d \u092a\u0941\u0930\u093e\u0923\u092e\u094d \u0905\u0928\u0941\u0936\u093e\u0938\u093f\u0924\u093e\u0930\u092e\u094d\n\u0905\u0923\u094b\u0930\u0923\u0940\u092f\u093e\u092e\u094d\u0938\u092e\u094d \u0905\u0928\u0941\u0938\u094d\u092e\u0930\u0947\u0924\u094d \u092f\u0903 \u0964\n\u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0927\u093e\u0924\u093e\u0930\u092e\u094d \u0905\u091a\u093f\u0928\u094d\u0924\u094d\u092f \u0930\u0942\u092a\u092e\u094d\n\u0906\u0926\u093f\u0924\u094d\u092f \u0935\u0930\u094d\u0923\u092e\u094d \u0924\u092e\u0938\u0903 \u092a\u0930\u0938\u094d\u0924\u093e\u0924\u094d \u0965 \u096f \u0965\n\u092a\u094d\u0930\u092f\u093e\u0923 \u0915\u093e\u0932\u0947 \u092e\u0928\u0938\u093e\u093d\u091a\u0932\u0947\u0928\n\u092d\u0915\u094d\u0924\u094d\u092f\u093e \u092f\u0941\u0915\u094d\u0924\u094b \u092f\u094b\u0917\u092c\u0932\u0947\u0928 \u091a\u0948\u0935 \u0964\n\u092d\u094d\u0930\u0941\u0935\u094b\u0903 \u092e\u0927\u094d\u092f\u0947 \u092a\u094d\u0930\u093e\u0923\u092e\u094d \u0906\u0935\u0947\u0936\u094d\u092f \u0938\u092e\u094d\u092f\u0915\u094d\n\u0938 \u0924\u092e\u094d \u092a\u0930\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u092e\u094d \u0909\u092a\u0948\u0924\u093f \u0926\u093f\u0935\u094d\u092f\u092e\u094d \u0965 \u0967\u0966 \u0965","At the time of leaving the body, he is filled with affectionate devotion. By the power of his focus itself, having stationed life steadily in-between the eye-brows, with an unwavering mind, he meditates on the Lord, who knows everything, who is ancient, who is even more subtle than the imperceptible Self, who is the creator of everything, who has a form that cannot be realized in our thoughts, who has the color of the Sun and is beyond darkness. The one who does this will come towards that superior divine person."],t.w)
B.RW=new A.e(B.c,["\u092f\u0924\u094d \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u0935\u0947\u0926\u0935\u093f\u0926\u094b \u0935\u0926\u0928\u094d\u0924\u093f\n\u0935\u093f\u0936\u0928\u094d\u0924\u093f \u092f\u0924\u094d \u092f\u0924\u092f\u094b \u0935\u0940\u0924\u0930\u093e\u0917\u093e\u0903 \u0964\n\u092f\u0924\u094d \u0907\u091a\u094d\u091b\u0928\u094d\u0924\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u091a\u0930\u094d\u092f\u092e\u094d \u091a\u0930\u0928\u094d\u0924\u093f\n\u0924\u0924\u094d\u0924\u0947 \u092a\u0926\u092e\u094d \u0938\u0919\u094d\u0917\u094d\u0930\u0939\u0947\u0923 \u092a\u094d\u0930\u0935\u0915\u094d\u0937\u094d\u092f\u0947 \u0965 \u0967\u0967 \u0965","I will now summarize to you that position, which the people who know the Vedas call as 'the indestructible'; that place, which people who persevere without being driven by desire enter; yearning for which, people practice celibacy and study."],t.w)
B.RR=new A.e(B.c,["\u0938\u0930\u094d\u0935\u0926\u094d\u0935\u093e\u0930\u093e\u0923\u093f \u0938\u092e\u094d\u092f\u092e\u094d\u092f \u092e\u0928\u094b \u0939\u0943\u0926\u093f \u0928\u093f\u0930\u0941\u0927\u094d\u092f \u091a \u0964\n\u092e\u0942\u0930\u094d\u0927\u094d\u0928\u094d\u092f\u093e \u0906\u0927\u093e\u092f\u093e\u093d\u0924\u094d\u092e\u0928\u0903 \u092a\u094d\u0930\u093e\u0923\u092e\u094d \u0906\u0938\u094d\u0925\u093f\u0924\u094b \u092f\u094b\u0917\u0927\u093e\u0930\u0923\u093e\u092e\u094d \u0965 \u0967\u0968 \u0965\n\u0913\u092e\u093f\u0924\u093f \u090f\u0915\u093e\u0915\u094d\u0937\u0930\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0935\u094d\u092f\u093e\u0939\u0930\u0928\u094d \u092e\u093e\u092e\u094d \u0905\u0928\u0941\u0938\u094d\u092e\u0930\u0928\u094d \u0964\n\u092f\u0903 \u092a\u094d\u0930\u092f\u093e\u0924\u093f \u0924\u094d\u092f\u091c\u0928\u094d \u0926\u0947\u0939\u092e\u094d \u0938 \u092f\u093e\u0924\u093f \u092a\u0930\u092e\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0965 \u0967\u0969 \u0965","Restraining all the gateways of our experiences, holding the mind in check within the heart, having placed his life-breath at the summit, maintaining the state of yoga , chanting the single syllable 'Om', which denotes the Lord, keeping Me in his thoughts while giving up his body: The one who leaves in this way attains the ultimate goal."],t.w)
B.W0=new A.e(B.c,["\u0905\u0928\u0928\u094d\u092f \u091a\u0947\u0924\u093e\u0903 \u0938\u0924\u0924\u092e\u094d \u092f\u094b \u092e\u093e\u092e\u094d \u0938\u094d\u092e\u0930\u0924\u093f \u0928\u093f\u0924\u094d\u092f\u0936\u0903 \u0964\n\u0924\u0938\u094d\u092f\u093e\u0939\u092e\u094d \u0938\u0941\u0932\u092d\u0903 \u092a\u093e\u0930\u094d\u0925 \u0928\u093f\u0924\u094d\u092f \u092f\u0941\u0915\u094d\u0924\u0938\u094d\u092f \u092f\u094b\u0917\u093f\u0928\u0903 \u0965 \u0967\u096a \u0965","Arjuna, I am easily available to a person who thinks about Me at all times, right from the time he starts his journey to achieve Me. He is My devoted follower, and doesn't let his mind wander among other subjects. He is always attached to Me."],t.w)
B.Ol=new A.e(B.c,["\u092e\u093e\u092e\u094d \u0909\u092a\u0947\u0924\u094d\u092f \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u0926\u0941\u0903\u0916\u093e\u0932\u092f\u092e\u094d \u0905\u0936\u093e\u0936\u094d\u0935\u0924\u092e\u094d \u0964\n\u0928\u093e\u092a\u094d\u0928\u0941\u0935\u0928\u094d\u0924\u093f \u092e\u0939\u093e\u0924\u094d\u092e\u093e\u0928\u0903 \u0938\u092e\u094d\u0938\u093f\u0926\u094d\u0927\u093f\u092e\u094d \u092a\u0930\u092e\u093e\u092e\u094d \u0917\u0924\u093e\u0903 \u0965 \u0967\u096b \u0965","Having attained Me, they do not get a temporary birth again, which is an abode of suffering. These great people have reached the ultimate state of complete attainment."],t.w)
B.WK=new A.e(B.c,["\u0906\u092c\u094d\u0930\u0939\u094d\u092e \u092d\u0941\u0935\u0928\u093e\u0924\u094d \u0932\u094b\u0915\u093e\u0903 \u092a\u0941\u0928\u0930\u093e\u0935\u0930\u094d\u0924\u093f\u0928\u0903 \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u092e\u093e\u092e\u094d \u0909\u092a\u0947\u0924\u094d\u092f \u0924\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u0928 \u0935\u093f\u0926\u094d\u092f\u0924\u0947 \u0965 \u0967\u096c \u0965","Arjuna, all worlds get destroyed and return again. That includes the world of Brahma, the engineer of the universe. However, Arjuna, having approached Me, there is no re-birth."],t.w)
B.Ov=new A.e(B.c,["\u0938\u0939\u0938\u094d\u0930 \u092f\u0941\u0917 \u092a\u0930\u094d\u092f\u0928\u094d\u0924\u092e\u094d \u0905\u0939\u0930\u094d\u092f\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b \u0935\u093f\u0926\u0941\u0903 \u0964\n\u0930\u093e\u0924\u094d\u0930\u093f\u092e\u094d \u092f\u0941\u0917 \u0938\u0939\u0938\u094d\u0930\u093e\u0928\u094d\u0924\u093e\u092e\u094d \u0924\u0947 \u0905\u0939\u094b\u0930\u093e\u0924\u094d\u0930 \u0935\u093f\u0926\u094b \u091c\u0928\u093e\u0903 \u0965 \u0967\u096d \u0965\n\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0924\u094d \u0935\u094d\u092f\u0915\u094d\u0924\u092f\u0903 \u0938\u0930\u094d\u0935\u093e\u0903 \u092a\u094d\u0930\u092d\u0935\u0928\u094d\u0924\u093f \u0905\u0939\u0930\u093e\u0917\u092e\u0947 \u0964\n\u0930\u093e\u0924\u094d\u0930\u094d\u092f\u093e\u0917\u092e\u0947 \u092a\u094d\u0930\u0932\u0940\u092f\u0928\u094d\u0924\u0947 \u0924\u0924\u094d\u0930\u0948\u0935 \u0905\u0935\u094d\u092f\u0915\u094d\u0924\u0938\u091e\u094d\u091c\u094d\u091e\u0915\u0947 \u0965 \u0967\u096e \u0965\n\u092d\u0942\u0924\u0917\u094d\u0930\u093e\u092e\u0903 \u0938 \u090f\u0935\u093e\u092f\u092e\u094d \u092d\u0942\u0924\u094d\u0935\u093e \u092d\u0942\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u0932\u0940\u092f\u0924\u0947 \u0964\n\u0930\u093e\u0924\u094d\u0930\u094d\u092f\u093e\u0917\u092e\u0947 \u0905\u0935\u0936\u0903 \u092a\u093e\u0930\u094d\u0925 \u092a\u094d\u0930\u092d\u0935\u0924\u093f \u0905\u0939\u0930\u093e\u0917\u092e\u0947 \u0965 \u0967\u096f \u0965","The people who have learnt the measures of day and night know that a day of Brahma (the primary engineer of the universe) is equal to a thousand four-yuga periods. Similarly, his night lasts a thousand four-yuga periods too. When this day arrives, all of creation comes into being from the state of being imperceptible. When the night of Brahma arrives, they dissolve into the same state of being imperceptible. Arjuna, The same world of beings gets created again and again and gets dissolved when the night comes. When the day arrives, it comes into being, it\u2019s unstoppable."],t.w)
B.Qc=new A.e(B.c,["\u092a\u0930\u0938\u094d\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0924\u0941 \u092d\u093e\u0935\u094b\u093d\u0928\u094d\u092f\u094b\u093d\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0924\u094d \u0938\u0928\u093e\u0924\u0928\u0903 \u0964\n\u092f\u0903 \u0938 \u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u092d\u0942\u0924\u0947\u0937\u0941 \u0928\u0936\u094d\u092f\u0924\u094d\u0938\u0941 \u0928 \u0935\u093f\u0928\u0936\u094d\u092f\u0924\u093f \u0965 \u0968\u0966 \u0965\n\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0915\u094d\u0937\u0930 \u0907\u0924\u094d\u092f\u0941\u0915\u094d\u0924\u0903 \u0924\u092e\u093e\u0939\u0941\u0903 \u092a\u0930\u092e\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0964\n\u092f\u092e\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928 \u0928\u093f\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u0947 \u0924\u0926\u094d\u0927\u093e\u092e \u092a\u0930\u092e\u092e\u094d \u092e\u092e \u0965 \u0968\u0967 \u0965","The one who is beyond primordial matter, who has a different state of existence, who cannot be perceived by techniques such as observation and inference, who is ancient, who does not perish when all beings perish - He is called as the subtle one and the one who does not wear out. He is called the ultimate destination. Having obtained that ultimate abode of mine, they do not return."],t.w)
B.O7=new A.e(B.c,["\u092a\u0941\u0930\u0941\u0937\u0903 \u0938 \u092a\u0930\u0903 \u092a\u093e\u0930\u094d\u0925 \u092d\u0915\u094d\u0924\u094d\u092f\u093e \u0932\u092d\u094d\u092f\u0938\u094d\u0924\u0941 \u0905\u0928\u0928\u094d\u092f\u092f\u093e \u0964\n\u092f\u0938\u094d\u092f\u093e\u0928\u094d\u0924\u0903\u0938\u094d\u0925\u093e\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u092f\u0947\u0928 \u0938\u0930\u094d\u0935\u092e\u093f\u0926\u092e\u094d \u0924\u0924\u092e\u094d \u0965 \u0968\u0968 \u0965","Arjuna, the person in whom all beings exist, by whom all this is pervaded, that ultimate person is obtained by undistracted devotion, not being attached to anything else."],t.w)
B.S4=new A.e(B.c,["\u092f\u0924\u094d\u0930 \u0915\u093e\u0932\u0947 \u0924\u094d\u0935\u0928\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u0906\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u091a\u0948\u0935 \u092f\u094b\u0917\u093f\u0928\u0903 \u0964\n\u092a\u094d\u0930\u092f\u093e\u0924\u093e \u092f\u093e\u0928\u094d\u0924\u093f \u0924\u092e\u094d \u0915\u093e\u0932\u092e\u094d \u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u092d\u0930\u0924\u0930\u094d\u0937\u092d \u0965 \u0968\u0969 \u0965\n\u0905\u0917\u094d\u0928\u093f\u0930\u094d \u091c\u094d\u092f\u094b\u0924\u093f\u0930\u094d \u0905\u0939\u0903 \u0936\u0941\u0915\u094d\u0932\u0903 \u0937\u0923\u094d\u092e\u093e\u0938\u093e \u0909\u0924\u094d\u0924\u0930\u093e\u092f\u0923\u092e\u094d \u0964\n\u0924\u0924\u094d\u0930 \u092a\u094d\u0930\u092f\u093e\u0924\u093e \u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u092c\u094d\u0930\u0939\u094d\u092e \u092c\u094d\u0930\u0939\u094d\u092e \u0935\u093f\u0926\u094b \u091c\u0928\u093e\u0903 \u0965 \u0968\u096a \u0965","Arjuna, I will now describe the space and time in which worshippers have travelled. They take the path that returns or the one that doesn\u2019t. People who know the Lord, who leave this world and then travel in the path of brightness, then going on to the day, the bright half of the lunar month, the six months when our Sun shifts to the North of the equator - they reach the Lord."],t.w)
B.Ul=new A.e(B.c,["\u0927\u0942\u092e\u094b \u0930\u093e\u0924\u094d\u0930\u093f\u0938\u094d\u0924\u0925\u093e \u0915\u0943\u0937\u094d\u0923\u0903 \u0937\u0923\u094d\u092e\u093e\u0938\u093e \u0926\u0915\u094d\u0937\u093f\u0923\u093e\u092f\u0928\u092e\u094d \u0964\n\u0924\u0924\u094d\u0930 \u091a\u093e\u0928\u094d\u0926\u094d\u0930\u092e\u0938\u092e\u094d \u091c\u094d\u092f\u094b\u0924\u093f\u0903 \u092f\u094b\u0917\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928\u093f\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0968\u096b \u0965","A virtuous person gets to go on the path starting with smoke, followed by the night, the dark side of the lunar cycle, the six months when our Sun moves to the South and the light of the moon. This person returns again."],t.w)
B.TZ=new A.e(B.c,["\u0936\u0941\u0915\u094d\u0932 \u0915\u0943\u0937\u094d\u0923\u0947 \u0917\u0924\u0940 \u0939\u094d\u092f\u0947\u0924\u0947 \u091c\u0917\u0924\u0903 \u0936\u093e\u0936\u094d\u0935\u0924\u0947 \u092e\u0924\u0947 \u0964\n\u090f\u0915\u092f\u093e \u092f\u093e\u0924\u093f \u0905\u0928\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u0905\u0928\u094d\u092f\u092f\u093e\u0935\u0930\u094d\u0924\u0924\u0947 \u092a\u0941\u0928\u0903 \u0965 \u0968\u096c \u0965","These two paths - of luster and darkness - are considered to be eternally applicable to the people of this world. In one path, you attain freedom from return. In another, you return again."],t.w)
B.Tr=new A.e(B.c,["\u0928\u0948\u0924\u0947 \u0938\u0943\u0924\u0940 \u092a\u093e\u0930\u094d\u0925 \u091c\u093e\u0928\u0928\u094d \u092f\u094b\u0917\u0940 \u092e\u0941\u0939\u094d\u092f\u0924\u093f \u0915\u0936\u094d\u091a\u0928 \u0964\n\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u0915\u093e\u0932\u0947\u0937\u0941 \u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u094b \u092d\u0935 \u0905\u0930\u094d\u091c\u0941\u0928 \u0965 \u0968\u096d \u0965","Arjuna, any devotee who practices yoga and knows these paths will not get bewildered. Hence, Arjuna, be with yoga at all times."],t.w)
B.NC=new A.e(B.c,["\u0935\u0947\u0926\u0947\u0937\u0941 \u092f\u091c\u094d\u091e\u0947\u0937\u0941 \u0924\u092a\u0938\u094d\u0938\u0941 \u091a\u0948\u0935 \u0926\u093e\u0928\u0947 \u091a \u092f\u0924\u094d \u092a\u0941\u0923\u094d\u092f\u092b\u0932\u092e\u094d \u092a\u094d\u0930\u0926\u093f\u0937\u094d\u091f\u092e\u094d \u0964\n\u0905\u0924\u094d\u092f\u0947\u0924\u093f \u0924\u0924\u094d \u0938\u0930\u094d\u0935\u092e\u094d \u0907\u0926\u092e\u094d \u0935\u093f\u0926\u093f\u0924\u094d\u0935\u093e \u092f\u094b\u0917\u0940 \u092a\u0930\u092e\u094d \u0938\u094d\u0925\u093e\u0928\u092e\u094d \u0909\u092a\u0948\u0924\u093f \u091a\u093e\u0926\u094d\u092f\u092e\u094d \u0965 \u0968\u096e \u0965","The fortunate outcomes that were indicated - in the Vedas, in performing worship, in penance and in donating things - a person goes beyond all of it after knowing this. This person will reach the ultimate destiny, a place that has no beginning, which always exists."],t.w)
B.Np=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0907\u0926\u092e\u094d \u0924\u0941 \u0924\u0947 \u0917\u0941\u0939\u094d\u092f\u0924\u092e\u092e\u094d \u092a\u094d\u0930\u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u0905\u0928\u0938\u0942\u092f\u0935\u0947 \u0964\n\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0935\u093f\u091c\u094d\u091e\u093e\u0928 \u0938\u0939\u093f\u0924\u092e\u094d \u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u092e\u094b\u0915\u094d\u0937\u094d\u092f\u0938\u0947 \u0905\u0936\u0941\u092d\u093e\u0924\u094d \u0965 \u0967 \u0965","The Lord said - You are not jealous. I will tell you this awareness which is extremely concealed, along with the science to comprehend it. Knowing this, you will be free from everything that's undesirable."],t.w)
B.RU=new A.e(B.c,["\u0930\u093e\u091c\u0935\u093f\u0926\u094d\u092f\u093e \u0930\u093e\u091c\u0917\u0941\u0939\u094d\u092f\u092e\u094d \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u094d \u0907\u0926\u092e\u094d \u0909\u0924\u094d\u0924\u092e\u092e\u094d \u0964\n\u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937\u093e\u0935\u0917\u092e\u092e\u094d \u0927\u0930\u094d\u092e\u094d\u092f\u092e\u094d \u0938\u0941\u0938\u0941\u0916\u092e\u094d \u0915\u0930\u094d\u0924\u0941\u092e\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0968 \u0965","It is the king of all learning and the foremost among everything that's tough to find - it's the king of secrets. It is supreme and pure. It is there for us to experience. It has virtue embedded in it. It's very easy to practice and perform. It never wears out."],t.w)
B.TY=new A.e(B.c,["\u0905\u0936\u094d\u0930\u0926\u094d\u0926\u0927\u093e\u0928\u093e\u0903 \u092a\u0941\u0930\u0941\u0937\u093e\u0903 \u0927\u0930\u094d\u092e\u0938\u094d\u092f \u0905\u0938\u094d\u092f \u092a\u0930\u0928\u094d\u0924\u092a \u0964\n\u0905\u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092e\u093e\u092e\u094d \u0928\u093f\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u0947 \u092e\u0943\u0924\u094d\u092f\u0941 \u0938\u092e\u094d\u0938\u093e\u0930 \u0935\u0930\u094d\u0924\u094d\u092e\u0928\u093f \u0965 \u0969 \u0965","O destroyer of enemies, people who do not believe in this practice don\u2019t attain Me. They return to this material world, which is always subject to death and destruction."],t.w)
B.ST=new A.e(B.c,["\u092e\u092f\u093e \u0924\u0924\u092e\u094d \u0907\u0926\u092e\u094d \u0938\u0930\u094d\u0935\u092e\u094d \u091c\u0917\u0924\u094d \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u092e\u0942\u0930\u094d\u0924\u093f\u0928\u093e \u0964\n\u092e\u0924\u094d\u0938\u094d\u0925\u093e\u0928\u093f \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093f \u0928 \u091a\u093e\u0939\u092e\u094d \u0924\u0947\u0937\u0941 \u0905\u0935\u0938\u094d\u0925\u093f\u0924\u0903 \u0965 \u096a \u0965\n\u0928 \u091a \u092e\u0924\u094d\u0938\u094d\u0925\u093e\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u092a\u0936\u094d\u092f \u092e\u0947 \u092f\u094b\u0917\u092e\u094d \u0910\u0936\u094d\u0935\u0930\u092e\u094d \u0964\n\u092d\u0942\u0924\u092d\u0943\u0924\u094d \u0928 \u091a \u092d\u0942\u0924\u0938\u094d\u0925\u094b \u092e\u092e\u093e\u0924\u094d\u092e\u093e \u092d\u0942\u0924\u092d\u093e\u0935\u0928\u0903 \u0965 \u096b \u0965","This whole world is pervaded by Me, with My imperceptible form. All beings are situated in Me and I do not have any dependency on them. Moreover, I am not bound to carry all beings. Look at My status as being the owner of the universe. I support these beings without being bound in them. My intent causes all of them to be."],t.w)
B.Q4=new A.e(B.c,["\u092f\u0925\u093e \u0906\u0915\u093e\u0936\u0938\u094d\u0925\u093f\u0924\u094b \u0928\u093f\u0924\u094d\u092f\u092e\u094d \u0935\u093e\u092f\u0941\u0903 \u0938\u0930\u094d\u0935\u0924\u094d\u0930\u0917\u094b \u092e\u0939\u093e\u0928\u094d \u0964\n\u0924\u0925\u093e \u0938\u0930\u094d\u0935\u093e\u0923\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u092e\u0924\u094d\u0938\u094d\u0925\u093e\u0928\u093f \u0907\u0924\u094d\u092f\u0941\u092a\u0927\u093e\u0930\u092f \u0965 \u096c \u0965","The great wind roams everywhere, while being situated in the sky always. Know that the way in which all beings are situated in Me is similar."],t.w)
B.Q9=new A.e(B.c,["\u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093f \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u092f\u093e\u0928\u094d\u0924\u093f \u092e\u093e\u092e\u093f\u0915\u093e\u092e\u094d \u0964\n\u0915\u0932\u094d\u092a \u0915\u094d\u0937\u092f\u0947 \u092a\u0941\u0928\u0903 \u0924\u093e\u0928\u093f \u0915\u0932\u094d\u092a\u093e\u0926\u094c \u0935\u093f\u0938\u0943\u091c\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0965 \u096d \u0965","Arjuna, all beings end up in a dormant state inside My body at the end of a kalpa . Again, at the beginning of the next kalpa , I create them in various forms."],t.w)
B.QA=new A.e(B.c,["\u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u0938\u094d\u0935\u093e\u092e\u094d \u0905\u0935\u0937\u094d\u091f\u092d\u094d\u092f \u0935\u093f\u0938\u0943\u091c\u093e\u092e\u093f \u092a\u0941\u0928\u0903 \u092a\u0941\u0928\u0903 \u0964\n\u092d\u0942\u0924 \u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0907\u092e\u092e\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u092e\u094d \u0905\u0935\u0936\u092e\u094d \u092a\u094d\u0930\u0915\u0943\u0924\u0947\u0930\u094d\u0935\u0936\u093e\u0924\u094d \u0965 \u096e \u0965","I create this entire system of beings again and again, while keeping My material nature as the basis. Under the influence of the material world, they are not free."],t.w)
B.S0=new A.e(B.c,["\u0928 \u091a \u092e\u093e\u092e\u094d \u0924\u093e\u0928\u093f \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0928\u093f\u092c\u0927\u094d\u0928\u0928\u094d\u0924\u093f \u0927\u0928\u0928\u094d\u091c\u092f \u0964\n\u0909\u0926\u093e\u0938\u0940\u0928\u0935\u0926\u093e\u0938\u0940\u0928\u092e\u094d \u0905\u0938\u0915\u094d\u0924\u092e\u094d \u0924\u0947\u0937\u0941 \u0915\u0930\u094d\u092e\u0938\u0941 \u0965 \u096f \u0965","Arjuna, those deeds do not bind Me. Being neutral, I have no attachment towards those deeds."],t.w)
B.Tl=new A.e(B.c,["\u092e\u092f\u093e \u0905\u0927\u094d\u092f\u0915\u094d\u0937\u0947\u0923 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0903 \u0938\u0942\u092f\u0924\u0947 \u0938\u091a\u0930\u093e\u091a\u0930\u092e\u094d \u0964\n\u0939\u0947\u0924\u0941\u0928\u093e \u0905\u0928\u0947\u0928 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u091c\u0917\u0926\u094d\u0935\u093f\u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0967\u0966 \u0965","Arjuna, the material environment guides this world by My will, including everything that\u2019s stationary and moving, with My supervision. This world goes through its cycles with this purpose itself."],t.w)
B.Rq=new A.e(B.c,["\u0905\u0935\u091c\u093e\u0928\u0928\u094d\u0924\u093f \u092e\u093e\u092e\u094d \u092e\u0942\u0922\u093e\u0903 \u092e\u093e\u0928\u0941\u0937\u0940\u092e\u094d \u0924\u0928\u0941\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u092e\u094d \u0964\n\u092a\u0930\u092e\u094d \u092d\u093e\u0935\u092e\u094d \u0905\u091c\u093e\u0928\u0928\u094d\u0924\u094b \u092e\u092e \u092d\u0942\u0924 \u092e\u0939\u0947\u0936\u094d\u0935\u0930\u092e\u094d \u0965 \u0967\u0967 \u0965","People who are deluded disregard Me. They do not know My superior state as the Lord of all beings, the Lord who has taken a human form."],t.w)
B.Qi=new A.e(B.c,["\u092e\u094b\u0918\u093e\u0936\u093e \u092e\u094b\u0918 \u0915\u0930\u094d\u092e\u0923\u094b \u092e\u094b\u0918 \u091c\u094d\u091e\u093e\u0928\u093e \u0935\u093f\u091a\u0947\u0924\u0938\u0903 \u0964\n\u0930\u093e\u0915\u094d\u0937\u0938\u0940\u092e\u094d \u0906\u0938\u0941\u0930\u0940\u092e\u094d \u091a\u0948\u0935 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u092e\u094b\u0939\u093f\u0928\u0940\u092e\u094d \u0936\u094d\u0930\u093f\u0924\u093e\u0903 \u0965 \u0967\u0968 \u0965","They remain inside this material world, which advocates the enjoyment of everything that's attractive. This world will definitely devour them. Without the ability to recognize reality, they have useless desires, do useless activities and have knowledge that's useless."],t.w)
B.Tj=new A.e(B.c,["\u092e\u0939\u093e\u0924\u094d\u092e\u093e\u0928\u0938\u094d\u0924\u0941 \u092e\u093e\u092e\u094d \u092a\u093e\u0930\u094d\u0925 \u0926\u0948\u0935\u0940\u092e\u094d \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u093e\u0903 \u0964\n\u092d\u091c\u0928\u094d\u0924\u093f \u0905\u0928\u0928\u094d\u092f \u092e\u0928\u0938\u094b \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u092d\u0942\u0924\u093e\u0926\u093f\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0967\u0969 \u0965","On the other hand, Arjuna, great people take refuge in My divine nature. Knowing Me, the origin of all beings, the One who never wears out, they worship Me without letting their minds wander among other subjects."],t.w)
B.QW=new A.e(B.c,["\u0938\u0924\u0924\u092e\u094d \u0915\u0940\u0930\u094d\u0924\u092f\u0928\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u092f\u0924\u0928\u094d\u0924\u0903 \u091a \u0926\u0943\u0922\u0935\u094d\u0930\u0924\u093e\u0903 \u0964\n\u0928\u092e\u0938\u094d\u092f\u0928\u094d\u0924\u0903 \u091a \u092e\u093e\u092e\u094d \u092d\u0915\u094d\u0924\u094d\u092f\u093e \u0928\u093f\u0924\u094d\u092f\u092f\u0941\u0915\u094d\u0924\u093e \u0909\u092a\u093e\u0938\u0924\u0947 \u0965 \u0967\u096a \u0965","They worship Me with devotion while praising Me, while being firm in their vows and in their endeavor to attain Me. They regard Me with reverence always and are constantly in touch with Me."],t.w)
B.Pj=new A.e(B.c,["\u091c\u094d\u091e\u093e\u0928\u092f\u091c\u094d\u091e\u0947\u0928 \u091a\u093e\u092a\u094d\u092f\u0928\u094d\u092f\u0947 \u092f\u091c\u0928\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u0909\u092a\u093e\u0938\u0924\u0947 \u0964\n\u090f\u0915\u0924\u094d\u0935\u0947\u0928 \u092a\u0943\u0925\u0915\u094d\u0924\u094d\u0935\u0947\u0928 \u092c\u0939\u0941\u0927\u093e \u0935\u093f\u0936\u094d\u0935\u0924\u094b\u092e\u0941\u0916\u092e\u094d \u0965 \u0967\u096b \u0965","Yet others worship through study. They worship Me in the form of a single person having the universe as His form, appearing in many different ways."],t.w)
B.US=new A.e(B.c,["\u0905\u0939\u092e\u094d \u0915\u094d\u0930\u0924\u0941\u0930\u0939\u092e\u094d \u092f\u091c\u094d\u091e\u0903 \u0938\u094d\u0935\u0927\u093e \u0905\u0939\u092e\u094d \u0905\u0939\u092e\u094d \u0914\u0937\u0927\u092e\u094d \u0964\n\u092e\u0928\u094d\u0924\u094d\u0930\u094b \u0905\u0939\u092e\u094d \u0905\u0939\u092e\u094d \u090f\u0935 \u0906\u091c\u094d\u092f\u092e\u094d \u0905\u0939\u092e\u094d \u0905\u0917\u094d\u0928\u093f\u0930\u0939\u092e\u094d \u0939\u0941\u0924\u092e\u094d \u0965 \u0967\u096c \u0965","I am the inspiration and the ceremony. I am worship. I am the offering given to elders. I am the preparation that's offered. I am the chant. I am the one who fuels the fire. I am the fire. I am the One into which the offering is made."],t.w)
B.TR=new A.e(B.c,["\u092a\u093f\u0924\u093e \u0905\u0939\u092e\u094d \u0905\u0938\u094d\u092f \u091c\u0917\u0924\u094b \u092e\u093e\u0924\u093e \u0927\u093e\u0924\u093e \u092a\u093f\u0924\u093e\u092e\u0939\u0903 \u0964\n\u0935\u0947\u0926\u094d\u092f\u092e\u094d \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u094d \u0913\u092e\u094d\u0915\u093e\u0930\u0903 \u090b\u0915\u094d \u0938\u093e\u092e \u092f\u091c\u0941\u0930\u0947\u0935 \u091a \u0965 \u0967\u096d \u0965","I am the father of this world, the mother, the founder, the bearer, the grandfather. Indeed, I am the auspicious knowledge in the Vedas, the sound of Om, the Rig, Sama and Yajur Vedas."],t.w)
B.VD=new A.e(B.c,["\u0917\u0924\u093f\u0930\u094d\u092d\u0930\u094d\u0924\u093e \u092a\u094d\u0930\u092d\u0941\u0903 \u0938\u093e\u0915\u094d\u0937\u0940 \u0928\u093f\u0935\u093e\u0938\u0903 \u0936\u0930\u0923\u092e\u094d \u0938\u0941\u0939\u0943\u0924\u094d \u0964\n\u092a\u094d\u0930\u092d\u0935 \u092a\u094d\u0930\u0932\u092f \u0938\u094d\u0925\u093e\u0928\u092e\u094d \u0928\u093f\u0927\u093e\u0928\u092e\u094d \u092c\u0940\u091c\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0967\u096e \u0965","The goal, the bearer, the Lord, the one who sees everything directly, a place to live in, the refuge, the well-wisher, the place in which creation and destruction occur, an investment, the seed, which does not wear out."],t.w)
B.TQ=new A.e(B.c,["\u0924\u092a\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0905\u0939\u092e\u094d \u0935\u0930\u094d\u0937 \u0928\u093f\u0917\u0943\u0939\u094d\u0923\u093e\u092e\u093f \u0909\u0924\u094d\u0938\u0943\u091c\u093e\u092e\u093f \u091a \u0964\n\u0905\u092e\u0943\u0924\u092e\u094d \u091a\u0948\u0935 \u092e\u0943\u0924\u094d\u092f\u0941\u0903 \u091a \u0938\u0926\u0938\u0924\u094d \u091a \u0905\u0939\u092e\u094d \u0905\u0930\u094d\u091c\u0941\u0928 \u0965 \u0967\u096f \u0965","Arjuna, I give rise to heat I restrict rain and make it pour too. I am life itself, I am death, I am the real and the imaginary."],t.w)
B.Rc=new A.e(B.c,["\u0924\u094d\u0930\u0948\u0935\u093f\u0926\u094d\u092f\u093e \u092e\u093e\u092e\u094d \u0938\u094b\u092e\u092a\u093e\u0903 \u092a\u0942\u0924\u092a\u093e\u092a\u093e\u0903\n\u092f\u091c\u094d\u091e\u0948\u0930\u093f\u0937\u094d\u091f\u094d\u0935\u093e \u0938\u094d\u0935\u0930\u094d\u0917\u0924\u093f\u092e\u094d \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u092f\u0928\u094d\u0924\u0947 \u0964\n\u0924\u0947 \u092a\u0941\u0923\u094d\u092f\u092e\u093e\u0938\u093e\u0926\u094d\u092f \u0938\u0941\u0930\u0947\u0928\u094d\u0926\u094d\u0930 \u0932\u094b\u0915\u092e\u094d\n\u0905\u0936\u094d\u0928\u0928\u094d\u0924\u093f \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u094d \u0926\u093f\u0935\u093f \u0926\u0947\u0935-\u092d\u094b\u0917\u093e\u0928\u094d \u0965 \u0968\u0966 \u0965\n\u0924\u0947 \u0924\u092e\u094d \u092d\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0938\u094d\u0935\u0930\u094d\u0917 \u0932\u094b\u0915\u092e\u094d \u0935\u093f\u0936\u093e\u0932\u092e\u094d\n\u0915\u094d\u0937\u0940\u0923\u0947 \u092a\u0941\u0923\u094d\u092f\u0947 \u092e\u0930\u094d\u0924\u094d\u092f \u0932\u094b\u0915\u092e\u094d \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0964\n\u090f\u0935\u092e\u094d \u0924\u094d\u0930\u092f\u0940 \u0927\u0930\u094d\u092e\u092e\u094d \u0905\u0928\u0941\u092a\u094d\u0930\u092a\u0928\u094d\u0928\u093e\u0903\n\u0917\u0924\u093e\u0917\u0924\u092e\u094d \u0915\u093e\u092e\u0915\u093e\u092e\u093e \u0932\u092d\u0928\u094d\u0924\u0947 \u0965 \u0968\u0967 \u0965","Those who know the three Vedas worship Me with ceremonies, consume the residue from the ceremony and get rid of their misfortune. They pray for a world of comforts. Having arrived in the world of comforts, they enjoy divine pleasures of the elite in that world. Having enjoyed the vast world of comforts, they enter the world of ordinary humans once their virtues are spent. In this way, people who crave for desirable things and advocate the three Vedas to gain these ends keep going and coming back."],t.w)
B.Ry=new A.e(B.c,["\u0905\u0928\u0928\u094d\u092f\u093e\u0903 \u091a\u093f\u0928\u094d\u0924\u092f\u0928\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u092f\u0947 \u091c\u0928\u093e\u0903 \u092a\u0930\u094d\u092f\u0941\u092a\u093e\u0938\u0924\u0947 \u0964\n\u0924\u0947\u0937\u093e\u092e\u094d \u0928\u093f\u0924\u094d\u092f\u093e\u092d\u093f\u092f\u0941\u0915\u094d\u0924\u093e\u0928\u093e\u092e\u094d \u092f\u094b\u0917 \u0915\u094d\u0937\u0947\u092e\u092e\u094d \u0935\u0939\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0965 \u0968\u0968 \u0965","The people who worship Me constantly while having Me in their thoughts, without having any other objective in mind desire to be united with Me forever. I take care of their achievements and the preservation of what they have achieved."],t.w)
B.Vb=new A.e(B.c,["\u092f\u0947 \u0924\u0941 \u0905\u0928\u094d\u092f \u0926\u0947\u0935\u0924\u093e \u092d\u0915\u094d\u0924\u093e\u0903 \u092f\u091c\u0928\u094d\u0924\u0947 \u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e\u093d\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0964\n\u0924\u0947\u093d\u092a\u093f \u092e\u093e\u092e\u0947\u0935 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092f\u091c\u0928\u094d\u0924\u093f \u0905\u0935\u093f\u0927\u093f\u092a\u0942\u0930\u094d\u0935\u0915\u092e\u094d \u0965 \u0968\u0969 \u0965","On the other hand, those who are devoted to other sources of power worship in complete faith. Even they worship Me alone without following the prescribed rules completely."],t.w)
B.O3=new A.e(B.c,["\u0905\u0939\u092e\u094d \u0939\u093f \u0938\u0930\u094d\u0935 \u092f\u091c\u094d\u091e\u093e\u0928\u093e\u092e\u094d \u092d\u094b\u0915\u094d\u0924\u093e \u091a \u092a\u094d\u0930\u092d\u0941\u0930\u0947\u0935 \u091a \u0964\n\u0928 \u0924\u0941 \u092e\u093e\u092e\u094d \u0905\u092d\u093f\u091c\u093e\u0928\u0928\u094d\u0924\u093f \u0924\u0924\u094d\u0935\u0947\u0928\u093e\u0924\u0903 \u091a\u094d\u092f\u0935\u0928\u094d\u0924\u093f \u0924\u0947 \u0965 \u0968\u096a \u0965","I am indeed the enjoyer and the single Master of all services rendered to anyone or anything. Those who crave for material wealth do not know Me as I am. Hence, they fall back."],t.w)
B.PY=new A.e(B.c,["\u092f\u093e\u0928\u094d\u0924\u093f \u0926\u0947\u0935\u0935\u094d\u0930\u0924\u093e \u0926\u0947\u0935\u093e\u0928\u094d\n\u092a\u093f\u0924\u0943\u0928\u094d \u092f\u093e\u0928\u094d\u0924\u093f \u092a\u093f\u0924\u0943\u0935\u094d\u0930\u0924\u093e\u0903 \u0964\n\u092d\u0942\u0924\u093e\u0928\u093f \u092f\u093e\u0928\u094d\u0924\u093f \u092d\u0942\u0924\u0947\u091c\u094d\u092f\u093e\u0903\n\u092f\u093e\u0928\u094d\u0924\u093f \u092e\u0926\u094d\u092f\u093e\u091c\u093f\u0928\u094b\u093d\u092a\u093f \u092e\u093e\u092e\u094d \u0965 \u0968\u096b \u0965","People who dedicate themselves to power will achieve those powers. Those who dedicate themselves to their ancestors join those ancestors. Those who persevere to achieve material gains will attain those materials. People who worship Me with the aim to achieve Me while dedicating themselves to any cause will achieve Me."],t.w)
B.QJ=new A.e(B.c,["\u092a\u0924\u094d\u0930\u092e\u094d \u092a\u0941\u0937\u094d\u092a\u092e\u094d \u092b\u0932\u092e\u094d \u0924\u094b\u092f\u092e\u094d \u092f\u094b \u092e\u0947 \u092d\u0915\u094d\u0924\u094d\u092f\u093e \u092a\u094d\u0930\u092f\u091a\u094d\u091b\u0924\u093f \u0964\n\u0924\u0926\u0939\u092e\u094d \u092d\u0915\u094d\u0924\u094d\u092f\u0941\u092a\u0939\u0943\u0924\u092e\u094d \u0905\u0936\u094d\u0928\u093e\u092e\u093f \u092a\u094d\u0930\u092f\u0924\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u0968\u096c \u0965","Anyone who offers a leaf, a flower, a fruit or water to Me with devotion - I will accept whatever is offered with devotion by a person who is so dedicated to Me."],t.w)
B.W5=new A.e(B.c,["\u092f\u0924\u094d \u0915\u0930\u094b\u0937\u093f \u092f\u0924\u094d \u0905\u0936\u094d\u0928\u093e\u0938\u093f \u091c\u0924\u094d \u091c\u0941\u0939\u094b\u0937\u093f \u0926\u0926\u093e\u0938\u093f \u092f\u0924\u094d \u0964\n\u092f\u0924\u094d \u0924\u092a\u0938\u094d\u092f\u0938\u093f \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0924\u0924\u094d \u0915\u0941\u0930\u0941\u0937\u094d\u0935 \u092e\u0926\u0930\u094d\u092a\u0923\u092e\u094d \u0965 \u0968\u096d \u0965","Whatever you do, whatever you consume, whatever you sacrifice, whatever you give away, any thought you concentrate on, make it a dedication to Me"],t.w)
B.Q7=new A.e(B.c,["\u0936\u0941\u092d\u093e\u0936\u0941\u092d \u092b\u0932\u0948\u0930\u0947\u0935\u092e\u094d \u092e\u094b\u0915\u094d\u0937\u094d\u092f\u0938\u0947 \u0915\u0930\u094d\u092e \u092c\u0928\u094d\u0927\u0928\u0948\u0903 \u0964\n\u0938\u0902\u0928\u094d\u092f\u093e\u0938 \u092f\u094b\u0917 \u092f\u0941\u0915\u094d\u0924\u093e\u0924\u094d\u092e\u093e \u0935\u093f\u092e\u0941\u0915\u094d\u0924\u094b \u092e\u093e\u092e\u094d \u0909\u092a\u0948\u0937\u094d\u092f\u0938\u093f \u0965 \u0968\u096e \u0965","In this way, you will be free from the bondage of activity with its favorable and unfavorable outcomes. Be with the intent of letting-go. You will be free and attain Me."],t.w)
B.Wb=new A.e(B.c,["\u0938\u092e\u094b\u093d\u0939\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0947\u0937\u0941\n\u0928 \u092e\u0947 \u0926\u094d\u0935\u0947\u0937\u094d\u092f\u094b\u093d\u0938\u094d\u0924\u093f \u0928 \u092a\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u0947 \u092d\u091c\u0928\u094d\u0924\u093f \u0924\u0941 \u092e\u093e\u092e\u094d \u092d\u0915\u094d\u0924\u094d\u092f\u093e\n\u092e\u092f\u093f \u0924\u0947 \u0924\u0947\u0937\u0941 \u091a\u093e\u092a\u094d\u092f\u0939\u092e\u094d \u0965 \u0968\u096f \u0965","I am equal to all beings. I do not have hatred, neither do I have the attachment of love. However, those who worship Me with devotion are situated in Me, I am within them as well."],t.w)
B.PG=new A.e(B.c,["\u0905\u092a\u093f \u091a\u0947\u0924\u094d \u0938\u0941\u0926\u0941\u0930\u093e\u091a\u093e\u0930\u094b \u092d\u091c\u0924\u0947 \u092e\u093e\u092e\u094d \u0905\u0928\u0928\u094d\u092f\u092d\u093e\u0915\u094d \u0964\n\u0938\u093e\u0927\u0941\u0930\u0947\u0935 \u0938 \u092e\u0928\u094d\u0924\u0935\u094d\u092f\u0903 \u0938\u092e\u094d\u092f\u0915\u094d \u0935\u094d\u092f\u0935\u0938\u093f\u0924\u094b \u0939\u093f \u0938\u0903 \u0965 \u0969\u0966 \u0965","Even when a very offensive person worships Me with unwavering devotion, he needs to be considered as virtuous indeed. He definitely has the appropriate determination."],t.w)
B.T8=new A.e(B.c,["\u0915\u094d\u0937\u093f\u092a\u094d\u0930\u092e\u094d \u092d\u0935\u0924\u093f \u0927\u0930\u094d\u092e\u093e\u0924\u094d\u092e\u093e \u0936\u0936\u094d\u0935\u0924\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u092e\u094d \u0928\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0964\n\u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u094d\u0930\u0924\u093f\u091c\u093e\u0928\u0940\u0939\u093f \u0928 \u092e\u0947 \u092d\u0915\u094d\u0924\u0903 \u092a\u0923\u0936\u094d\u092f\u0924\u093f \u0965 \u0969\u0967 \u0965","Very soon, this person becomes an excellent devotee, who worships Me without flaw. He attains peaceful existence forever. Arjuna, resolve firmly within yourself that My devotee shall not waste away."],t.w)
B.UR=new A.e(B.c,["\u092e\u093e\u092e\u094d \u0939\u093f \u092a\u093e\u0930\u094d\u0925 \u0935\u094d\u092f\u092a\u093e\u0936\u094d\u0930\u093f\u0924\u094d\u092f \u092f\u094b\u093d\u092a\u093f \u0938\u094d\u092f\u0941\u0903 \u092a\u093e\u092a\u092f\u094b\u0928\u092f\u0903 \u0964\n\u0938\u094d\u0924\u094d\u0930\u093f\u092f\u094b \u0935\u0948\u0936\u094d\u092f\u093e\u0903 \u0924\u0925\u093e \u0936\u0942\u0926\u094d\u0930\u093e\u0903 \u0924\u0947\u093d\u092a\u093f \u092f\u093e\u0928\u094d\u0924\u093f \u092a\u0930\u093e\u092e\u094d \u0917\u0924\u093f\u092e\u094d \u0965 \u0969\u0968 \u0965\n\u0915\u093f\u092e\u094d \u092a\u0941\u0928\u0903 \u092c\u094d\u0930\u093e\u0939\u094d\u092e\u0923\u093e\u0903 \u092a\u0941\u0923\u094d\u092f\u093e\u0903 \u092d\u0915\u094d\u0924\u093e \u0930\u093e\u091c\u0930\u094d\u0937\u092f\u0903 \u0924\u0925\u093e \u0964\n\u0905\u0928\u093f\u0924\u094d\u092f\u092e\u094d \u0905\u0938\u0941\u0916\u092e\u094d \u0932\u094b\u0915\u092e\u094d \u0907\u092e\u092e\u094d \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u092d\u091c\u0938\u094d\u0935 \u092e\u093e\u092e\u094d \u0965 \u0969\u0969 \u0965","Arjuna, anyone, irrespective of gender and profession, even those who've tread the path of malice - they will definitely attain the supreme goal after taking refuge in Me. It goes without saying that the same applies to the virtuous, to My devotees, to those who seek to worship and administrators who rule on My behalf. Worship Me, now that you have obtained this world, which is temporary and is devoid of lasting joy."],t.w)
B.R5=new A.e(B.c,["\u092e\u0928\u094d\u092e\u0928\u093e \u092d\u0935 \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u094b \u092e\u0926\u094d\u092f\u093e\u091c\u0940 \u092e\u093e\u092e\u094d \u0928\u092e\u0938\u094d\u0915\u0941\u0930\u0941 \u0964\n\u092e\u093e\u092e\u094d \u090f\u0935\u0948\u0937\u094d\u092f\u0938\u093f \u092f\u0941\u0915\u094d\u0924\u094d\u0935\u0948\u0935\u092e\u094d \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u092e\u0924\u094d\u092a\u0930\u093e\u092f\u0923\u0903 \u0965 \u0969\u096a \u0965","Be My devotee, having excessive affection towards me. Keep your mind in Me always. Worship Me alone. Surrender to Me, have Me as your ultimate goal. In this way, by attaching your thoughts to Me, you will certainly attain Me."],t.w)
B.VM=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092d\u0942\u092f \u090f\u0935 \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0936\u0943\u0923\u0941 \u092e\u0947 \u092a\u0930\u092e\u092e\u094d \u0935\u091a\u0903 \u0964\n\u092f\u0924\u094d \u0924\u0947 \u0905\u0939\u092e\u094d \u092a\u094d\u0930\u0940\u092f\u092e\u093e\u0923\u093e\u092f \u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u0939\u093f\u0924 \u0915\u093e\u092e\u094d\u092f\u092f\u093e \u0965 \u0967 \u0965","Lord Krishna said - Arjuna, listen to the greatest among My instructions, which I will tell you once again. I\u2019ll do this for you as a friend wishing your well-being."],t.w)
B.W8=new A.e(B.c,["\u0928 \u092e\u0947 \u0935\u093f\u0926\u0941\u0903 \u0938\u0941\u0930\u0917\u0923\u093e\u0903 \u092a\u094d\u0930\u092d\u0935\u092e\u094d \u0928 \u092e\u0939\u0930\u094d\u0937\u092f\u0903 \u0964\n\u0905\u0939\u092e\u094d \u0906\u0926\u093f\u0930\u094d\u0939\u093f \u0926\u0947\u0935\u093e\u0928\u093e\u092e\u094d \u092e\u0939\u0930\u094d\u0937\u0940\u0923\u093e\u092e\u094d \u091a \u0938\u0930\u094d\u0935\u0936\u0903 \u0965 \u0968 \u0965","Neither the gods nor the great sages know My source. I am indeed the origin of all the gods and the great sages."],t.w)
B.Rr=new A.e(B.c,["\u092f\u094b \u092e\u093e\u092e\u094d \u0905\u091c\u092e\u094d \u0905\u0928\u093e\u0926\u093f\u092e\u094d \u091a \u0935\u0947\u0924\u094d\u0924\u093f \u0932\u094b\u0915\u092e\u0939\u0947\u0936\u094d\u0935\u0930\u092e\u094d \u0964\n\u0905\u0938\u092e\u094d\u092e\u0942\u0922\u0903 \u0938 \u092e\u0930\u094d\u0924\u094d\u092f\u0947\u0937\u0941 \u0938\u0930\u094d\u0935\u092a\u093e\u092a\u0948\u0903 \u092a\u094d\u0930\u092e\u0941\u091a\u094d\u092f\u0924\u0947 \u0965 \u0969 \u0965","Among humans, a person who is free of misconceptions knows Me to be without birth and without an origin, the Lord of the universe. Such a person is freed from all misfortune."],t.w)
B.Uv=new A.e(B.c,["\u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0905\u0938\u092e\u094d\u092e\u094b\u0939\u0903 \u0915\u094d\u0937\u092e\u093e \u0938\u0924\u094d\u092f\u092e\u094d \u0926\u092e\u0903 \u0936\u092e\u0903 \u0964\n\u0938\u0941\u0916\u092e\u094d \u0926\u0941\u0903\u0916\u092e\u094d \u092d\u0935\u094b\u093d\u092d\u093e\u0935\u094b \u092d\u092f\u092e\u094d \u091a \u0905\u092d\u092f\u092e\u094d \u090f\u0935 \u091a \u0965 \u096a \u0965\n\u0905\u0939\u093f\u092e\u094d\u0938\u093e \u0938\u092e\u0924\u093e \u0924\u0941\u0937\u094d\u091f\u093f\u0903 \u0924\u092a\u094b \u0926\u093e\u0928\u092e\u094d \u092f\u0936\u094b\u093d\u092f\u0936\u0903 \u0964\n\u092d\u0935\u0928\u094d\u0924\u093f \u092d\u093e\u0935\u093e \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u092e\u0924\u094d\u0924 \u090f\u0935 \u092a\u0943\u0925\u0915\u094d \u0935\u093f\u0927\u093e\u0903 \u0965 \u096b \u0965","The various emotions that take place in all beings arise from Me alone - recognition, cognition, freedom from misconception, forgiveness, truth, control over voluntary actions, control over oneself, comfort, discomfort, the state of having plenty, the state of discontent, fear and fearlessness too, the desire to avoid harming anyone, the attitude of equanimity, contentment, focus, charity, fame and infamy."],t.w)
B.UD=new A.e(B.c,["\u092e\u0939\u0930\u094d\u0937\u092f\u0903 \u0938\u092a\u094d\u0924 \u092a\u0942\u0930\u094d\u0935\u0947 \u091a\u0924\u094d\u0935\u093e\u0930\u094b \u092e\u0928\u0935\u0938\u094d\u0924\u0925\u093e \u0964\n\u092e\u0926\u094d\u092d\u093e\u0935\u093e \u092e\u093e\u0928\u0938\u093e \u091c\u093e\u0924\u093e\u0903 \u092f\u0947\u0937\u093e\u092e\u094d \u0932\u094b\u0915\u0947 \u0907\u092e\u093e\u0903 \u092a\u094d\u0930\u091c\u093e\u0903 \u0965 \u096c \u0965","The seven great sages, our ancestors born of Brahma, along with the four Manus are an expression of My will. All these descendants from them live in this world."],t.w)
B.PW=new A.e(B.c,["\u090f\u0924\u093e\u092e\u094d \u0935\u093f\u092d\u0942\u0924\u093f\u092e\u094d \u092f\u094b\u0917\u092e\u094d \u091a \u092e\u092e \u092f\u094b \u0935\u0947\u0924\u094d\u0924\u093f \u0924\u0924\u094d\u0924\u094d\u0935\u0924\u0903 \u0964\n\u0938\u0903 \u0905\u0935\u093f\u0915\u092e\u094d\u092a\u094d\u092f\u0947\u0928 \u092f\u094b\u0917\u0947\u0928 \u092f\u0941\u091c\u094d\u092f\u0924\u0947 \u0928\u093e\u0924\u094d\u0930 \u0938\u092e\u094d\u0936\u092f\u0903 \u0965 \u096d \u0965","The person who knows this expanse of My unlimited power and My associations - such a person sets to work and performs with unwavering focus and discipline. Let there be no doubt about this."],t.w)
B.Qt=new A.e(B.c,["\u0905\u0939\u092e\u094d \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u092a\u094d\u0930\u092d\u0935\u094b \u092e\u0924\u094d\u0924\u0903 \u0938\u0930\u094d\u0935\u092e\u094d \u092a\u094d\u0930\u0935\u0930\u094d\u0924\u0924\u0947 \u0964\n\u0907\u0924\u093f \u092e\u0924\u094d\u0935\u093e \u092d\u091c\u0928\u094d\u0924\u0947 \u092e\u093e\u092e\u094d \u092c\u0941\u0927\u093e \u092d\u093e\u0935 \u0938\u092e\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0965 \u096e \u0965","People with this awareness worship Me with the conviction that I am the origin of everything; that every entity gets stimulated with the initiative given by Me. These people are filled with feelings of adoration for Me."],t.w)
B.Ws=new A.e(B.c,["\u092e\u091a\u094d\u091a\u093f\u0924\u094d\u0924\u093e \u092e\u0926\u094d\u0917\u0924 \u092a\u094d\u0930\u093e\u0923\u093e\u0903 \u092c\u094b\u0927\u092f\u0928\u094d\u0924\u0903 \u092a\u0930\u0938\u094d\u092a\u0930\u092e\u094d \u0964\n\u0915\u0925\u092f\u0928\u094d\u0924\u0903 \u091a \u092e\u093e\u092e\u094d \u0928\u093f\u0924\u094d\u092f\u092e\u094d \u0924\u0941\u0937\u094d\u092f\u0928\u094d\u0924\u093f \u091a \u0930\u092e\u0928\u094d\u0924\u093f \u091a \u0965 \u096f \u0965","With their awareness dedicated to Me, their life runs with Me as the basis. They share awareness about Me among one another. Then they describe Me at all times. They enjoy it and take pleasure in listening."],t.w)
B.TE=new A.e(B.c,["\u0924\u0947\u0937\u093e\u092e\u094d \u0938\u0924\u0924 \u092f\u0941\u0915\u094d\u0924\u093e\u0928\u093e\u092e\u094d \u092d\u091c\u0924\u093e\u092e\u094d \u092a\u094d\u0930\u0940\u0924\u093f \u092a\u0942\u0930\u094d\u0935\u0915\u092e\u094d \u0964\n\u0926\u0926\u093e\u092e\u093f \u092c\u0941\u0926\u094d\u0927\u093f\u092f\u094b\u0917\u092e\u094d \u0924\u092e\u094d \u092f\u0947\u0928 \u092e\u093e\u092e\u094d \u0909\u092a\u092f\u093e\u0928\u094d\u0924\u093f \u0924\u0947 \u0965 \u0967\u0966 \u0965","To those who worship Me to be with Me always, I shall give, with great affection, that intellectual grasp by which they attain Me."],t.w)
B.Sf=new A.e(B.c,["\u0924\u0947\u0937\u093e\u092e\u094d \u090f\u0935 \u0905\u0928\u0941\u0915\u092e\u094d\u092a\u093e\u0930\u094d\u0925\u092e\u094d \u0905\u0939\u092e\u094d \u0905\u091c\u094d\u091e\u093e\u0928\u091c\u092e\u094d \u0924\u092e\u0903 \u0964\n\u0928\u093e\u0936\u092f\u093e\u092e\u093f \u0906\u0924\u094d\u092e\u092d\u093e\u0935\u0938\u094d\u0925\u094b \u091c\u094d\u091e\u093e\u0928 \u0926\u0940\u092a\u0947\u0928 \u092d\u093e\u0938\u094d\u0935\u0924\u093e \u0965 \u0967\u0967 \u0965","Due to compassion towards those very people, I stand as the subject of their thoughts, destroying the darkness of ignorance with the bright light of knowledge."],t.w)
B.NT=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092a\u0930\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u092a\u0930\u092e\u094d \u0927\u093e\u092e \u092a\u0935\u093f\u0924\u094d\u0930\u092e\u094d \u092a\u0930\u092e\u092e\u094d \u092d\u0935\u093e\u0928\u094d \u0964\n\u092a\u0941\u0930\u0941\u0937\u092e\u094d \u0936\u093e\u0936\u094d\u0935\u0924\u092e\u094d \u0926\u093f\u0935\u094d\u092f\u092e\u094d \u0906\u0926\u093f\u0926\u0947\u0935\u092e\u094d \u0905\u091c\u092e\u094d \u0935\u093f\u092d\u0941\u092e\u094d \u0965 \u0967\u0968 \u0965\n\u0906\u0939\u0941\u0903 \u0924\u094d\u0935\u093e\u092e\u094d \u090b\u0937\u092f\u0903 \u0938\u0930\u094d\u0935\u0947 \u0926\u0947\u0935\u0930\u094d\u0937\u093f\u0903 \u0928\u093e\u0930\u0926\u0938\u094d\u0924\u0925\u093e \u0964\n\u0905\u0938\u093f\u0924\u094b \u0926\u0947\u0935\u0932\u094b \u0935\u094d\u092f\u093e\u0938\u0903 \u0938\u094d\u0935\u092f\u092e\u094d \u091a\u0948\u0935 \u092c\u094d\u0930\u0935\u0940\u0937\u093f \u092e\u0947 \u0965 \u0967\u0969 \u0965","Arjuna said- All great thinkers who are devoted to You along with the divine sage Narada, the dark, unbound pious Vedavyasa say that You are the supreme might, the ultimate abode, You are the supreme purity, the greatest personality, ever-lasting, unaffected by the material world, the root of all powers, the One who is not created and the One with irresistible will. You tell this to me directly as well."],t.w)
B.SN=new A.e(B.c,["\u0938\u0930\u094d\u0935\u092e\u094d \u090f\u0924\u0924\u094d \u090b\u0924\u092e\u094d \u092e\u0928\u094d\u092f\u0947 \u092f\u0924\u094d \u092e\u093e\u092e\u094d \u0935\u0926\u0938\u093f \u0915\u0947\u0936\u0935 \u0964\n\u0928 \u0939\u093f \u0924\u0947 \u092d\u0917\u0935\u0928\u094d \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u092e\u094d \u0935\u093f\u0926\u0941\u0903 \u0926\u0947\u0935\u093e \u0928 \u0926\u093e\u0928\u0935\u093e\u0903 \u0965 \u0967\u096a \u0965","Krishna, I consider all this as the truth- everything You tell me. O Lord, indeed, nobody knows your personality - neither virtuous people nor the vile."],t.w)
B.TU=new A.e(B.c,["\u0938\u094d\u0935\u092f\u092e\u0947\u0935 \u0906\u0924\u094d\u092e\u0928\u093e \u0906\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0935\u0947\u0924\u094d\u0925 \u0924\u094d\u0935\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0964\n\u092d\u0942\u0924 \u092d\u093e\u0935\u0928 \u092d\u0942\u0924\u0947\u0936 \u0926\u0947\u0935\u0926\u0947\u0935 \u091c\u0917\u0924\u094d\u092a\u0924\u0947 \u0965 \u0967\u096b \u0965","O best among men, You alone know Yourself with Your own mind. You are the origin of all beings, the controller of all beings, the supreme power , the Lord of the universe."],t.w)
B.WI=new A.e(B.c,["\u0935\u0915\u094d\u0924\u0941\u092e\u094d \u0905\u0930\u094d\u0939\u0938\u093f \u0905\u0936\u0947\u0937\u0947\u0923 \u0926\u093f\u0935\u094d\u092f\u093e \u0939\u094d\u092f\u093e\u0924\u094d\u092e \u0935\u093f\u092d\u0942\u0924\u092f\u0903 \u0964\n\u092f\u093e\u092d\u093f\u0903 \u0935\u093f\u092d\u0942\u0924\u093f\u092d\u093f\u0903 \u0932\u094b\u0915\u093e\u0928\u094d \u0907\u092e\u093e\u092e\u094d \u0924\u094d\u0935\u092e\u094d \u0935\u094d\u092f\u093e\u092a\u094d\u092f \u0924\u093f\u0937\u094d\u0920\u0938\u093f \u0965 \u0967\u096c \u0965","You must now describe to me Your expanse of power entirely. Your powers are indeed divine. With these supreme powers, You stay pervading these worlds."],t.w)
B.Qg=new A.e(B.c,["\u0915\u0925\u092e\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u092f\u094b\u0917\u0940 \u0924\u094d\u0935\u093e\u092e\u094d \u0938\u0926\u093e \u092a\u0930\u093f\u091a\u093f\u0928\u094d\u0924\u092f\u0928\u094d \u0964\n\u0915\u0947\u0937\u0941 \u0915\u0947\u0937\u0941 \u091a \u092d\u093e\u0935\u0947\u0937\u0941 \u091a\u093f\u0928\u094d\u0924\u094d\u092f\u094b \u0905\u0938\u093f \u092d\u0917\u0935\u0928\u094d \u092e\u092f\u093e \u0965 \u0967\u096d \u0965","I am in the quest of Your devotion . How do I know You, while thinking about You always? O Lord, in what forms and thoughts are You to be thought about by Me?"],t.w)
B.SG=new A.e(B.c,["\u0935\u093f\u0938\u094d\u0924\u0930\u0947\u0923 \u0906\u0924\u094d\u092e\u0928\u094b \u092f\u094b\u0917\u092e\u094d \u0935\u093f\u092d\u0942\u0924\u093f\u092e\u094d \u091a \u091c\u0928\u093e\u0930\u094d\u0926\u0928 \u0964\n\u092d\u0942\u092f\u0903 \u0915\u0925\u092f \u0924\u0943\u092a\u094d\u0924\u093f\u0930\u094d\u0939\u093f \u0936\u0943\u0923\u094d\u0935\u0924\u094b \u0928\u093e\u0938\u094d\u0924\u093f \u092e\u0947 \u0905\u092e\u0943\u0924\u092e\u094d \u0965 \u0967\u096e \u0965","Krishna, Tell me again about Your greatness and Your supreme might. While I listen and drink its sweetness, I crave for more."],t.w)
B.Qn=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0939\u0928\u094d\u0924 \u0924\u0947 \u0915\u0925\u092f\u093f\u0937\u094d\u092f\u093e\u092e\u093f \u0935\u093f\u092d\u0942\u0924\u0940\u0903 \u0906\u0924\u094d\u092e\u0928\u0903 \u0936\u0941\u092d\u093e\u0903 \u0964\n\u092a\u094d\u0930\u093e\u0927\u093e\u0928\u094d\u092f\u0924\u0903 \u0915\u0941\u0930\u0941\u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0928\u093e\u0938\u094d\u0924\u094d\u092f\u0928\u094d\u0924\u094b \u0935\u093f\u0938\u094d\u0924\u0930\u0938\u094d\u092f \u092e\u0947 \u0965 \u0967\u096f \u0965","Lord Krishna said Good! Arjuna, I will tell you what stands out in the favorable expanse of My might and My irresistible will. There is no end to My expanse."],t.w)
B.O9=new A.e(B.c,["\u0905\u0939\u092e\u094d \u0906\u0924\u094d\u092e\u093e \u0917\u0941\u0921\u093e\u0915\u0947\u0936 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0936\u092f \u0938\u094d\u0925\u093f\u0924\u0903 \u0964\n\u0905\u0939\u092e\u094d \u0906\u0926\u093f\u0936\u094d\u091a \u092e\u0927\u094d\u092f\u092e\u094d \u091a \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0905\u0928\u094d\u0924 \u090f\u0935 \u091a \u0965 \u0968\u0966 \u0965","Arjuna, I am situated in all beings at their core as the Self. Moreover, I am the beginning, as well as the end and everything in-between."],t.w)
B.Vk=new A.e(B.c,["\u0906\u0926\u093f\u0924\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0935\u093f\u0937\u094d\u0923\u0941\u0903 \u091c\u094d\u092f\u094b\u0924\u093f\u0937\u093e\u092e\u094d \u0930\u0935\u093f\u0903 \u0905\u0928\u094d\u0936\u0941\u092e\u093e\u0928\u094d \u0964\n\u092e\u0930\u0940\u091a\u093f\u0903 \u092e\u0930\u0941\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0928\u0915\u094d\u0937\u0924\u094d\u0930\u093e\u0923\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0936\u0936\u0940 \u0965 \u0968\u0967 \u0965","In the powers of nature , I am Vishnu, the all-pervasive. In all luminous things, I am the sun that has the greatest brightness. Among the powers of war, I am the most powerful. Among the stars, I appear as the moon."],t.w)
B.Q_=new A.e(B.c,["\u0935\u0947\u0926\u093e\u0928\u093e\u092e\u094d \u0938\u093e\u092e\u0935\u0947\u0926\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u0947\u0935\u093e\u0928\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0935\u093e\u0938\u0935\u0903 \u0964\n\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0923\u093e\u092e\u094d \u092e\u0928\u0936\u094d\u091a \u0905\u0938\u094d\u092e\u093f \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u091a\u0947\u0924\u0928\u093e \u0965 \u0968\u0968 \u0965","Among the Vedas, I am the Sama Veda. Among the gods , I am their Lord. Among our sense organs, I am the mind and I am consciousness in all beings."],t.w)
B.Us=new A.e(B.c,["\u0930\u0941\u0926\u094d\u0930\u093e\u0923\u093e\u092e\u094d \u0936\u0919\u094d\u0915\u0930\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0935\u093f\u0924\u094d\u0924\u0947\u0936\u094b \u092f\u0915\u094d\u0937 \u0930\u0915\u094d\u0937\u0938\u093e\u092e\u094d \u0964\n\u0935\u0938\u0942\u0928\u093e\u092e\u094d \u092a\u093e\u0935\u0915\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0936\u093f\u0916\u0930\u093f\u0923\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u092e\u0947\u0930\u0941\u0903 \u0965 \u0968\u0969 \u0965","Among manifestations of Rudra who destroys the unfavorable, I am Shankara, the one who brings prosperity. To the virtuous and vile who crave wealth and power, I am the hugely wealthy one. Among the entities of the universe, I am energy. Among the peaks, I am the huge mountain that shines the brightest."],t.w)
B.RH=new A.e(B.c,["\u092a\u0941\u0930\u094b\u0927\u0938\u093e\u092e\u094d \u091a \u092e\u0941\u0916\u094d\u092f\u092e\u094d \u092e\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092a\u093e\u0930\u094d\u0925 \u092c\u0943\u0939\u0938\u094d\u092a\u0924\u093f\u092e\u094d \u0964\n\u0938\u0947\u0928\u093e\u0928\u0940\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0938\u094d\u0915\u0928\u094d\u0926\u0903 \u0938\u0930\u0938\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0938\u093e\u0917\u0930\u0903 \u0965 \u0968\u096a \u0965","Arjuna, among the chief priests and highly valued advisors, know Me to be Brihaspati, the master of all great people. Among the commanders of armies, I am Skanda, the leader who is supreme in attack. To all water bodies, I am the inexhaustible ocean."],t.w)
B.Nw=new A.e(B.c,["\u092e\u0939\u0930\u094d\u0937\u0940\u0923\u093e\u092e\u094d \u092d\u0943\u0917\u0941\u0930\u0939\u092e\u094d \u0917\u093f\u0930\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u090f\u0915\u092e\u094d \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u0964\n\u092f\u091c\u094d\u091e\u093e\u0928\u093e\u092e\u094d \u091c\u092a \u092f\u091c\u094d\u091e\u094b\u093d\u0938\u094d\u092e\u093f \u0938\u094d\u0925\u093e\u0935\u0930\u093e\u0923\u093e\u092e\u094d \u0939\u093f\u092e\u093e\u0932\u092f\u0903 \u0965 \u0968\u096b \u0965","Among the great sages, I am Bhrgu. Among all speech, I am the first sound. Among the various forms of worship, I am the worship that takes the form of a prayer. Among the immovables, I am the Himalaya."],t.w)
B.RE=new A.e(B.c,["\u0905\u0936\u094d\u0935\u0924\u094d\u0925\u0903 \u0938\u0930\u094d\u0935 \u0935\u0943\u0915\u094d\u0937\u093e\u0923\u093e\u092e\u094d \u0926\u0947\u0935\u0930\u094d\u0937\u0940\u0923\u093e\u092e\u094d \u091a \u0928\u093e\u0930\u0926\u0903 \u0964\n\u0917\u0928\u094d\u0927\u0930\u094d\u0935\u093e\u0923\u093e\u092e\u094d \u091a\u093f\u0924\u094d\u0930\u0930\u0925\u0903 \u0938\u093f\u0926\u094d\u0927\u093e\u0928\u093e\u092e\u094d \u0915\u092a\u093f\u0932\u094b \u092e\u0941\u0928\u093f\u0903 \u0965 \u0968\u096c \u0965\n\u0909\u091a\u094d\u091a\u0948\u0936\u094d\u0930\u0935\u0938\u092e\u094d \u0905\u0936\u094d\u0935\u093e\u0928\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u093e\u092e\u094d \u0905\u092e\u0943\u0924\u094b\u0926\u094d\u092d\u0935\u092e\u094d \u0964\n\u0910\u0930\u093e\u0935\u0924\u092e\u094d \u0917\u091c\u0947\u0928\u094d\u0926\u094d\u0930\u093e\u0923\u093e\u092e\u094d \u0928\u0930\u093e\u0923\u093e\u092e\u094d \u091a \u0928\u0930\u093e\u0927\u093f\u092a\u092e\u094d \u0965 \u0968\u096d \u0965\n\u0906\u092f\u0941\u0927\u093e\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0935\u091c\u094d\u0930\u092e\u094d \u0927\u0947\u0928\u0942\u0928\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0915\u093e\u092e\u0927\u0941\u0915\u094d \u0964\n\u092a\u094d\u0930\u091c\u0928\u0936\u094d\u091a\u093e\u0938\u094d\u092e\u093f \u0915\u0928\u094d\u0926\u0930\u094d\u092a\u0903 \u0938\u0930\u094d\u092a\u093e\u0923\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0935\u093e\u0938\u0941\u0915\u093f\u0903 \u0965 \u0968\u096e \u0965\n\u0906\u0928\u0928\u094d\u0924\u0936\u094d\u091a\u093e\u0938\u094d\u092e\u093f \u0928\u093e\u0917\u093e\u0928\u093e\u092e\u094d \u0935\u0930\u0941\u0923\u094b \u092f\u093e\u0926\u0938\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u092a\u093f\u0924\u0943\u093d\u0923\u093e\u092e\u094d \u0905\u0930\u094d\u092f\u092e\u093e \u091a\u093e\u0938\u094d\u092e\u093f \u092f\u092e\u0903 \u0938\u092e\u094d\u092f\u092e\u0924\u093e\u092e\u0939\u092e\u094d \u0965 \u0968\u096f \u0965","Among all trees, I am the Pepal. Among the sages who compose divine verse, I am Narada, who founded such compositions. To the Gandharvas, I am their chief. Among accomplished people, I am Kapila, the ascetic who founded the philosophy of logic. Know Me to arise from nectar. Know Me as the origin and king of horses among horses; as Airavata, the best elephant among the best of elephants and as the leader of humans among human beings. In weapons, I am the hard sharpness. In cows, I am the one who satisfies wishes. I am the love which begets progeny. Among the snakes of this world, I am Vasuki, who is the most worshipped snake, whom the gods and demons employed to churn the ocean. To all snakes, I am Adishesha. Among the beings who live in water, I am Varuna. To the ancestors, I am a companion and friend. To the people who maintain control, I am self-restraint."],t.w)
B.Sg=new A.e(B.c,["\u092a\u094d\u0930\u0939\u094d\u0932\u093e\u0926\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0926\u0948\u0924\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0915\u093e\u0932\u0903 \u0915\u0932\u092f\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u092e\u0943\u0917\u093e\u0923\u093e\u092e\u094d \u091a \u092e\u0943\u0917\u0947\u0928\u094d\u0926\u094d\u0930\u094b\u093d\u0939\u092e\u094d \u0935\u0948\u0928\u0924\u0947\u092f\u0903 \u091a \u092a\u0915\u094d\u0937\u093f\u0923\u093e\u092e\u094d \u0965 \u0969\u0966 \u0965","Among the demons, I am Prahlada, the friendly boy. To the calculative people who bring about destruction, I am death. Among animals, I am their leader. Among birds, I am Garuda, their chief."],t.w)
B.NK=new A.e(B.c,["\u092a\u0935\u0928\u0903 \u092a\u0935\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0930\u093e\u092e\u0903 \u0936\u0938\u094d\u0924\u094d\u0930 \u092d\u0943\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u091d\u0937\u093e\u0923\u093e\u092e\u094d \u092e\u0915\u0930\u0903 \u091a\u093e\u0938\u094d\u092e\u093f \u0938\u094d\u0930\u094b\u0924\u0938\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u091c\u093e\u0939\u094d\u0928\u0935\u0940 \u0965 \u0969\u0967 \u0965","To things that have movement in their nature, I am the wind. Among people who bear arms, I am Lord Rama, the ultimate gentleman warrior. Among marine predators, I am the crocodile. Among rivers, I am the river Ganga."],t.w)
B.PD=new A.e(B.c,["\u0938\u0930\u094d\u0917\u093e\u0923\u093e\u092e\u094d \u0906\u0926\u093f\u0930\u0928\u094d\u0924\u0903 \u091a \u092e\u0927\u094d\u092f\u092e\u094d \u091a\u0948\u0935\u093e\u0939\u092e\u094d \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0935\u093f\u0926\u094d\u092f\u093e \u0935\u093f\u0926\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0935\u093e\u0926\u0903 \u092a\u094d\u0930\u0935\u0926\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0969\u0968 \u0965","Arjuna, all creations have Me as the beginning, the end and everything in-between. In all knowledge, I am the fundamental knowledge about the Self, its relation to the Universe and the Lord. Among people who debate, I am the point that closes the argument."],t.w)
B.Oo=new A.e(B.c,["\u0905\u0915\u094d\u0937\u0930\u093e\u0923\u093e\u092e\u094d \u0905\u0915\u093e\u0930\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935\u0903 \u0938\u093e\u092e\u093e\u0938\u093f\u0915\u0938\u094d\u092f \u091a \u0964\n\u0905\u0939\u092e\u094d \u090f\u0935 \u0905\u0915\u094d\u0937\u092f\u0903 \u0915\u093e\u0932\u094b \u0927\u093e\u0924\u093e\u0939\u092e\u094d \u0935\u093f\u0936\u094d\u0935\u0924\u094b \u092e\u0941\u0916\u0903 \u0965 \u0969\u0969 \u0965","In alphabets, I am the primary element, the phonetic 'a'. Among the various methods of combining words, I am the dvandva. I alone am the time that never wanes. I am the One who brought about all creation, having four heads, looking over all of My creation."],t.w)
B.Uw=new A.e(B.c,["\u092e\u0943\u0924\u094d\u092f\u0941\u0903 \u0938\u0930\u094d\u0935\u0939\u0930\u0903 \u091a\u093e\u0939\u092e\u094d \u0909\u0926\u094d\u092d\u0935\u0903 \u091a \u092d\u0935\u093f\u0937\u094d\u092f\u0924\u093e\u092e\u094d \u0964\n\u0915\u0940\u0930\u094d\u0924\u093f\u0903 \u0936\u094d\u0930\u0940\u0903 \u0935\u093e\u0915\u0936\u094d\u091a \u0928\u093e\u0930\u0940\u0923\u093e\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u093f\u0930\u094d\u092e\u0947\u0927\u093e \u0927\u0943\u0924\u093f\u0903 \u0915\u094d\u0937\u092e\u093e \u0965 \u0969\u096a \u0965","I am the termination that takes away everything. I am the act of creation to things which will be created. Among ladies, I am Lakshmi and that which is called as luster. I am speech. I am memory-recall, I am talent, courage and resolve. I am forgiveness ."],t.w)
B.O1=new A.e(B.c,["\u092c\u0943\u0939\u0924\u094d\u0938\u093e\u092e \u0924\u0925\u093e \u0938\u093e\u092e\u094d\u0928\u093e\u092e\u094d \u0917\u093e\u092f\u0924\u094d\u0930\u0940 \u091b\u0928\u094d\u0926\u0938\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u092e\u093e\u0938\u093e\u0928\u093e\u092e\u094d \u092e\u093e\u0930\u094d\u0917\u0936\u0940\u0930\u094d\u0937\u094b\u093d\u0939\u092e\u094d \u090b\u0924\u0942\u0928\u093e\u092e\u094d \u0915\u0941\u0938\u0941\u092e\u093e\u0915\u0930\u0903 \u0965 \u0969\u096b \u0965","Among calming and gentle tunes, I am the one that spans all of thought and speech. Among the poetical metres, I am the Gayatri. Among the months, I am Margashirsha, when the rain-bearing clouds give way to pleasant and prosperous times. Among the seasons, I am the spring-time, the season when flowers bloom and all beings are comforted."],t.w)
B.Ve=new A.e(B.c,["\u0926\u094d\u092f\u0942\u0924\u092e\u094d \u091b\u0932\u092f\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0924\u0947\u091c\u0903 \u0924\u0947\u091c\u0938\u094d\u0935\u093f\u0928\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0964\n\u091c\u092f\u094b\u0938\u094d\u092e\u093f \u0935\u094d\u092f\u0935\u0938\u093e\u092f\u094b\u093d\u0938\u094d\u092e\u093f \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0938\u0924\u094d\u0924\u094d\u0935\u0935\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0969\u096c \u0965","Among people who intend to deceive, I am gambling. To the brilliant, I am brilliance. I am victory. I am determination and perseverance. To people who are endowed with wisdom and virtue, I am the wisdom and the virtue."],t.w)
B.NH=new A.e(B.c,["\u0935\u0943\u0937\u094d\u0923\u0940\u0928\u093e\u092e\u094d \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u094b\u093d\u0938\u094d\u092e\u093f \u092a\u093e\u0928\u094d\u0921\u0935\u093e\u0928\u093e\u092e\u094d \u0927\u0928\u0928\u094d\u091c\u092f\u0903 \u0964\n\u092e\u0941\u0928\u0940\u0928\u093e\u092e\u094d \u0905\u092a\u094d\u092f\u0939\u092e\u094d \u0935\u094d\u092f\u093e\u0938\u0903 \u0915\u0935\u0940\u0928\u093e\u092e\u094d \u0909\u0936\u0928\u093e \u0915\u0935\u093f\u0903 \u0965 \u0969\u096d \u0965","Among the mighty and passionate, I am Krishna, the son of Vasudeva. Among the Pandava, I am Arjuna, who carries the bow. Among those who have realized the Self through knowledge and meditation, I am Vedavyasa. Among teachers of strategy, I am Shukracharya."],t.w)
B.SQ=new A.e(B.c,["\u0926\u0902\u0921\u094b \u0926\u092e\u092f\u0924\u093e\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0928\u0940\u0924\u093f\u0930\u0938\u094d\u092e\u093f \u091c\u093f\u0917\u0940\u0937\u0924\u093e\u092e\u094d \u0964\n\u092e\u094c\u0928\u092e\u094d \u091a\u0948\u0935\u093e\u0938\u094d\u092e\u093f \u0917\u0941\u0939\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u0935\u0924\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0965 \u0969\u096e \u0965","To the people who punish, I am punishment. To those who desire to conquer, I am policy and prudence. Among things that are inscrutable, I am silence. I am knowledge to those who know."],t.w)
B.UM=new A.e(B.c,["\u092f\u0924\u094d \u091a\u093e\u092a\u093f \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u092c\u0940\u091c\u092e\u094d \u0924\u0926\u0939\u092e\u094d \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0928 \u0924\u0926\u0938\u094d\u0924\u093f \u0935\u093f\u0928\u093e \u092f\u0924\u094d \u0938\u094d\u092f\u093e\u0924\u094d \u092e\u092f\u093e \u092d\u0942\u0924\u092e\u094d \u091a\u0930\u093e\u091a\u0930\u092e\u094d \u0965 \u0969\u096f \u0965","Arjuna, whatever is the source of all beings, I am that. It is impossible for any being, moving or stationary, to exist without Me."],t.w)
B.Ui=new A.e(B.c,["\u0928 \u0905\u0928\u094d\u0924\u094b\u093d\u0938\u094d\u0924\u093f \u092e\u092e \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u093e\u092e\u094d \u0935\u093f\u092d\u0942\u0924\u0940\u0928\u093e\u092e\u094d \u092a\u0930\u0928\u094d\u0924\u092a \u0964\n\u090f\u0937 \u0924\u0941 \u0909\u0926\u094d\u0926\u0947\u0936\u0924\u0903 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u094b \u0935\u093f\u092d\u0942\u0924\u0947\u0903 \u0935\u093f\u0938\u094d\u0924\u0930\u094b \u092e\u092f\u093e \u0965 \u096a\u0966 \u0965","Arjuna, there is no end to my wondrous pervasive expanse. The expanse of this great power was told by Me as a summary."],t.w)
