B.Os=new A.e(B.c,["\u0905\u0925\u0935\u093e \u092c\u0939\u0941\u0928\u0948\u0924\u0947\u0928 \u0915\u093f\u092e\u094d \u091c\u094d\u091e\u093e\u0924\u0947\u0928 \u0924\u0935\u093e\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0935\u093f\u0937\u094d\u091f\u092d\u094d\u092f\u093e\u0939\u092e\u094d \u0907\u0926\u092e\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u092e\u094d \u090f\u0915\u093e\u092e\u094d\u0936\u0947\u0928 \u0938\u094d\u0925\u093f\u0924\u094b \u091c\u0917\u0924\u094d \u0965 \u096a\u0968 \u0965","Arjuna, what's further elaboration of this knowledge to you? I support and control this entire universe, which is situated in one part of My being."],t.w)
B.OK=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092e\u0926\u0928\u0941\u0917\u094d\u0930\u0939\u093e\u092f \u092a\u0930\u092e\u092e\u094d \u0917\u0941\u0939\u094d\u092f\u092e\u094d \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0938\u091e\u094d\u091c\u094d\u091e\u093f\u0924\u092e\u094d \u0964\n\u092f\u0924\u094d \u0924\u094d\u0935\u092f\u094b\u0915\u094d\u0924\u092e\u094d \u0935\u091a\u0938\u094d\u0924\u0947\u0928 \u092e\u094b\u0939\u094b\u093d\u092f\u092e\u094d \u0935\u093f\u0917\u0924\u094b \u092e\u092e \u0965 \u0967 \u0965","Arjuna said - The teaching, which You have imparted for my benefit, out of Love, which is supremely concealed, is called the knowledge of the Self. By that teaching, this confusion of mine is gone."],t.w)
B.Pf=new A.e(B.c,["\u092d\u0935\u093e\u092a\u094d\u092f\u092f\u094c \u0939\u093f \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0936\u094d\u0930\u0941\u0924\u094c \u0935\u093f\u0938\u094d\u0924\u0930\u0936\u094b \u092e\u092f\u093e \u0964\n\u0924\u094d\u0935\u0924\u094d\u0924\u0903 \u0915\u092e\u0932 \u092a\u0924\u094d\u0930\u093e\u0915\u094d\u0937 \u092e\u093e\u0939\u093e\u0924\u094d\u092e\u094d\u092f\u092e\u094d \u0905\u092a\u093f \u091a\u093e\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u0968 \u0965","Krishna, You have eyes as beautiful as lotus leaves. I listened to the elaboration of the creation and destruction of all beings, which is brought about by You. I also listened to Your unending greatness."],t.w)
