B.SL=new A.e(B.c,["\u092e\u0928\u094d\u092f\u0938\u0947 \u092f\u0926\u093f \u092e\u091a\u094d\u091b\u0915\u094d\u092f\u092e\u094d \u092e\u092f\u093e \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0907\u0924\u093f \u092a\u094d\u0930\u092d\u094b \u0964\n\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930 \u0924\u0924\u094b \u092e\u0947 \u0924\u094d\u0935\u092e\u094d \u0926\u0930\u094d\u0936\u092f\u093e\u093d\u0924\u094d\u092e\u093e\u0928\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u096a \u0965","Lord, if You believe that it's possible for me to see it, then show me Your undiminished self entirely. You are the Lord of all favorable associations."],t.w)
