B.Od=new A.e(B.c,["\u0928 \u0924\u0941 \u092e\u093e\u092e\u094d \u0936\u0915\u094d\u0937\u094d\u092f\u0938\u0947 \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0905\u0928\u0947\u0928\u0948\u0935 \u0938\u094d\u0935 \u091a\u0915\u094d\u0937\u0941\u0937\u093e \u0964\n\u0926\u093f\u0935\u094d\u092f\u092e\u094d \u0926\u0926\u093e\u092e\u093f \u0924\u0947 \u091a\u0915\u094d\u0937\u0941\u0903 \u092a\u0936\u094d\u092f \u092e\u0947 \u092f\u094b\u0917\u092e\u094d \u0910\u0936\u094d\u0935\u0930\u092e\u094d \u0965 \u096e \u0965","However, you are unable to see Me with these eyes of yours alone. I will give you divine sight; See My association with all favorable qualities, My splendor and power."],t.w)
B.No=new A.e(B.c,["\u0938\u0928\u094d\u091c\u092f \u0909\u0935\u093e\u091a -\n\u090f\u0935\u092e\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0924\u0924\u094b \u0930\u093e\u091c\u0928\u094d \u092e\u0939\u093e \u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930\u094b \u0939\u0930\u093f\u0903 \u0964\n\u0926\u0930\u094d\u0936\u092f\u093e\u092e\u093e\u0938 \u092a\u093e\u0930\u094d\u0925\u093e\u092f \u092a\u0930\u092e\u092e\u094d \u0930\u0942\u092a\u092e\u094d \u0910\u0936\u094d\u0935\u0930\u092e\u094d \u0965 \u096f \u0965","Sanjaya narrated - Then, my king, having said this, Lord Krishna - who is the great Lord of yoga - showed the ultimate beauty of His form and His pervasive might for the sake of Arjuna."],t.w)
B.TO=new A.e(B.c,["\u0905\u0928\u0947\u0915 \u0935\u0915\u094d\u0924\u094d\u0930 \u0928\u092f\u0928\u092e\u094d \u0905\u0928\u0947\u0915\u093e\u0926\u094d\u092d\u0941\u0924 \u0926\u0930\u094d\u0936\u0928\u092e\u094d \u0964\n\u0905\u0928\u0947\u0915 \u0926\u093f\u0935\u094d\u092f\u093e\u092d\u0930\u0923\u092e\u094d \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u0947\u0915\u094b\u0926\u094d\u092f\u0924\u093e\u092f\u0941\u0927\u092e\u094d \u0965 \u0967\u0966 \u0965\n\u0926\u093f\u0935\u094d\u092f \u092e\u093e\u0932\u094d\u092f\u093e\u092e\u094d\u092c\u0930\u0927\u0930\u092e\u094d \u0926\u093f\u0935\u094d\u092f \u0917\u0928\u094d\u0927\u093e\u0928\u0941\u0932\u0947\u092a\u0928\u092e\u094d \u0964\n\u0938\u0930\u094d\u0935\u093e\u0936\u094d\u091a\u0930\u094d\u092f\u092e\u092f\u092e\u094d \u0926\u0947\u0935\u092e\u094d \u0905\u0928\u0928\u094d\u0924\u092e\u094d \u0935\u093f\u0936\u094d\u0935\u0924\u094b\u092e\u0941\u0916\u092e\u094d \u0965 \u0967\u0967 \u0965","The Lord's form is seen With many faces and many eyes, with many extraordinary sights, with supreme decorations, armed with many supreme weapons, with supreme garlands and clothes, with supreme aroma smeared on His body, full with every wonder, endless, facing every direction in the universe."],t.w)
B.PR=new A.e(B.c,["\u0926\u093f\u0935\u093f \u0938\u0942\u0930\u094d\u092f \u0938\u0939\u0938\u094d\u0930\u0938\u094d\u092f \u092d\u0935\u0947\u0924\u094d \u092f\u0941\u0917\u092a\u0924\u094d \u0909\u0924\u094d\u0925\u093f\u0924\u093e \u0964\n\u092f\u0926\u093f \u092d\u093e\u0903 \u0938\u0926\u0943\u0936\u0940 \u0938\u093e \u0938\u094d\u092f\u093e\u0924\u094d \u092d\u093e\u0938\u0938\u094d\u0924\u0938\u094d\u092f \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u0903 \u0965 \u0967\u0968 \u0965","If there would be a rising of a thousand suns simultaneously in the sky, the resulting brilliance would perhaps be comparable to the brilliance of that Ultimate Self."],t.w)
B.Ob=new A.e(B.c,["\u0924\u0924\u094d\u0930\u0948\u0915\u0938\u094d\u0925\u092e\u094d \u091c\u0917\u0924\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u092e\u094d \u092a\u094d\u0930\u0935\u093f\u092d\u0915\u094d\u0924\u092e\u094d \u0905\u0928\u0947\u0915\u0927\u093e \u0964\n\u0905\u092a\u0936\u094d\u092f\u0924\u094d \u0926\u0947\u0935\u0926\u0947\u0935\u0938\u094d\u092f \u0936\u0930\u0940\u0930\u0947 \u092a\u093e\u0928\u094d\u0921\u0935\u0938\u094d\u0924\u0926\u093e \u0965 \u0967\u0969 \u0965","Then, Arjuna saw the entire universe with its manifold variety over there, in one place inside the body of the Lord of Lords."],t.w)
B.Tc=new A.e(B.c,["\u0924\u0924\u0903 \u0938 \u0935\u093f\u0938\u094d\u092e\u092f\u093e\u0935\u093f\u0937\u094d\u091f\u094b \u0939\u0943\u0937\u094d\u091f \u0930\u094b\u092e\u093e \u0927\u0928\u0928\u094d\u091c\u092f\u0903 \u0964\n\u092a\u094d\u0930\u0923\u092e\u094d\u092f \u0936\u093f\u0930\u0938\u093e \u0926\u0947\u0935\u092e\u094d \u0915\u0943\u0924\u093e\u0928\u094d\u091c\u0932\u093f\u0903 \u0905\u092d\u093e\u0937\u0924 \u0965 \u0967\u096a \u0965","With that, Arjuna was filled with wonder. With his hairs standing in delight, he saluted the Lord by prostrating. Arjuna spoke with folded hands."],t.w)
B.P8=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0926\u0947\u0935\u093e\u0928\u094d \u0924\u0935 \u0926\u0947\u0935 \u0926\u0947\u0939\u0947\n\u0938\u0930\u094d\u0935\u093e\u0928\u094d \u0924\u0925\u093e \u092d\u0942\u0924 \u0935\u093f\u0936\u0947\u0937 \u0938\u0919\u094d\u0918\u093e\u0928\u094d \u0964\n\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u092e\u094d \u0908\u0936\u092e\u094d \u0915\u092e\u0932\u093e\u0938\u0928\u0938\u094d\u0925\u092e\u094d\n\u090b\u0937\u0940\u0928\u094d \u091a \u0938\u0930\u094d\u0935\u093e\u0928\u094d \u0909\u0930\u0917\u093e\u0928\u094d \u091a \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u094d \u0965 \u0967\u096b \u0965","Arjuna said - Lord, I see the gods in Your body, also the whole lot of beings in their variety, Brahma the principal engineer of the universe, Lord Eshwara seated in the lotus posture, even the entire set of sages and the divine serpents."],t.w)
B.Wx=new A.e(B.c,["\u0905\u0928\u0947\u0915 \u092c\u093e\u0939\u0942\u0926\u0930 \u0935\u0915\u094d\u0924\u094d\u0930 \u0928\u0947\u0924\u094d\u0930\u092e\u094d\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u092e\u094d \u0938\u0930\u094d\u0935\u0924\u0903 \u0905\u0928\u0928\u094d\u0924 \u0930\u0942\u092a\u092e\u094d \u0964\n\u0928\u093e\u0928\u094d\u0924\u092e\u094d \u0928 \u092e\u0927\u094d\u092f\u092e\u094d \u0928 \u092a\u0941\u0928\u0903 \u0924\u0935\u093e\u093d\u0926\u093f\u092e\u094d\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0935\u093f\u0936\u094d\u0935\u0947\u0936\u094d\u0935\u0930 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u092e\u094d \u0965 \u0967\u096c \u0965","The many arms, torsos, faces and eyes - I see you in Your endless form in every way. O Lord of the universe, You have the universe as Your body . I do not see its end, I do not see its beginning and I don't see a mid-point."],t.w)
B.QK=new A.e(B.c,["\u0915\u093f\u0930\u0940\u091f\u093f\u0928\u092e\u094d \u0917\u0926\u093f\u0928\u092e\u094d \u091a\u0915\u094d\u0930\u093f\u0923\u092e\u094d \u091a\n\u0924\u0947\u091c\u094b\u0930\u093e\u0936\u093f\u092e\u094d \u0938\u0930\u094d\u0935\u0924\u094b \u0926\u0940\u092a\u094d\u0924\u093f\u092e\u0928\u094d\u0924\u092e\u094d \u0964\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u092e\u094d \u0926\u0941\u0930\u094d\u0928\u093f\u0930\u0940\u0915\u094d\u0937\u094d\u092f\u092e\u094d \u0938\u092e\u0928\u094d\u0924\u093e\u0924\u094d\n\u0926\u0940\u092a\u094d\u0924\u093e\u0928\u0932\u093e\u0930\u094d\u0915 \u0926\u094d\u092f\u0941\u0924\u093f\u092e\u094d \u0905\u092a\u094d\u0930\u092e\u0947\u092f\u092e\u094d \u0965 \u0967\u096d \u0965","I see you crowned, bearing a mace and a disc. You are impossible to see completely. You are abundant energy. You are brilliant in every direction. You have the light of a blazing sun. You are beyond quantification."],t.w)
B.Ok=new A.e(B.c,["\u0924\u094d\u0935\u092e\u094d \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u092a\u0930\u092e\u092e\u094d \u0935\u0947\u0926\u093f\u0924\u200b\u0935\u094d\u092f\u092e\u094d\n\u0924\u094d\u0935\u092e\u094d \u0905\u0938\u094d\u092f \u0935\u093f\u0936\u094d\u0935\u0938\u094d\u092f \u092a\u0930\u092e\u094d \u0928\u093f\u0927\u093e\u0928\u092e\u094d \u0964\n\u0924\u094d\u0935\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u0903 \u0936\u093e\u0936\u094d\u0935\u0924 \u0927\u0930\u094d\u092e \u0917\u094b\u092a\u094d\u0924\u093e\n\u0938\u0928\u093e\u0924\u0928\u0903 \u0924\u094d\u0935\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b \u092e\u0924\u094b \u092e\u0947 \u0965 \u0967\u096e \u0965","You are the supreme and ever-lasting One. You are to be known. You are the ultimate basis of this universe. You never wear out, You are the protector of eternal values. You are the eternal person. This is my belief."],t.w)
B.Vp=new A.e(B.c,["\u0905\u0928\u093e\u0926\u093f\u092e\u0927\u094d\u092f\u093e\u0928\u094d\u0924\u092e\u094d \u0905\u0928\u0928\u094d\u0924 \u0935\u0940\u0930\u094d\u092f\u092e\u094d\n\u0905\u0928\u0928\u094d\u0924 \u092c\u093e\u0939\u0941\u092e\u094d \u0936\u0936\u093f \u0938\u0942\u0930\u094d\u092f \u0928\u0947\u0924\u094d\u0930\u092e\u094d \u0964\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u092e\u094d \u0926\u0940\u092a\u094d\u0924 \u0939\u0941\u0924\u093e\u0936 \u0935\u0915\u094d\u0924\u094d\u0930\u092e\u094d\n\u0938\u094d\u0935\u0924\u0947\u091c\u0938\u093e \u0935\u093f\u0936\u094d\u0935\u092e\u094d \u0907\u0926\u092e\u094d \u0924\u092a\u0928\u094d\u0924\u092e\u094d \u0965 \u0967\u096f \u0965","Without a beginning, middle and an end, with limitless valor, with endless arms, with eyes of the sun and the moon, with a mouth that resembles a blazing fire, I see You, energizing this universe by Your authority."],t.w)
B.Wr=new A.e(B.c,["\u0926\u094d\u092f\u093e\u0935\u093e \u092a\u0943\u0925\u093f\u0935\u094d\u092f\u094b\u0903 \u0907\u0926\u092e\u094d \u0905\u0928\u094d\u0924\u0930\u092e\u094d \u0939\u093f\n\u0935\u094d\u092f\u093e\u092a\u094d\u0924\u092e\u094d \u0924\u094d\u0935\u092f\u0948\u0915\u0947\u0928 \u0926\u093f\u0936\u0936\u094d\u091a \u0938\u0930\u094d\u0935\u093e\u0903 \u0964 \n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e\u0926\u094d\u092d\u0941\u0924\u092e\u094d \u0930\u0942\u092a\u092e\u094d \u0909\u0917\u094d\u0930\u092e\u094d \u0924\u0935\u0947\u0926\u092e\u094d\n\u0932\u094b\u0915\u0924\u094d\u0930\u092f\u092e\u094d \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u092e\u094d \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d \u0965 \u0968\u0966 \u0965","Mighty Lord, the space that spans the earth and heavenly bodies is indeed pervaded by You along with all the directions. Three types of people are greatly disturbed by looking at Your astounding and formidable form in this way."],t.w)
B.TK=new A.e(B.c,["\u0905\u092e\u0940 \u0939\u093f \u0924\u094d\u0935\u093e \u0938\u0941\u0930\u0938\u0919\u094d\u0918\u093e \u0935\u093f\u0936\u0928\u094d\u0924\u093f\n\u0915\u0947\u091a\u093f\u0924\u094d \u092d\u0940\u0924\u093e\u0903 \u092a\u094d\u0930\u093e\u0928\u094d\u091c\u0932\u092f\u094b \u0917\u0943\u0923\u0928\u094d\u0924\u093f \u0964\n\u0938\u094d\u0935\u0938\u094d\u0924\u0940\u0924\u094d\u092f\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u092e\u0939\u0930\u094d\u0937\u093f \u0938\u093f\u0926\u094d\u0927 \u0938\u0919\u094d\u0918\u093e\u0903\n\u0938\u094d\u0924\u0941\u0935\u0928\u094d\u0924\u093f \u0924\u094d\u0935\u093e\u092e\u094d \u0938\u094d\u0924\u0941\u0924\u093f\u092d\u093f\u0903 \u092a\u0941\u0937\u094d\u0915\u0932\u093e\u092d\u093f\u0903 \u0965 \u0968\u0967 \u0965","These virtuous devotees inevitably enter You. Some of them are scared and pray with folded hands. The groups of great sages and achievers praise You with many praises, while articulating the auspiciousness of Your form."],t.w)
B.OY=new A.e(B.c,["\u0930\u0941\u0926\u094d\u0930\u093e\u0926\u093f\u0924\u094d\u092f\u093e \u0935\u0938\u0935\u094b \u092f\u0947 \u091a \u0938\u093e\u0927\u094d\u092f\u093e\u0903\n\u0935\u093f\u0936\u094d\u0935\u0947\u093d\u0936\u094d\u0935\u093f\u0928\u094c \u092e\u0930\u0941\u0924\u0936\u094d\u091a \u090a\u0937\u094d\u092e\u092a\u093e\u0936\u094d\u091a \u0964\n\u0917\u0928\u094d\u0927\u0930\u094d\u0935 \u092f\u0915\u094d\u0937 \u0905\u0938\u0941\u0930 \u0938\u093f\u0926\u094d\u0927 \u0938\u0919\u094d\u0918\u093e\u0903 \n\u0935\u0940\u0915\u094d\u0937\u0928\u094d\u0924\u0947 \u0924\u094d\u0935\u093e\u092e\u094d \u0935\u093f\u0938\u094d\u092e\u093f\u0924\u093e\u0903 \u091a\u0948\u0935 \u0938\u0930\u094d\u0935\u0947 \u0965 \u0968\u0968 \u0965","The manifestations of Shiva, the powers of nature, the forces of the universe, the gods and physicians, the winds, our ancestors, beautiful people, benign beings, thugs, achievers - all these communities look at You, bewildered."],t.w)
B.VQ=new A.e(B.c,["\u0930\u0942\u092a\u092e\u094d \u092e\u0939\u0924\u094d\u0924\u0947 \u092c\u0939\u0941 \u0935\u0915\u094d\u0924\u094d\u0930 \u0928\u0947\u0924\u094d\u0930\u092e\u094d\n\u092e\u0939\u093e\u092c\u093e\u0939\u094b \u092c\u0939\u0941\u092c\u093e\u0939\u0942\u0930\u0941 \u092a\u093e\u0926\u092e\u094d \u0964\n\u092c\u0939\u0942\u0926\u0930\u092e\u094d \u092c\u0939\u0941 \u0926\u092e\u094d\u0937\u094d\u091f\u094d\u0930\u093e \u0915\u0930\u093e\u0932\u092e\u094d\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0932\u094b\u0915\u093e\u0903 \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u093e\u0903 \u0924\u0925\u094b\u0939\u092e\u094d \u0965 \u0968\u0969 \u0965","Lord with powerful arms, seeing this huge form of Yours, with many faces and eyes, many arms, thighs and feet, with many torsos, many canine teeth, people are scared. so am I."],t.w)
B.Nl=new A.e(B.c,["\u0928\u092d\u0903 \u0938\u094d\u092a\u0943\u0936\u092e\u094d \u0926\u0940\u092a\u094d\u0924\u092e\u094d \u0905\u0928\u0947\u0915 \u0935\u0930\u094d\u0923\u092e\u094d\n\u0935\u094d\u092f\u093e\u0924\u094d\u0924\u093e\u0928\u0928\u092e\u094d \u0926\u0940\u092a\u094d\u0924 \u0935\u093f\u0936\u093e\u0932 \u0928\u0947\u0924\u094d\u0930\u092e\u094d \u0964\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0939\u093f \u0924\u094d\u0935\u093e\u092e\u094d \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u093e\u0928\u094d\u0924\u0930\u093e\u0924\u094d\u092e\u093e\n\u0927\u0943\u0924\u093f\u092e\u094d \u0928 \u0935\u093f\u0928\u094d\u0926\u093e\u092e\u093f \u0936\u092e\u092e\u094d \u091a \u0935\u093f\u0937\u094d\u0923\u094b \u0965 \u0968\u096a \u0965","Lord Vishnu, you pervade everything. I lost the ability to sustain myself and lost my tranquility on seeing You. You touched the sky with many brilliant colors, with open mouths, with huge sparkling eyes. Indeed, my very being is shaken."],t.w)
B.QO=new A.e(B.c,["\u0926\u092e\u094d\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u093e\u0928\u093f \u091a \u0924\u0947 \u092e\u0941\u0916\u093e\u0928\u093f\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u0948\u0935 \u0915\u093e\u0932\u093e\u0928\u0932\u0938\u0928\u094d\u0928\u093f\u092d\u093e\u0928\u093f \u0964\n\u0926\u093f\u0936\u094b \u0928 \u091c\u093e\u0928\u0947 \u0928 \u0932\u092d\u0947 \u091a \u0936\u0930\u094d\u092e\n\u092a\u094d\u0930\u0938\u0940\u0926 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938 \u0965 \u0968\u096b \u0965","Your faces seem cruel with their terrible canines. They are equivalent to the great fire that brings ultimate destruction. Just by seeing, I cannot recognize any of the directions and I have lost my comfort. O Lord of the gods in whom all the worlds reside, be pleased."],t.w)
B.OW=new A.e(B.c,["\u0905\u092e\u0940 \u0938\u0930\u094d\u0935\u0947 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0938\u094d\u092f \u092a\u0941\u0924\u094d\u0930\u093e\u0903\n\u0938\u0930\u094d\u0935\u0948\u0903 \u0938\u0939\u0948\u0935 \u0905\u0935\u0928\u093f\u092a\u093e\u0932 \u0938\u0919\u094d\u0918\u0948\u0903 \u0964\n\u092d\u0940\u0937\u094d\u092e\u094b \u0926\u094d\u0930\u094b\u0923\u0903 \u0938\u0942\u0924\u092a\u0941\u0924\u094d\u0930\u0903 \u0924\u0925\u093e\u0938\u094c\n\u0938\u0939\u093e\u0938\u094d\u092e\u0926\u0940\u092f\u0948\u0930\u092a\u093f \u092f\u094b\u0927\u092e\u0941\u0916\u094d\u092f\u0948\u0903 \u0965 \u0968\u096c \u0965\n\u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0924\u0947 \u0924\u094d\u0935\u0930\u092e\u093e\u0923\u093e \u0935\u093f\u0936\u0928\u094d\u0924\u093f\n\u0926\u092e\u094d\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u093e\u0928\u093f \u092d\u092f\u093e\u0928\u0915\u093e\u0928\u093f \u0964\n\u0915\u0947\u091a\u093f\u0924\u094d \u0935\u093f\u0932\u0917\u094d\u0928\u093e \u0926\u0936\u0928\u093e\u0928\u094d\u0924\u0930\u0947\u0937\u0941\n\u0938\u0928\u094d\u0926\u0943\u0936\u094d\u092f\u0928\u094d\u0924\u0947 \u091a\u0942\u0930\u094d\u0923\u093f\u0924\u0948\u0903 \u0909\u0924\u094d\u0924\u092e\u093e\u0919\u094d\u0917\u0948\u0903 \u0965 \u0968\u096d \u0965","All these sons of Dhrtarashtra rapidly enter Your many mouths having terrifying canines. So do all groups of kings followed by Bhishma, Drona, Karna and our own captains of war. Some of them appear to have their heads powdered by getting stuck between those teeth."],t.w)
B.VP=new A.e(B.c,["\u092f\u0925\u093e \u0928\u0926\u0940\u0928\u093e\u092e\u094d \u092c\u0939\u0935\u094b\u093d\u092e\u094d\u092c\u0941\u0935\u0947\u0917\u093e\u0903\n\u0938\u092e\u0941\u0926\u094d\u0930\u092e\u094d \u090f\u0935\u093e\u092d\u093f\u092e\u0941\u0916\u092e\u094d \u0926\u094d\u0930\u0935\u0928\u094d\u0924\u093f \u0964\n\u0924\u0925\u093e \u0924\u0935\u093e\u092e\u0940 \u0928\u0930 \u0932\u094b\u0915 \u0935\u0940\u0930\u093e\u0903\n\u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0905\u092d\u093f\u0935\u093f\u091c\u094d\u0935\u0932\u0928\u094d\u0924\u093f \u0965 \u0968\u096e \u0965\n\u092f\u0925\u093e \u092a\u094d\u0930\u0926\u0940\u092a\u094d\u0924\u092e\u094d \u091c\u094d\u0935\u0932\u0928\u092e\u094d \u092a\u0924\u0919\u094d\u0917\u093e\u0903\n\u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0928\u093e\u0936\u093e\u092f \u0938\u092e\u0943\u0926\u094d\u0927 \u0935\u0947\u0917\u093e\u0903 \u0964\n\u0924\u0925\u0948\u0935 \u0928\u093e\u0936\u093e\u092f \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0932\u094b\u0915\u0903\n\u0924\u0935\u093e\u092a\u093f \u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0938\u092e\u0943\u0926\u094d\u0927 \u0935\u0947\u0917\u093e\u0903 \u0965 \u0968\u096f \u0965","Just as the many flows of the river run down into the oceans, so also these heroes of the earth enter Your blistering mouth. Just as flies attracted to a flame enter the brilliant fire with great speed to be destroyed, these people enter Your many mouths with great speed in the same way too, to be destroyed."],t.w)
B.Tm=new A.e(B.c,["\u0932\u0947\u0932\u093f\u0939\u094d\u092f\u0938\u0947 \u0917\u094d\u0930\u0938\u092e\u093e\u0928\u0903 \u0938\u092e\u0928\u094d\u0924\u093e\u0924\u094d\n\u0932\u094b\u0915\u093e\u0928\u094d \u0938\u092e\u0917\u094d\u0930\u093e\u0928\u094d \u0935\u0926\u0928\u0948\u0903 \u091c\u094d\u0935\u0932\u0926\u094d\u092d\u093f\u0903 \u0964\n\u0924\u0947\u091c\u094b\u092d\u093f\u0903 \u0906\u092a\u0942\u0930\u094d\u092f \u091c\u0917\u0924\u094d \u0938\u092e\u0917\u094d\u0930\u092e\u094d\n\u092d\u093e\u0938\u0903 \u0924\u0935\u094b\u0917\u094d\u0930\u093e\u0903 \u092a\u094d\u0930\u0924\u092a\u0928\u094d\u0924\u093f \u0935\u093f\u0937\u094d\u0923\u094b \u0965 \u0969\u0966 \u0965","Vishnu, You are licking Your lips, swallowing all these people entirely with your flaming mouth. Your terrific brilliance fills the whole universe with various energies and they burn."],t.w)
B.Ts=new A.e(B.c,["\u0906\u0916\u094d\u092f\u093e\u0939\u093f \u092e\u0947 \u0915\u094b \u092d\u0935\u093e\u0928\u094d \u0909\u0917\u094d\u0930 \u0930\u0941\u092a\u094b\n\u0928\u092e\u094b\u093d\u0938\u094d\u0924\u0941 \u0924\u0947 \u0926\u0947\u0935\u0935\u0930 \u092a\u094d\u0930\u0938\u0940\u0926 \u0964\n\u0935\u093f\u091c\u094d\u091e\u093e\u0924\u0941\u092e\u094d \u0907\u091a\u094d\u091b\u093e\u092e\u093f \u092d\u0935\u0928\u094d\u0924\u092e\u094d \u0906\u0926\u094d\u092f\u092e\u094d\n\u0928 \u0939\u093f \u092a\u094d\u0930\u091c\u093e\u0928\u093e\u092e\u093f \u0924\u0935 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u0965 \u0969\u0967 \u0965","Tell me who You are in this terrible form. Lord, You are supreme among the favorable. Salutations to You. Be pleased. I have no idea about your course of action. I wish to know You, prevailing as You are from beginning-less time."],t.w)
B.WD=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0915\u093e\u0932\u094b\u093d\u0938\u094d\u092e\u093f \u0932\u094b\u0915 \u0915\u094d\u0937\u092f\u0915\u0943\u0924\u094d \u092a\u094d\u0930\u0935\u0943\u0926\u094d\u0927\u094b\n\u0932\u094b\u0915\u093e\u0928\u094d \u0938\u092e\u093e\u0939\u0930\u094d\u0924\u0941\u092e\u094d \u0907\u0939 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u0903 \u0964\n\u090b\u0924\u0947\u092a\u093f \u0924\u094d\u0935\u093e \u0928 \u092d\u0935\u093f\u0937\u094d\u092f\u0928\u094d\u0924\u093f \u0938\u0930\u094d\u0935\u0947\n\u092f\u0947\u093d\u0935\u0938\u094d\u0925\u093f\u0924\u093e\u0903 \u092a\u094d\u0930\u0924\u094d\u092f\u0928\u0940\u0915\u0947\u0937\u0941 \u092f\u094b\u0927\u093e\u0903 \u0965 \u0969\u0968 \u0965","Lord Krishna said - I am the count-down to destruction. I transformed into this terrible form. This form of Mine causes the wear-out and destruction of the universe. I have set to work the destruction of the warriors here. Even without your involvement, all warriors who stand among the unfavorable shall not continue to exist."],t.w)
B.QT=new A.e(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0924\u094d\u0935\u092e\u094d \u0909\u0924\u094d\u0924\u093f\u0937\u094d\u0920 \u092f\u0936\u094b \u0932\u092d\u0938\u094d\u0935\n\u091c\u093f\u0924\u094d\u0935\u093e \u0936\u0924\u094d\u0930\u0942\u0928\u094d \u092d\u0941\u0919\u094d\u0915\u094d\u0937\u094d\u0935 \u0930\u093e\u091c\u094d\u092f\u092e\u094d \u0938\u092e\u0943\u0926\u094d\u0927\u092e\u094d \u0964\n\u092e\u092f\u0948\u0935 \u090f\u0924\u0947 \u0928\u093f\u0939\u0924\u093e\u0903 \u092a\u0942\u0930\u094d\u0935\u092e\u0947\u0935\n\u0928\u093f\u092e\u093f\u0924\u094d\u0924 \u092e\u093e\u0924\u094d\u0930\u092e\u094d \u092d\u0935 \u0938\u0935\u094d\u092f\u0938\u093e\u091a\u093f\u0928\u094d \u0965 \u0969\u0969 \u0965","Given this fact, you must get up. Gain fame and honor by winning over your foes. Enjoy this prosperous kingdom. All obstacles are destroyed by Me alone. Arjuna, merely be the instrument."],t.w)
B.RA=new A.e(B.c,["\u0926\u094d\u0930\u094b\u0923\u092e\u094d \u091a \u092d\u0940\u0937\u094d\u092e\u092e\u094d \u091a \u091c\u092f\u0926\u094d\u0930\u0925\u092e\u094d \u091a\n\u0915\u0930\u094d\u0923\u092e\u094d \u0924\u0925\u093e\u093d\u0928\u094d\u092f\u093e\u0928\u094d \u0905\u092a\u093f \u092f\u094b\u0927 \u0935\u0940\u0930\u093e\u0928\u094d \u0964\n\u092e\u092f\u093e \u0939\u0924\u093e\u0928\u094d \u0924\u094d\u0935\u092e\u094d \u091c\u0939\u093f \u092e\u093e \u0935\u094d\u092f\u0925\u093f\u0937\u094d\u0920\u093e\u0903\n\u092f\u0941\u0927\u094d\u092f\u0938\u094d\u0935 \u091c\u0947\u0924\u093e\u0938\u093f \u0930\u0923\u0947 \u0938\u092a\u0924\u094d\u0928\u093e\u0928\u094d \u0965 \u0969\u096a \u0965","You win your battles over Drona, Bhishma, Jayadratha, Karna and other valiant heroes as well. All of them have already been killed by Me. Do not waver. Fight, you will win over your enemies in war."],t.w)
B.RP=new A.e(B.c,["\u0938\u0928\u094d\u091c\u092f \u0909\u0935\u093e\u091a -\n\u090f\u0924\u0924\u094d \u0936\u094d\u0930\u0941\u0924\u094d\u0935\u093e \u0935\u091a\u0928\u092e\u094d \u0915\u0947\u0936\u0935\u0938\u094d\u092f\n\u0915\u0943\u0924\u093e\u0928\u094d\u091c\u0932\u093f\u0903 \u0935\u0947\u092a\u092e\u093e\u0928\u0903 \u0915\u093f\u0930\u0940\u091f\u0940 \u0964\n\u0928\u092e\u0938\u094d\u0915\u0943\u0924\u094d\u0935\u093e \u092d\u0942\u092f \u090f\u0935\u093e\u0939 \u0915\u0943\u0937\u094d\u0923\u092e\u094d\n\u0938\u0917\u0926\u094d\u0917\u0926\u092e\u094d \u092d\u0940\u0924 \u092d\u0940\u0924\u0903 \u092a\u094d\u0930\u0923\u092e\u094d\u092f \u0965 \u0969\u096b \u0965","Sanjaya said - Listening to these words of the Lord, Arjuna performed salutations while trembling with folded hands and once again spoke to Krishna with great fear, with a voice choked with emotion, with a bowed head."],t.w)
B.Q0=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0938\u094d\u0925\u093e\u0928\u0947 \u0939\u0943\u0937\u0940\u0915\u0947\u0936 \u0924\u0935 \u092a\u094d\u0930\u0915\u0940\u0930\u094d\u0924\u094d\u092f\u093e\n\u091c\u0917\u0924\u094d \u092a\u094d\u0930\u0939\u0943\u0937\u094d\u092f\u0924\u093f \u0905\u0928\u0941\u0930\u091c\u094d\u092f\u0924\u0947 \u091a \u0964\n\u0930\u0915\u094d\u0937\u093e\u092e\u094d\u0938\u093f \u092d\u0940\u0924\u093e\u0928\u093f \u0926\u093f\u0936\u094b \u0926\u094d\u0930\u0935\u0928\u094d\u0924\u093f\n\u0938\u0930\u094d\u0935\u0947 \u0928\u092e\u0938\u094d\u092f\u0928\u094d\u0924\u093f \u091a \u0938\u093f\u0926\u094d\u0927 \u0938\u0919\u094d\u0918\u093e\u0903 \u0965 \u0969\u096c \u0965","Arjuna said- Krishna, it\u2019s appropriate that the world experiences joy, devotion and affection through Your praise. Those who exploit for personal gain scatter and run in fear. All types of virtuous people bow to You."],t.w)
B.R_=new A.e(B.c,["\u0915\u0938\u094d\u092e\u093e\u0924\u094d \u091a \u0924\u0947 \u0928 \u0928\u092e\u0947\u0930\u0928\u094d \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d\n\u0917\u0930\u0940\u092f\u0938\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b\u093d\u092a\u094d\u092f\u093e\u0926\u093f\u0915\u0930\u094d\u0924\u094d\u0930\u0947 \u0964","Lord, why would anyone not bow to You? You are the origin of Brahma himself, the principal engineer of this universe, towering over everything else."],t.w)
B.NG=new A.e(B.c,["\u0905\u0928\u0928\u094d\u0924 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938\n\u0924\u094d\u0935\u092e\u094d \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u0938\u0926\u0938\u0924\u094d \u0924\u0924\u094d\u092a\u0930\u092e\u094d \u092f\u0924\u094d \u0965 \u0969\u096d \u0965\n\u0924\u094d\u0935\u092e\u094d \u0906\u0926\u093f\u0926\u0947\u0935\u0903 \u092a\u0941\u0930\u0941\u0937\u0903 \u092a\u0941\u0930\u093e\u0923\u0903\n\u0924\u094d\u0935\u092e\u094d \u0905\u0938\u094d\u092f \u0935\u093f\u0936\u094d\u0935\u0938\u094d\u092f \u092a\u0930\u092e\u094d \u0928\u093f\u0927\u093e\u0928\u092e\u094d","O Lord of gods , You are outside the limits of space, time and material. You are the abode in which the universe resides. You are the imperishable. You are existence, non-existence and that which is beyond all of this. You are the origin of all powers . You are the one who is known as the Supreme Being. You are without a beginning. You are the ultimate basis of this universe."],t.w)
B.Sj=new A.e(B.c,["\u0935\u0947\u0924\u094d\u0924\u093e\u0938\u093f \u0935\u0947\u0926\u094d\u092f\u092e\u094d \u091a \u092a\u0930\u092e\u094d \u091a \u0927\u093e\u092e\n\u0924\u094d\u0935\u092f\u093e \u0924\u0924\u092e\u094d \u0935\u093f\u0936\u094d\u0935\u092e\u094d \u0905\u0928\u0928\u094d\u0924 \u0930\u0942\u092a \u0965 \u0969\u096e \u0965","You are the One who knows and the One who is to be known. You are the ultimate abode too. You are the One with an unending form. The universe is pervaded by You."],t.w)
B.NU=new A.e(B.c,["\u0935\u093e\u092f\u0941\u0930\u094d\u092f\u092e\u094b\u093d\u0917\u094d\u0928\u093f\u0903 \u0935\u0930\u0941\u0923\u0903 \u0936\u0936\u093e\u0919\u094d\u0915\u0903\n\u092a\u094d\u0930\u091c\u093e\u092a\u0924\u093f\u0903 \u0924\u094d\u0935\u092e\u094d \u092a\u094d\u0930\u092a\u093f\u0924\u093e\u092e\u0939\u0903 \u091a \u0964","You are the wind, restraint, fire, the atmosphere, the ocean, the moon, the leader of people, and their great-grandfather - their origin."],t.w)
B.OQ=new A.e(B.c,["\u0928\u092e\u094b \u0928\u092e\u0938\u094d\u0924\u0947\u093d\u0938\u094d\u0924\u0941 \u0938\u0939\u0938\u094d\u0930\u0915\u0943\u0924\u094d\u0935\u0903\n\u092a\u0941\u0928\u0903 \u091a \u092d\u0942\u092f\u094b\u093d\u092a\u093f \u0928\u092e\u094b \u0928\u092e\u0938\u094d\u0924\u0947 \u0965 \u0969\u096f \u0965\n\u0928\u092e\u0903 \u092a\u0941\u0930\u0938\u094d\u0924\u093e\u0924\u094d \u0905\u0925 \u092a\u0943\u0937\u094d\u0920\u0924\u0903 \u091a\n\u0928\u092e\u094b\u093d\u0938\u094d\u0924\u0941 \u0924\u0947 \u0938\u0930\u094d\u0935\u0924 \u090f\u0935 \u0938\u0930\u094d\u0935 \u0964","Salutations, I bow to You a thousand times. Salutations yet again, I submit to You with reverence and adoration again and again. Salutations facing You and following You. You are everything. salutations to You in every single way."],t.w)
B.Pg=new A.e(B.c,["\u0905\u0928\u0928\u094d\u0924 \u0935\u0940\u0930\u094d\u092f\u093e\u092e\u093f\u0924 \u0935\u093f\u0915\u094d\u0930\u092e\u0938\u094d\u0924\u094d\u0935\u092e\u094d\n\u0938\u0930\u094d\u0935\u092e\u094d \u0938\u092e\u093e\u092a\u094d\u0928\u094b\u0937\u093f \u0924\u0924\u094b\u093d\u0938\u093f \u0938\u0930\u094d\u0935\u0903 \u0965 \u096a\u0966 \u0965","You have unlimited valor and infinite might. You pervade as the Self in everything, hence You are everything."],t.w)
B.PM=new A.e(B.c,["\u0938\u0916\u0947\u0924\u093f \u092e\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u0938\u092d\u092e\u094d \u092f\u0926\u0941\u0915\u094d\u0924\u092e\u094d\n\u0939\u0947 \u0915\u0943\u0937\u094d\u0923 \u0939\u0947 \u092f\u093e\u0926\u0935 \u0939\u0947 \u0938\u0916\u0947\u0924\u093f \u0964\n\u0905\u091c\u093e\u0928\u0924\u093e \u092e\u0939\u093f\u092e\u093e\u0928\u092e\u094d \u0924\u0935\u0947\u092e\u092e\u094d\n\u092e\u092f\u093e \u092a\u094d\u0930\u092e\u093e\u0926\u093e\u0924\u094d \u092a\u094d\u0930\u0923\u092f\u0947\u0928 \u0935\u093e\u092a\u093f \u0965 \u096a\u0967 \u0965\n\u092f\u0924\u094d \u091a \u0905\u092a\u0939\u093e\u0938\u093e\u0930\u094d\u0925\u092e\u094d \u0905\u0938\u0924\u094d \u0915\u0943\u0924\u094b\u093d\u0938\u093f\n\u0935\u093f\u0939\u093e\u0930 \u0936\u092f\u094d\u092f\u093e\u0938\u0928 \u092d\u094b\u091c\u0928\u0947\u0937\u0941 \u0964\n\u090f\u0915\u094b\u093d\u0925\u0935\u093e\u093d\u092a\u093f \u0905\u091a\u094d\u092f\u0941\u0924 \u0924\u0924\u094d\u0938\u092e\u0915\u094d\u0937\u092e\u094d\n\u0924\u0924\u094d \u0915\u094d\u0937\u093e\u092e\u092f\u0947 \u0924\u094d\u0935\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0905\u092a\u094d\u0930\u092e\u0947\u092f\u092e\u094d \u0965 \u096a\u0968 \u0965","Lord, without knowing this greatness of Yours, I considered You as a friend and said many things, exceeding my limits in a careless manner. At other times, out of friendship, I addressed You as 'Hey Krishna', 'Hey Yadava' or 'Hey friend'. There were also instances when I disrespected You for fun while roaming, resting and while sleeping, while we were alone or in the company of others - I ask You to forgive all of these too. O the ever-permanent One, You are not measurable in any way."],t.w)
B.VL=new A.e(B.c,["\u092a\u093f\u0924\u093e\u0938\u093f \u0932\u094b\u0915\u0938\u094d\u092f \u091a\u0930\u093e\u091a\u0930\u0938\u094d\u092f\n\u0924\u094d\u0935\u092e\u094d \u0905\u0938\u094d\u092f \u092a\u0942\u091c\u094d\u092f\u0903 \u091a \u0917\u0941\u0930\u0941\u0903 \u0917\u0930\u0940\u092f\u093e\u0928\u094d \u0964\n\u0928 \u0924\u094d\u0935\u0924\u094d\u0938\u092e\u094b\u093d\u0938\u094d\u0924\u093f \u0905\u092d\u094d\u092f\u0927\u093f\u0915\u0903 \u0915\u0941\u0924\u094b\u093d\u0928\u094d\u092f\u094b\n\u0932\u094b\u0915\u0924\u094d\u0930\u092f\u0947 \u0905\u092a\u093f \u0905\u092a\u094d\u0930\u0924\u093f\u092e \u092a\u094d\u0930\u092d\u093e\u0935 \u0965 \u096a\u0969 \u0965","You are the father of this world with all its moving and stationary beings, You are superior to all. As a teacher, You are revered by all. You have unmatched power, There is no other person who is equal to You in all the three worlds (the entire universe). How can it even be conceived that anyone is greater than You?"],t.w)
B.RM=new A.e(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u092a\u094d\u0930\u0923\u092e\u094d\u092f \u092a\u094d\u0930\u0923\u093f\u0927\u093e\u092f \u0915\u093e\u092f\u092e\u094d\n\u092a\u094d\u0930\u0938\u093e\u0926\u092f\u0947 \u0924\u094d\u0935\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0908\u0936\u092e\u094d \u0908\u0921\u094d\u092f\u092e\u094d \u0964\n\u092a\u093f\u0924\u0947\u0935 \u092a\u0941\u0924\u094d\u0930\u0938\u094d\u092f \u0938\u0916\u0947\u0935 \u0938\u0916\u094d\u092f\u0941\u0903\n\u092a\u094d\u0930\u093f\u092f\u0903 \u092a\u094d\u0930\u093f\u092f\u093e\u092f\u093e\u0930\u094d\u0939\u0938\u093f \u0926\u0947\u0935 \u0938\u094b\u0922\u0941\u092e\u094d \u0965 \u096a\u096a \u0965","That's why I please You with worship, by bowing to You and laying my body at Your feet. You are the ultimate controller, You are to be praised. Lord, Just as a father tolerates his son's flaws, just as a friend tolerates a friend's flaws, You are affectionate and can definitely tolerate the same, in Your love for me."],t.w)
B.Tt=new A.e(B.c,["\u0905\u0926\u0943\u0937\u094d\u091f\u092a\u0942\u0930\u094d\u0935\u092e\u094d \u0939\u0943\u0937\u093f\u0924\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e\n\u092d\u092f\u0947\u0928 \u091a \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u092e\u094d \u092e\u0928\u094b \u092e\u0947 \u0964\n\u0924\u0926\u0947\u0935 \u092e\u0947 \u0926\u0930\u094d\u0936\u092f \u0926\u0947\u0935 \u0930\u0942\u092a\u092e\u094d\n\u092a\u094d\u0930\u0938\u0940\u0926 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938 \u0965 \u096a\u096b \u0965","Seeing what has not been seen before, I am thrilled. Also, My mind is greatly disturbed with fear. You are the abode of the whole universe. Lord, return to tranquility and show me that form."],t.w)
B.QE=new A.e(B.c,["\u0915\u093f\u0930\u0940\u091f\u093f\u0928\u092e\u094d \u0917\u0926\u093f\u0928\u092e\u094d \u091a\u0915\u094d\u0930 \u0939\u0938\u094d\u0924\u092e\u094d\n\u0907\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u092e\u094d \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0905\u0939\u092e\u094d \u0924\u0925\u0948\u0935 \u0964\n\u0924\u0947\u0928\u0948\u0935 \u0930\u0942\u092a\u0947\u0923 \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0947\u0928\n\u0938\u0939\u0938\u094d\u0930 \u092c\u093e\u0939\u094b \u092d\u0935 \u0935\u093f\u0936\u094d\u0935 \u092e\u0942\u0930\u094d\u0924\u0947 \u0965 \u096a\u096c \u0965","I desire to see You in the same way - with a crown, a mace, with the disc in Your hand, O One with a thousand arms. O Lord who has the universe as the body , be with that form, which has four arms"],t.w)
B.Oc=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092e\u092f\u093e \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0947\u0928 \u0924\u0935\u093e\u0930\u094d\u091c\u0941\u0928\u0947\u0926\u092e\u094d\n\u0930\u0942\u092a\u092e\u094d \u092a\u0930\u092e\u094d \u0926\u0930\u094d\u0936\u093f\u0924\u092e\u094d \u0906\u0924\u094d\u092e\u092f\u094b\u0917\u093e\u0924\u094d \u0964\n\u0924\u0947\u091c\u094b\u092e\u092f\u092e\u094d \u0935\u093f\u0936\u094d\u0935\u092e\u094d \u0905\u0928\u0928\u094d\u0924\u092e\u094d \u0906\u0926\u094d\u092f\u092e\u094d\n\u092f\u0924\u094d \u092e\u0947 \u0924\u094d\u0935\u0926\u0928\u094d\u092f\u0947\u0928 \u0928 \u0926\u0943\u0937\u094d\u091f \u092a\u0942\u0930\u094d\u0935\u092e\u094d \u0965 \u096a\u096d \u0965","The Lord said - Arjuna, this ultimate form was shown to you by Me, out of happiness. It is filled with brilliance and has the universe inside it. It is without any limits. It is the origin of everything. You saw it by the realization of My intent. This form of Mine has not been seen by anyone other than you."],t.w)
B.SO=new A.e(B.c,["\u0928 \u0935\u0947\u0926 \u092f\u091c\u094d\u091e \u0905\u0927\u094d\u092f\u092f\u0928\u0948\u0903 \u0928 \u0926\u093e\u0928\u0948\u0903\n\u0928 \u0915\u094d\u0930\u093f\u092f\u093e\u092d\u093f\u0903 \u0928 \u0924\u092a\u094b\u092d\u093f\u0903 \u0909\u0917\u094d\u0930\u0948\u0903 \u0964\n\u090f\u0935\u092e\u094d \u0930\u0942\u092a\u0903 \u0936\u0915\u094d\u092f \u0905\u0939\u092e\u094d \u0928\u0943\u0932\u094b\u0915\u0947\n\u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0924\u094d\u0935\u0926\u0928\u094d\u092f\u0947\u0928 \u0915\u0941\u0930\u0941\u092a\u094d\u0930\u0935\u0940\u0930 \u0965 \u096a\u096e \u0965","Not by the study of the Vedas, nor by performing rituals, nor by intense study, not by donations, not by pious actions, not by severe penance, can this form be seen by anyone other than you in this world of humans, O valiant Arjuna."],t.w)
B.Ri=new A.e(B.c,["\u092e\u093e \u0924\u0947 \u0935\u094d\u092f\u0925\u093e \u092e\u093e \u091a \u0935\u093f\u092e\u0942\u0922 \u092d\u093e\u0935\u094b\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0930\u0942\u092a\u092e\u094d \u0918\u094b\u0930\u092e\u094d \u0908\u0926\u0943\u0915\u094d \u092e\u092e\u0947\u0926\u092e\u094d \u0964\n\u0935\u094d\u092f\u092a\u0947\u0924\u092d\u0940\u0903 \u092a\u094d\u0930\u0940\u0924\u092e\u0928\u093e\u0903 \u092a\u0941\u0928\u0938\u094d\u0924\u094d\u0935\u092e\u094d\n\u0924\u0926\u0947\u0935 \u092e\u0947 \u0930\u0942\u092a\u092e\u094d \u0907\u0926\u092e\u094d \u092a\u094d\u0930\u092a\u0936\u094d\u092f \u0965 \u096a\u096f \u0965","May you not be agitated and confused in this manner, seeing this formidable form of Mine. See My previous form again. Be without fear, with a cheerful mind."],t.w)
B.Tv=new A.e(B.c,["\u0938\u0928\u094d\u091c\u092f \u0909\u0935\u093e\u091a -\n\u0907\u0924\u094d\u092f\u0930\u094d\u091c\u0941\u0928\u092e\u094d \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0903 \u0924\u0925\u094b\u0915\u094d\u0924\u094d\u0935\u093e\n\u0938\u094d\u0935\u0915\u092e\u094d \u0930\u0942\u092a\u092e\u094d \u0926\u0930\u094d\u0936\u092f\u093e\u092e\u093e\u0938 \u092d\u0942\u092f\u0903\u0964\n\u0906\u0936\u094d\u0935\u093e\u0938\u092f\u093e\u092e\u093e\u0938 \u091a \u092d\u0940\u0924\u092e\u094d \u090f\u0928\u092e\u094d\n\u092d\u0942\u0924\u094d\u0935\u093e \u092a\u0941\u0928\u0903 \u0938\u094c\u092e\u094d\u092f \u0935\u092a\u0941\u0903 \u092e\u0939\u093e\u0924\u094d\u092e\u093e \u0965 \u096b\u0966 \u0965","Sanjaya said - Then, having said this to Arjuna, the great Krishna showed His form again. He then reassures this frightened soul by being with a gentle body."],t.w)
B.Uf=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0907\u0926\u092e\u094d \u092e\u093e\u0928\u0941\u0937\u092e\u094d \u0930\u0942\u092a\u092e\u094d \u0924\u0935 \u0938\u094c\u092e\u094d\u092f\u092e\u094d \u091c\u0928\u093e\u0930\u094d\u0926\u0928 \u0964\n\u0907\u0926\u093e\u0928\u0940\u092e\u094d \u0905\u0938\u094d\u092e\u093f \u0938\u0902\u0935\u0943\u0924\u094d\u0924\u0903 \u0938\u091a\u0947\u0924\u093e\u0903 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u094d \u0917\u0924\u0903 \u0965 \u096b\u0967 \u0965","Arjuna said - Lord, looking at this human form of Yours, which is gentle, I am now in my senses. I am alive, back in this environment."],t.w)
B.OV=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0938\u0941 \u0926\u0941\u0930\u094d\u0926\u0930\u094d\u0936\u092e\u094d \u0907\u0926\u092e\u094d \u0930\u0942\u092a\u092e\u094d \u0926\u0943\u0937\u094d\u091f\u0935\u093e\u0928\u094d \u0905\u0938\u093f \u092f\u0924\u094d \u092e\u092e \u0964\n\u0926\u0947\u0935\u093e \u0905\u092a\u093f \u0905\u0938\u094d\u092f \u0930\u0942\u092a\u0938\u094d\u092f \u0928\u093f\u0924\u094d\u092f\u092e\u094d \u0926\u0930\u094d\u0936\u0928 \u0915\u093e\u0919\u094d\u0915\u094d\u0937\u093f\u0923\u0903 \u0965 \u096b\u0968 \u0965","Lord Krishna said - This form of mine, which you\u2019ve seen, is extremely difficult to see. Even the virtuous constantly crave for a glimpse of this form."],t.w)
B.PQ=new A.e(B.c,["\u0928\u093e\u0939\u092e\u094d \u0935\u0947\u0926\u0948\u0903 \u0928 \u0924\u092a\u0938\u093e \u0928 \u0926\u093e\u0928\u0947\u0928 \u0928 \u091a\u0947\u091c\u094d\u092f\u092f\u093e \u0964\n\u0936\u0915\u094d\u092f \u090f\u0935\u092e\u094d \u0935\u093f\u0927\u094b \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u0926\u0943\u0937\u094d\u091f\u0935\u093e\u0928\u094d \u0905\u0938\u093f \u092e\u093e\u092e\u094d \u092f\u0925\u093e \u0965 \u096b\u0969 \u0965\n\u092d\u0915\u094d\u0924\u094d\u092f\u093e \u0924\u0941 \u0905\u0928\u0928\u094d\u092f\u092f\u093e \u0936\u0915\u094d\u092f\u0903 \u0905\u0939\u092e\u094d \u090f\u0935\u092e\u094d \u0935\u093f\u0927\u094b\u0930\u094d\u091c\u0941\u0928 \u0964\n\u091c\u094d\u091e\u093e\u0924\u0941\u092e\u094d \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u094d \u091a \u0924\u0924\u094d\u0924\u094d\u0935\u0947\u0928 \u092a\u094d\u0930\u0935\u0947\u0937\u094d\u091f\u0941\u092e\u094d \u091a \u092a\u0930\u0928\u094d\u0924\u092a \u0965 \u096b\u096a \u0965","It is not possible to see Me in this way - the way in which you have seen Me - not by the scriptures, not by penance, not by charity and not by sacrifice. Only by single-minded devotion, Arjuna, I can be known as I am, to be seen and to be entered in this way. Destroy your rivals."],t.w)
B.PT=new A.e(B.c,["\u092e\u0924\u094d\u0915\u0930\u094d\u092e \u0915\u0943\u0924\u094d \u092e\u0924\u094d\u092a\u0930\u092e\u094b \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u0903 \u0938\u0919\u094d\u0917 \u0935\u0930\u094d\u091c\u093f\u0924\u0903 \u0964\n\u0928\u093f\u0930\u094d\u0935\u0948\u0930\u0903 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u0947\u0937\u0941 \u092f\u0903 \u0938 \u092e\u093e\u092e\u0947\u0924\u093f \u092a\u093e\u0928\u094d\u0921\u0935 \u0965 \u096b\u096b \u0965","Arjuna, the person who dedicates all his actions to Me, with Me as the ultimate goal is without attachment . He is My devotee. He doesn\u2019t hate any being. Such a person achieves Me."],t.w)
B.R3=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u090f\u0935\u092e\u094d \u0938\u0924\u0924\u092f\u0941\u0915\u094d\u0924\u093e \u092f\u0947 \u092d\u0915\u094d\u0924\u093e\u0903 \u0924\u094d\u0935\u093e\u092e\u094d \u092a\u0930\u094d\u092f\u0941\u092a\u093e\u0938\u0924\u0947 \u0964\n\u092f\u0947 \u091a\u093e\u092a\u093f \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u0905\u0935\u094d\u092f\u0915\u094d\u0924\u092e\u094d \u0924\u0947\u0937\u093e\u092e\u094d \u0915\u0947 \u092f\u094b\u0917\u0935\u093f\u0924\u094d\u0924\u092e\u093e\u0903 \u0965 \u0967 \u0965","Arjuna said- In this way, those who are devoted to You worship You well. On the other hand, there are also people who focus on the indestructible, which we know as our Self, which is not perceptible to our sense organs. Who among them is closer to realizing their goal?"],t.w)
B.Rp=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092e\u092f\u094d\u092f\u093e\u0935\u0947\u0936\u094d\u092f \u092e\u0928\u094b \u092f\u0947 \u092e\u093e\u092e\u094d \u0928\u093f\u0924\u094d\u092f\u092f\u0941\u0915\u094d\u0924\u093e \u0909\u092a\u093e\u0938\u0924\u0947 \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e \u092a\u0930\u092f\u093e \u0909\u092a\u0947\u0924\u093e\u0903 \u0924\u0947 \u092e\u0947 \u092f\u0941\u0915\u094d\u0924\u0924\u092e\u093e \u092e\u0924\u093e\u0903 \u0965 \u0968 \u0965","Lord Krishna said - People who worship Me by committing their mind in Me are always engaged. They are endowed with complete trust and dedication. I consider them to be closest to Me."],t.w)
B.O0=new A.e(B.c,["\u092f\u0947 \u0924\u0941 \u0905\u0915\u094d\u0937\u0930\u092e\u094d \u0905\u0928\u093f\u0930\u094d\u0926\u0947\u0936\u094d\u092f\u092e\u094d \u0905\u0935\u094d\u092f\u0915\u094d\u0924\u092e\u094d \u092a\u0930\u094d\u092f\u0941\u092a\u093e\u0938\u0924\u0947 \u0964\n\u0938\u0930\u094d\u0935\u0924\u094d\u0930\u0917\u092e\u094d \u0905\u091a\u093f\u0928\u094d\u0924\u094d\u092f\u092e\u094d \u091a \u0915\u0942\u091f\u0938\u094d\u0925\u092e\u094d \u0905\u091a\u0932\u092e\u094d \u0927\u094d\u0930\u0941\u0935\u092e\u094d \u0965 \u0969 \u0965\n\u0938\u0902\u0928\u093f\u092f\u092e\u094d\u092f \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0938\u0930\u094d\u0935\u0924\u094d\u0930 \u0938\u092e\u092c\u0941\u0926\u094d\u0927\u092f\u0903 \u0964\n\u0924\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0928\u0941\u0935\u0928\u094d\u0924\u093f \u092e\u093e\u092e\u094d \u090f\u0935 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924 \u0939\u093f\u0924\u0947 \u0930\u0924\u093e\u0903 \u0965 \u096a \u0965\n\u0915\u094d\u0932\u0947\u0936\u094b\u093d\u0927\u093f\u0915\u0924\u0930\u0903 \u0924\u0947\u0937\u093e\u092e\u094d \u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0938\u0915\u094d\u0924 \u091a\u0947\u0924\u0938\u093e\u092e\u094d \u0964\n\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e \u0939\u093f \u0917\u0924\u093f\u0903 \u0926\u0941\u0903\u0916\u092e\u094d \u0926\u0947\u0939\u0935\u0926\u094d\u092d\u093f\u0930\u0935\u093e\u092a\u094d\u092f\u0924\u0947 \u0965 \u096b \u0965","Others who pursue the 'perpetual' have an attitude of equanimity in every way. The object of their focus is present in every body. It is inscrutable. It isn't evident to our senses. It cannot be deciphered by thought. It is unchanged like an anvil - it is unmoved and steadfast. By controlling the community of organs in the body, they shall certainly attain Me. They are well-wishers of all beings. Nevertheless, it\u2019s extra tough for them to focus their interest on the 'unmanifest'. The goal of realizing the unmanifest Self is achieved with great difficulty by those who are predisposed to consider their body as themselves."],t.w)
B.OU=new A.e(B.c,["\u092f\u0947 \u0924\u0941 \u0938\u0930\u094d\u0935\u093e\u0923\u093f \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u092e\u092f\u093f \u0938\u0902\u0928\u094d\u092f\u0938\u094d\u092f \u092e\u0924\u094d\u092a\u0930\u093e\u0903 \u0964\n\u0905\u0928\u0928\u094d\u092f\u0947\u0928\u0948\u0935 \u092f\u094b\u0917\u0947\u0928 \u092e\u093e\u092e\u094d \u0927\u094d\u092f\u093e\u092f\u0928\u094d\u0924 \u0909\u092a\u093e\u0938\u0924\u0947 \u0965 \u096c \u0965\n\u0924\u0947\u0937\u093e\u092e\u094d \u0905\u0939\u092e\u094d \u0938\u092e\u0941\u0926\u094d\u0927\u0930\u094d\u0924\u093e \u092e\u0943\u0924\u094d\u092f\u0941 \u0938\u092e\u094d\u0938\u093e\u0930 \u0938\u093e\u0917\u0930\u093e\u0924\u094d \u0964\n\u092d\u0935\u093e\u092e\u093f \u0928 \u091a\u093f\u0930\u093e\u0924\u094d \u092a\u093e\u0930\u094d\u0925 \u092e\u092f\u093f \u0906\u0935\u0947\u0936\u093f\u0924 \u091a\u0947\u0924\u0938\u093e\u092e\u094d \u0965 \u096d \u0965","Further, those who worship Me, recollecting Me by dedicating all activity in Me - they have Me as their ultimate goal. Their only motivation is to unite with Me. Arjuna, I am their savior from the sea of perishable material. For those who place their consciousness in Me, I\u2019m with them instantly."],t.w)
B.Sh=new A.e(B.c,["\u092e\u092f\u093f \u090f\u0935 \u092e\u0928 \u0906\u0927\u0924\u094d\u0938\u094d\u0935 \u092e\u092f\u093f \u092c\u0941\u0926\u094d\u0927\u093f\u092e\u094d \u0928\u093f\u0935\u0947\u0936\u092f \u0964\n\u0928\u093f\u0935\u0938\u093f\u0937\u094d\u092f\u0938\u093f \u092e\u092f\u093f \u090f\u0935 \u0905\u0924 \u090a\u0930\u094d\u0927\u094d\u0935\u092e\u094d \u0928 \u0938\u092e\u094d\u0936\u092f\u0903 \u0965 \u096e \u0965","Station the mind in Me alone. Keep your intentions in Me. After that, you will be in Me alone, there is no doubt in this."],t.w)
B.PF=new A.e(B.c,["\u0905\u0925 \u091a\u093f\u0924\u094d\u0924\u092e\u094d \u0938\u092e\u093e\u0927\u093e\u0924\u0941\u092e\u094d \u0928 \u0936\u0915\u094d\u0928\u094b\u0937\u093f \u092e\u092f\u093f \u0938\u094d\u0925\u093f\u0930\u092e\u094d \u0964\n\u0905\u092d\u094d\u092f\u093e\u0938 \u092f\u094b\u0917\u0947\u0928 \u0924\u0924\u0903 \u092e\u093e\u092e\u093f\u091a\u094d\u091b\u093e\u092a\u094d\u0924\u0941\u092e\u094d \u0927\u0928\u0928\u094d\u091c\u092f \u0965 \u096f \u0965","Arjuna, in case you are unable to contain and place your mind firmly in Me, then be with the desire to reach Me through repeated practice, by making it a habit."],t.w)
B.TA=new A.e(B.c,["\u0905\u092d\u094d\u092f\u093e\u0938\u0947 \u0905\u092a\u093f \u0905\u0938\u092e\u0930\u094d\u0925\u094b\u093d\u0938\u093f \u092e\u0924\u094d\u0915\u0930\u094d\u092e \u092a\u0930\u092e\u094b \u092d\u0935 \u0964\n\u092e\u0926\u0930\u094d\u0925\u092e\u094d \u0905\u092a\u093f \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0915\u0941\u0930\u094d\u0935\u0928\u094d \u0938\u093f\u0926\u094d\u0927\u093f\u092e\u094d \u0905\u0935\u093e\u092a\u094d\u0938\u094d\u092f\u0938\u093f \u0965 \u0967\u0966 \u0965","If you aren\u2019t able to practice as well, be a person who works for Me. You will attain the goal by doing your actions for Me."],t.w)
B.P5=new A.e(B.c,["\u0905\u0925\u0948\u0924\u0924\u094d \u0905\u092a\u093f \u0905\u0936\u0915\u094d\u0924\u094b\u093d\u0938\u093f \u0915\u0930\u094d\u0924\u0941\u092e\u094d \u092e\u0926\u094d\u092f\u094b\u0917\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u0903 \u0964\n\u0938\u0930\u094d\u0935 \u0915\u0930\u094d\u092e \u092b\u0932 \u0924\u094d\u092f\u093e\u0917\u092e\u094d \u0924\u0924\u0903 \u0915\u0941\u0930\u0941 \u092f\u0924\u093e\u0924\u094d\u092e\u0935\u093e\u0928\u094d \u0965 \u0967\u0967 \u0965","While being devoted to Me, in case you are unable to do this as well, then leave the outcomes of all actions. Be a person who perseveres."],t.w)
B.ON=new A.e(B.c,["\u0936\u094d\u0930\u0947\u092f\u094b \u0939\u093f \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0905\u092d\u094d\u092f\u093e\u0938\u093e\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u093e\u0924\u094d \u0927\u094d\u092f\u093e\u0928\u092e\u094d \u0935\u093f\u0936\u093f\u0937\u094d\u092f\u0924\u0947 \u0964\n\u0927\u094d\u092f\u093e\u0928\u093e\u0924\u094d \u0915\u0930\u094d\u092e \u092b\u0932 \u0924\u094d\u092f\u093e\u0917\u0903 \u0924\u094d\u092f\u093e\u0917\u093e\u0924\u094d \u0936\u093e\u0928\u094d\u0924\u093f\u0930\u0928\u0928\u094d\u0924\u0930\u092e\u094d \u0965 \u0967\u0968 \u0965","Knowledge is certainly superior to mere practice. Focus is special in comparison to knowledge. Beyond such focus lies the ability to leave the outcomes of our actions. Tranquility results soon after such renunciation."],t.w)
B.SE=new A.e(B.c,["\u0905\u0926\u094d\u0935\u0947\u0937\u094d\u091f\u093e \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u092e\u0948\u0924\u094d\u0930\u0903 \u0915\u0930\u0941\u0923 \u090f\u0935 \u091a \u0964\n\u0928\u093f\u0930\u094d\u092e\u092e\u094b \u0928\u093f\u0930\u0939\u0919\u094d\u0915\u093e\u0930\u0903 \u0938\u092e \u0926\u0941\u0903\u0916 \u0938\u0941\u0916\u0903 \u0915\u094d\u0937\u092e\u0940 \u0965 \u0967\u0969 \u0965\n\u0938\u0928\u094d\u0924\u0941\u0937\u094d\u091f\u0903 \u0938\u0924\u0924\u092e\u094d \u092f\u094b\u0917\u0940 \u092f\u0924\u093e\u0924\u094d\u092e\u093e \u0926\u0943\u0922 \u0928\u093f\u0936\u094d\u091a\u092f\u0903 \u0964\n\u092e\u092f\u093f \u0905\u0930\u094d\u092a\u093f\u0924 \u092e\u0928\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u092f\u094b \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u0903 \u0938 \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967\u096a \u0965","Without hatred towards any being, with only friendship and compassion, without possessiveness, without considering the body as the Self, with the same outlook towards comfort and discomfort, ever-forgiving, ever content, being in touch with his Self, he exercises control over himself. Being firm in his conviction, he dedicates his mind and intellect in Me. Such a devotee of Mine is dear to Me."],t.w)
B.RK=new A.e(B.c,["\u092f\u0938\u094d\u092e\u093e\u0924\u094d \u0928 \u0909\u0926\u094d\u0935\u093f\u091c\u0924\u0947 \u0932\u094b\u0915\u093e\u0903\n\u0932\u094b\u0915\u093e\u0924\u094d \u0928 \u0909\u0926\u094d\u0935\u093f\u091c\u0924\u0947 \u091a \u092f\u0903 \u0964\n\u0939\u0930\u094d\u0937\u093e\u092e\u0930\u094d\u0937 \u092d\u092f\u094b\u0926\u094d\u0935\u0947\u0917\u0948\u0903\n\u092e\u0941\u0915\u094d\u0924\u094b \u092f\u0903 \u0938 \u091a \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967\u096b \u0965","The person due to whom people do not get agitated, who doesn't get agitated by this world, who is free from ecstasy, anger, fear and agitation - Such a person is dear to Me."],t.w)
B.OZ=new A.e(B.c,["\u0905\u0928\u092a\u0947\u0915\u094d\u0937\u0903 \u0936\u0941\u091a\u093f\u0930\u094d\u0926\u0915\u094d\u0937\u0903 \u0909\u0926\u093e\u0938\u0940\u0928\u094b \u0917\u0924\u0935\u094d\u092f\u0925\u0903 \u0964\n\u0938\u0930\u094d\u0935\u093e\u0930\u092e\u094d\u092d \u092a\u0930\u093f\u0924\u094d\u092f\u093e\u0917\u0940 \u092f\u094b \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u0903 \u0938 \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967\u096c \u0965","A devotee of Mine doesn\u2019t expect anything. He is neutral, clean and diligent. He is without agitation, leaving the notion that he makes everything happen - such a person is dear to Me."],t.w)
B.Wt=new A.e(B.c,["\u092f\u094b \u0928 \u0939\u0943\u0937\u094d\u092f\u0924\u093f \u0928 \u0926\u094d\u0935\u0947\u0937\u094d\u091f\u093f \u0928 \u0936\u094b\u091a\u0924\u093f \u0928 \u0915\u093e\u0919\u094d\u0915\u094d\u0937\u0924\u093f \u0964\n\u0936\u0941\u092d\u093e\u0936\u0941\u092d \u092a\u0930\u093f\u0924\u094d\u092f\u093e\u0917\u0940 \u092d\u0915\u094d\u0924\u093f\u092e\u093e\u0928\u094d \u092f\u0903 \u0938 \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u0903 \u0965 \u0967\u096d \u0965","Whoever leaves favorable and unfavorable experiences is not ecstatic, doesn\u2019t hate, is neither sad nor lustful. Such a devotee is dear to Me."],t.w)
B.So=new A.e(B.c,["\u0938\u092e\u0903 \u0936\u0924\u094d\u0930\u094c \u091a \u092e\u093f\u0924\u094d\u0930\u0947 \u091a \u0924\u0925\u093e \u092e\u093e\u0928 \u0905\u092a\u092e\u093e\u0928\u092f\u094b\u0903 \u0964\n\u0936\u0940\u0924\u094b\u0937\u094d\u0923 \u0938\u0941\u0916 \u0926\u0941\u0903\u0916\u0947\u0937\u0941 \u0938\u092e\u0903 \u0938\u0919\u094d\u0917 \u0935\u093f\u0935\u0930\u094d\u091c\u093f\u0924\u0903 \u0965 \u0967\u096e \u0965\n\u0924\u0941\u0932\u094d\u092f \u0928\u093f\u0928\u094d\u0926\u093e \u0938\u094d\u0924\u0941\u0924\u093f\u0903 \u092e\u094c\u0928\u0940 \u0938\u0928\u094d\u0924\u0941\u0937\u094d\u091f\u094b \u092f\u0947\u0928 \u0915\u0947\u0928\u091a\u093f\u0924\u094d \u0964\n\u0905\u0928\u093f\u0915\u0947\u0924\u0903 \u0938\u094d\u0925\u093f\u0930\u092e\u0924\u093f\u0903 \u092d\u0915\u094d\u0924\u093f\u092e\u093e\u0928\u094d \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u094b \u0928\u0930\u0903 \u0965 \u0967\u096f \u0965","Being unbiased among friendly and unfriendly people, as well as in fame and disgrace; being consistent in comfort and discomfort, cold and heat; being free of attachments; treating praise and reprimand in the same way, being silent, satisfied with whatever comes his way, uninterested in establishing his residence and territory; being with conviction - this devotee is dear to Me."],t.w)
B.Vz=new A.e(B.c,["\u092f\u0947 \u0924\u0941 \u0927\u0930\u094d\u092e\u094d\u092f\u093e\u092e\u0943\u0924\u092e\u094d \u0907\u0926\u092e\u094d \u092f\u0925\u094b\u0915\u094d\u0924\u092e\u094d \u092a\u0930\u094d\u092f\u0941\u092a\u093e\u0938\u0924\u0947 \u0964\n\u0936\u094d\u0930\u0926\u094d\u0926\u0927\u093e\u0928\u093e \u092e\u0924\u094d\u092a\u0930\u092e\u093e\u0903 \u092d\u0915\u094d\u0924\u093e\u0938\u094d\u0924\u0947 \u0905\u0924\u0940\u0935 \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u093e\u0903 \u0965 \u0968\u0966 \u0965","While all devotees are dear to Me, those devotees who diligently practice this eternal duty of devotion , considering Me to be the ultimate goal to be achieved with complete faith, as described- they are extremely dear to Me."],t.w)
B.RQ=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0907\u0926\u092e\u094d \u0936\u0930\u0940\u0930\u092e\u094d \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0915\u094d\u0937\u0947\u0924\u094d\u0930\u092e\u094d \u0907\u0924\u094d\u092f\u092d\u093f\u0927\u0940\u092f\u0924\u0947 \u0964\n\u090f\u0924\u0924\u094d \u092f\u094b \u0935\u0947\u0924\u094d\u0924\u093f \u0924\u092e\u094d \u092a\u094d\u0930\u093e\u0939\u0941\u0903 \u0915\u094d\u0937\u0947\u0924\u094d\u0930\u091c\u094d\u091e \u0907\u0924\u093f \u0924\u0926\u094d\u0935\u093f\u0926\u0903 \u0965 \u0967 \u0965","Lord Krishna said- Arjuna, this body is said to be the field of action. People who know this would term the one who is aware of this body as \u2018the knower of the field\u2019."],t.w)
B.Sx=new A.e(B.c,["\u0915\u094d\u0937\u0947\u0924\u094d\u0930\u091c\u094d\u091e\u092e\u094d \u091a\u093e\u092a\u093f \u092e\u093e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0938\u0930\u094d\u0935 \u0915\u094d\u0937\u0947\u0924\u094d\u0930\u0947\u0937\u0941 \u092d\u093e\u0930\u0924 \u0964\n\u0915\u094d\u0937\u0947\u0924\u094d\u0930 \u0915\u094d\u0937\u0947\u0924\u094d\u0930\u091c\u094d\u091e\u092f\u094b\u0903 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092f\u0924\u094d \u0924\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092e\u0924\u092e\u094d \u092e\u092e \u0965 \u0968 \u0965","Arjuna, know Me to be the knower as well, in every body. The knowledge about the field and its knower is itself knowledge - this is My doctrine."],t.w)
B.VV=new A.e(B.c,["\u0924\u0924\u094d \u0915\u094d\u0937\u0947\u0924\u094d\u0930\u092e\u094d \u092f\u0924\u094d \u091a \u092f\u093e\u0926\u0943\u0915\u094d \u091a \u092f\u0924\u094d \u0935\u093f\u0915\u093e\u0930\u0940 \u092f\u0924\u0903 \u091a \u092f\u0924\u094d \u0964\n\u0938 \u091a \u092f\u094b \u092f\u0924\u094d \u092a\u094d\u0930\u092d\u093e\u0935\u0903 \u091a \u0924\u0924\u094d \u0938\u092e\u093e\u0938\u0947\u0928 \u092e\u0947 \u0936\u0943\u0923\u0941 \u0965 \u0969 \u0965","That field of action - What is it made up of? What are its characteristics? What are its changes? What is its origin? What is its form? Then we talked about the knower of the field - What is his form? What is his scope of influence? Listen to it from Me in summary."],t.w)
B.Qk=new A.e(B.c,["\u090b\u0937\u093f\u092d\u093f\u0903 \u092c\u0939\u0941\u0927\u093e \u0917\u0940\u0924\u092e\u094d \u091b\u0928\u094d\u0926\u094b\u092d\u093f\u0903 \u0935\u093f\u0935\u093f\u0927\u0948\u0903 \u092a\u0943\u0925\u0915\u094d \u0964\n\u092c\u094d\u0930\u0939\u094d\u092e\u0938\u0942\u0924\u094d\u0930 \u092a\u0926\u0948\u0903 \u091a\u0948\u0935 \u0939\u0947\u0924\u0941\u092e\u0926\u094d\u092d\u093f\u0903 \u0935\u093f\u0928\u093f\u0936\u094d\u091a\u093f\u0924\u0948\u0903 \u0965 \u096a \u0965","The fact the body and the Self are distinct has been told in many ways- by many Rishis, by various Vedas, by the verses of the Brahmasutra. They state this fact with full conviction, along with the reasoning and logic that goes with it."],t.w)
B.Ug=new A.e(B.c,["\u092e\u0939\u093e\u092d\u0942\u0924\u093e\u0928\u093f \u0905\u0939\u0902\u0915\u093e\u0930\u094b \u092c\u0941\u0926\u094d\u0927\u093f\u0903 \u0905\u0935\u094d\u092f\u0915\u094d\u0924\u092e\u094d \u090f\u0935 \u091a \u0964\n\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0923\u093f \u0926\u0936\u0948\u0915\u092e\u094d \u091a \u092a\u0928\u094d\u091a \u091a \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0917\u094b\u091a\u0930\u093e\u0903 \u0965 \u096b \u0965\n\u0907\u091a\u094d\u091b\u093e \u0926\u094d\u0935\u0947\u0937\u0903 \u0938\u0941\u0916\u092e\u094d \u0926\u0941\u0903\u0916\u092e\u094d \u0938\u0919\u094d\u0918\u093e\u0924\u0903 \u091a\u0947\u0924\u0928\u093e \u0927\u0943\u0924\u093f\u0903 \u0964\n\u090f\u0924\u0924\u094d \u0915\u094d\u0937\u0947\u0924\u094d\u0930\u092e\u094d \u0938\u092e\u093e\u0938\u0947\u0928 \u0938\u0935\u093f\u0915\u093e\u0930\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965 \u096c \u0965","The existence of a conscious being comes from a combination of the following: The five elements - solids, liquids, energy, gasses and space; the universe that existed before them, in which particles formed; the state before that, when the singularity expanded; and the state before that, when the universe was subtle within that singularity; the ten organs along with the mind; and the five stimuli of the organs; the desire to have what we like; the desire to avoid what we hate; comfort; pain. This field of action - your body - has just been described in summary, along with the changes it undergoes."],t.w)
B.T9=new A.e(B.c,["\u0905\u092e\u093e\u0928\u093f\u0924\u094d\u0935\u092e\u094d \u0905\u0926\u092e\u094d\u092d\u093f\u0924\u094d\u0935\u092e\u094d \u0905\u0939\u093f\u0902\u0938\u093e \u0915\u094d\u0937\u093e\u0928\u094d\u0924\u093f\u0903 \u0906\u0930\u094d\u091c\u0935\u092e\u094d \u0964\n\u0906\u091a\u093e\u0930\u094d\u092f \u0909\u092a\u093e\u0938\u0928\u092e\u094d \u0936\u094c\u091a\u092e\u094d \u0938\u094d\u0925\u0948\u0930\u094d\u092f\u092e\u094d \u0906\u0924\u094d\u092e \u0935\u093f\u0928\u093f\u0917\u094d\u0930\u0939\u092e\u094d \u0965 \u096d \u0965","Without a sense of superiority, without hypocrisy, with no intention to harm anyone, being without agitation with consistency in thought, speech and deed, with respect and adoration for the teacher, with cleanliness, being steadfast, with self-discipline."],t.w)
B.Q8=new A.e(B.c,["\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0930\u094d\u0925\u0947\u0937\u0941 \u0935\u0948\u0930\u093e\u0917\u094d\u092f\u092e\u094d \u0905\u0928\u0939\u0902\u0915\u093e\u0930 \u090f\u0935 \u091a \u0964\n\u091c\u0928\u094d\u092e \u092e\u0943\u0924\u094d\u092f\u0941 \u091c\u0930\u093e \u0935\u094d\u092f\u093e\u0927\u093f \u0926\u0941\u0903\u0916 \u0926\u094b\u0937\u093e\u0928\u0941\u0926\u0930\u094d\u0936\u0928\u092e\u094d \u0965 \u096e \u0965","Without indulging the desire for the enjoyment of our organs, without the misconception that the body is the Self, considering that flaws and sorrows such as birth, death, old age and disease are inevitable consequences of the body."],t.w)
B.UZ=new A.e(B.c,["\u0905\u0938\u0915\u094d\u0924\u093f\u0903 \u0905\u0928\u092d\u093f\u0937\u094d\u0935\u0919\u094d\u0917\u0903 \u092a\u0941\u0924\u094d\u0930 \u0926\u093e\u0930 \u0917\u0943\u0939\u093e\u0926\u093f\u0937\u0941 \u0964\n\u0928\u093f\u0924\u094d\u092f\u092e\u094d \u091a \u0938\u092e \u091a\u093f\u0924\u094d\u0924\u0924\u094d\u0935\u092e\u094d \u0907\u0937\u094d\u091f\u093e\u0928\u093f\u0937\u094d\u091f \u0909\u092a\u092a\u0924\u094d\u0924\u093f\u0937\u0941 \u0965 \u096f \u0965","Not bound by attachments, being without possessiveness towards a son, wife or a home, having the same attitude at all times, even on encountering the favorable and the unfavorable."],t.w)
B.R2=new A.e(B.c,["\u092e\u092f\u093f \u091a \u0905\u0928\u0928\u094d\u092f \u092f\u094b\u0917\u0947\u0928 \u092d\u0915\u094d\u0924\u093f\u0903 \u0905\u0935\u094d\u092f\u092d\u093f\u091a\u093e\u0930\u093f\u0923\u0940 \u0964\n\u0935\u093f\u0935\u093f\u0915\u094d\u0924 \u0926\u0947\u0936 \u0938\u0947\u0935\u093f\u0924\u094d\u0935\u092e\u094d \u0905\u0930\u0924\u093f\u0903 \u091c\u0928\u0938\u092e\u094d\u0938\u0926\u093f \u0965 \u0967\u0966 \u0965","With devotion in Me, not bound to any other purpose; Without deviating to other goals and other sources of power; Honoring a place of solitude; Being free of attachment in the company of many."],t.w)
B.Sz=new A.e(B.c,["\u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u091c\u094d\u091e\u093e\u0928 \u0928\u093f\u0924\u094d\u092f\u0924\u094d\u0935\u092e\u094d \u0924\u0924\u094d\u0935 \u091c\u094d\u091e\u093e\u0928\u093e\u0930\u094d\u0925 \u0926\u0930\u094d\u0936\u0928\u092e\u094d \u0964\n\u090f\u0924\u0924\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0907\u0924\u093f \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u092e\u094d \u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092f\u0926\u0924\u094b\u093d\u0928\u094d\u092f\u0925\u093e \u0965 \u0967\u0967 \u0965","Being persistent in the quest of Self-awareness; Reflection to realize the truth - This is said to be awareness. Anything other than this is ignorance."],t.w)
B.QP=new A.e(B.c,["\u091c\u094d\u091e\u0947\u092f\u092e\u094d \u092f\u0924\u094d \u0924\u0924\u094d \u092a\u094d\u0930\u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0905\u092e\u0943\u0924\u092e\u094d \u0905\u0936\u094d\u0928\u0941\u0924\u0947 \u0964\n\u0905\u0928\u093e\u0926\u093f\u092e\u0924\u094d \u092a\u0930\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0928 \u0938\u0924\u094d \u0924\u0924\u094d \u0928\u093e\u0938\u0926\u0941\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u0968 \u0965","I will explain that awareness, with which people achieve freedom from the cycle of death . The Self expands to realize that I am supreme. This state is not the one in which the Self is bound to this environment. It is also not the state when the Self is present in the subtle singularity ."],t.w)
B.Vm=new A.e(B.c,["\u0938\u0930\u094d\u0935\u0924\u0903 \u092a\u093e\u0923\u093f \u092a\u093e\u0926\u092e\u094d \u0924\u0924\u094d \u0938\u0930\u094d\u0935\u0924\u094b\u093d\u0915\u094d\u0937\u093f \u0936\u093f\u0930\u094b \u092e\u0941\u0916\u092e\u094d \u0964\n\u0938\u0930\u094d\u0935\u0924\u0903 \u0936\u094d\u0930\u0941\u0924\u093f\u092e\u0924\u094d \u0932\u094b\u0915\u0947 \u0938\u0930\u094d\u0935\u092e\u094d \u0906\u0935\u0943\u0924\u094d\u092f \u0924\u093f\u0937\u094d\u0920\u0924\u093f \u0965 \u0967\u0969 \u0965","It has all possible arms and feet, all possible eyes, heads and faces and all possible activities. It is all-pervasive in this world."],t.w)
B.TW=new A.e(B.c,["\u0938\u0930\u094d\u0935\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0917\u0941\u0923\u093e\u092d\u093e\u0938\u092e\u094d \u0938\u0930\u094d\u0935\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f \u0935\u093f\u0935\u0930\u094d\u091c\u093f\u0924\u092e\u094d \u0964\n\u0905\u0938\u0915\u094d\u0924\u092e\u094d \u0938\u0930\u094d\u0935 \u092d\u0943\u0924\u094d \u091a\u0948\u0935 \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u092e\u094d \u0917\u0941\u0923 \u092d\u094b\u0915\u094d\u0924\u0943 \u091a \u0965 \u0967\u096a \u0965","It gives all organs their specialty, yet remains distinct from all those organs. It is free of attachment, while being capable of donning any body. It is free of the three qualities , while being capable of experiencing those qualities."],t.w)
B.RX=new A.e(B.c,["\u092c\u0939\u093f\u0930\u0928\u094d\u0924\u0903 \u091a \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0905\u091a\u0930\u092e\u094d \u091a\u0930\u092e\u094d \u090f\u0935 \u091a \u0964\n\u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0924\u094d\u0935\u093e\u0924\u094d \u0924\u0926\u0935\u093f\u091c\u094d\u091e\u0947\u092f\u092e\u094d \u0926\u0942\u0930\u0938\u094d\u0925\u092e\u094d \u091a\u093e\u0928\u094d\u0924\u093f\u0915\u0947 \u091a \u0924\u0924\u094d \u0965 \u0967\u096b \u0965","This pure Self is outside and inside all beings. It moves while being unmoved. It is not recognized because it is subtle. Even while being far away, the Self is close by."],t.w)
