B.Or=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092a\u0930\u092e\u094d \u092d\u0942\u092f\u0903 \u092a\u094d\u0930\u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u091c\u094d\u091e\u093e\u0928\u093e\u0928\u093e\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0909\u0924\u094d\u0924\u092e\u092e\u094d \u0964\n\u092f\u0924\u094d \u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u092e\u0941\u0928\u092f\u0903 \u0938\u0930\u094d\u0935\u0947 \u092a\u0930\u093e\u092e\u094d \u0938\u093f\u0926\u094d\u0927\u093f\u092e\u093f\u0924\u094b \u0917\u0924\u093e\u0903 \u0965 \u0967 \u0965","Lord Krishna said - Once again, I will elaborate the knowledge that stands supreme among all there is to know. This description is beyond what I have said before. Knowing this, all insightful people have reached the supreme goal from this material world."],t.w)
B.Q2=new A.e(B.c,["\u0907\u0926\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0909\u092a\u093e\u0936\u094d\u0930\u093f\u0924\u094d\u092f \u092e\u092e \u0938\u093e\u0927\u0930\u094d\u092e\u094d\u092f\u092e\u094d \u0906\u0917\u0924\u093e\u0903 \u0964\n\u0938\u0930\u094d\u0917\u0947\u093d\u092a\u093f \u0928 \u0909\u092a\u091c\u093e\u092f\u0928\u094d\u0924\u0947 \u092a\u094d\u0930\u0932\u092f\u0947 \u0928 \u0935\u094d\u092f\u0925\u0928\u094d\u0924\u093f \u091a \u0965 \u0968 \u0965","Having gained this knowledge, they achieve My characteristics. They are not born again even at the time of creation, nor do they perish when the universe perishes."],t.w)
B.Tb=new A.e(B.c,["\u092e\u092e \u092f\u094b\u0928\u093f\u0903 \u092e\u0939\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0924\u0938\u094d\u092e\u093f\u0928\u094d \u0917\u0930\u094d\u092d\u092e\u094d \u0926\u0927\u093e\u092e\u094d\u092f\u0939\u092e\u094d \u0964\n\u0938\u092e\u094d\u092d\u0935\u0903 \u0938\u0930\u094d\u0935 \u092d\u0942\u0924\u093e\u0928\u093e\u092e\u094d \u0924\u0924\u094b \u092d\u0935\u0924\u093f \u092d\u093e\u0930\u0924 \u0965 \u0969 \u0965","Arjuna, the universe it is My womb. It is a manifestation of the plasma that resulted from cosmic inflation . In that, I bring together life that can reproduce. Then, the creation of all beings happens."],t.w)
B.V6=new A.e(B.c,["\u0938\u0930\u094d\u0935 \u092f\u094b\u0928\u093f\u0937\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092e\u0942\u0930\u094d\u0924\u092f\u0903 \u0938\u092e\u094d\u092d\u0935\u0928\u094d\u0924\u093f \u092f\u093e\u0903 \u0964\n\u0924\u093e\u0938\u093e\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u092e\u0939\u0924\u094d \u092f\u094b\u0928\u093f\u0903 \u0905\u0939\u092e\u094d \u092c\u0940\u091c\u092a\u094d\u0930\u0926\u0903 \u092a\u093f\u0924\u093e \u0965 \u096a \u0965","Arjuna, the embryos of different forms that are born in all wombs are the expanding universe, which originated in the cosmic inflation. I am the father who infuses life in the embryo."],t.w)
B.PV=new A.e(B.c,["\u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0930\u091c\u0938\u094d\u0924\u092e \u0907\u0924\u093f \u0917\u0941\u0923\u093e\u0903 \u092a\u094d\u0930\u0915\u0943\u0924\u093f \u0938\u092e\u094d\u092d\u0935\u093e\u0903 \u0964\n\u0928\u093f\u092c\u0927\u094d\u0928\u0928\u094d\u0924\u093f \u092e\u0939\u093e\u092c\u093e\u0939\u094b \u0926\u0947\u0939\u0947 \u0926\u0947\u0939\u093f\u0928\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0965 \u096b \u0965","The three qualities , sattva, rajas and tamas come into existence in the environment. Arjuna, they bind the imperishable Self in a body."],t.w)
B.P7=new A.e(B.c,["\u0924\u0924\u094d\u0930 \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0928\u093f\u0930\u094d\u092e\u0932\u0924\u094d\u0935\u093e\u0924\u094d \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u092e\u094d \u0905\u0928\u093e\u092e\u092f\u092e\u094d \u0964\n\u0938\u0941\u0916 \u0938\u0919\u094d\u0917\u0947\u0928 \u092c\u0927\u094d\u0928\u093e\u0924\u093f \u091c\u094d\u091e\u093e\u0928 \u0938\u0919\u094d\u0917\u0947\u0928 \u091a\u093e\u0928\u0918 \u0965 \u096c \u0965","Arjuna, in the three qualities , the quality of serenity illuminates and lets us know everything, by being flawless. It has no disease associated with it. It binds due to attachment towards such comfort and due to attachment towards knowledge."],t.w)
B.U8=new A.e(B.c,["\u0930\u091c\u094b \u0930\u093e\u0917\u093e\u0924\u094d\u092e\u0915\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0924\u0943\u0937\u094d\u0923\u093e \u0938\u0919\u094d\u0917 \u0938\u092e\u0941\u0926\u094d\u092d\u0935\u092e\u094d \u0964\n\u0924\u0924\u094d \u0928\u093f\u092c\u0927\u094d\u0928\u093e\u0924\u093f \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0915\u0930\u094d\u092e\u0938\u0919\u094d\u0917\u0947\u0928 \u0926\u0947\u0939\u093f\u0928\u092e\u094d \u0965 \u096d \u0965","Know rajas to be a quality that has passion at its core. It is the space where insatiable desires and bonds are born. Arjuna, it binds the Self by attaching it to actions."],t.w)
B.S9=new A.e(B.c,["\u0924\u092e\u0938\u094d\u0924\u0941 \u0905\u091c\u094d\u091e\u093e\u0928\u091c\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u094b\u0939\u0928\u092e\u094d \u0938\u0930\u094d\u0935 \u0926\u0947\u0939\u093f\u0928\u093e\u092e\u094d \u0964\n\u092a\u094d\u0930\u092e\u093e\u0926 \u0906\u0932\u0938\u094d\u092f \u0928\u093f\u0926\u094d\u0930\u093e\u092d\u093f\u0903 \u0924\u0924\u094d \u0928\u093f\u092c\u0927\u094d\u0928\u093e\u0924\u093f \u092d\u093e\u0930\u0924 \u0965 \u096e \u0965","Arjuna, know tamas to be a quality that gives rise to ignorance and delusion in every Self that owns a body. It binds the Self with carelessness, lethargy and drowsiness."],t.w)
B.Wi=new A.e(B.c,["\u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0938\u0941\u0916\u0947 \u0938\u0928\u094d\u091c\u092f\u0924\u093f \u0930\u091c\u0903 \u0915\u0930\u094d\u092e\u0923\u093f \u092d\u093e\u0930\u0924 \u0964\n\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0906\u0935\u0943\u0924\u094d\u092f \u0924\u0941 \u0924\u092e\u0903 \u092a\u094d\u0930\u092e\u093e\u0926\u0947 \u0938\u0928\u094d\u091c\u092f\u0924\u094d\u092f\u0941\u0924 \u0965 \u096f \u0965","Arjuna, the quality of sattva binds us in comfort. The quality of rajas binds us in actions. The quality of tamas conceals knowledge and binds us in mistakes."],t.w)
B.QV=new A.e(B.c,["\u0930\u091c\u0938\u094d \u0924\u092e\u0936\u094d\u091a \u0905\u092d\u093f\u092d\u0942\u092f \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u092d\u0935\u0924\u093f \u092d\u093e\u0930\u0924 \u0964\n\u0930\u091c\u0903 \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0924\u092e\u0936\u094d\u091a\u0948\u0935 \u0924\u092e\u0903 \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u094d \u0930\u091c\u0938\u094d\u0924\u0925\u093e \u0965 \u0967\u0966 \u0965","Arjuna, the quality of sattva takes effect by overpowering rajas and tamas . The quality of rajas comes forth too, by suppressing sattva and tamas . The quality of tamas suppresses sattva and rajas in the same way."],t.w)
B.R1=new A.e(B.c,["\u0938\u0930\u094d\u0935\u0926\u094d\u0935\u093e\u0930\u0947\u0937\u0941 \u0926\u0947\u0939\u0947\u093d\u0938\u094d\u092e\u093f\u0928\u094d \u092a\u094d\u0930\u0915\u093e\u0936 \u0909\u092a\u091c\u093e\u092f\u0924\u0947 \u0964\n\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u092f\u0926\u093e \u0924\u0926\u093e \u0935\u093f\u0926\u094d\u092f\u093e\u0924\u094d \u0935\u093f\u0935\u0943\u0926\u094d\u0927\u092e\u094d \u0938\u0924\u094d\u0924\u094d\u0935\u092e\u093f\u0924\u094d\u092f\u0941\u0924 \u0965 \u0967\u0967 \u0965","When all the sense organs and the mind in this body illuminate the true nature of things and awareness arises, then, recognize that the quality of sattva is predominant."],t.w)
B.UC=new A.e(B.c,["\u0932\u094b\u092d\u0903 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u0903 \u0906\u0930\u092e\u094d\u092d\u0903 \u0915\u0930\u094d\u092e\u0923\u093e\u092e\u094d \u0905\u0936\u092e\u0903 \u0938\u094d\u092a\u0943\u0939\u093e \u0964\n\u0930\u091c\u0938\u094d\u092f\u0947\u0924\u093e\u0928\u093f \u091c\u093e\u092f\u0928\u094d\u0924\u0947 \u0935\u093f\u0935\u0943\u0926\u094d\u0927\u0947 \u092d\u0930\u0924\u0930\u094d\u0937\u092d \u0965 \u0967\u0968 \u0965","Arjuna, avarice, restlessness, initiating action that is driven by desire, uneasiness and unquenchable attachment - all of them arise in rajas , when this quality dominates the others."],t.w)
B.SI=new A.e(B.c,["\u0905\u092a\u094d\u0930\u0915\u093e\u0936\u0903 \u0905\u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u0903 \u091a \u092a\u094d\u0930\u092e\u093e\u0926\u094b \u092e\u094b\u0939 \u090f\u0935 \u091a \u0964\n\u0924\u092e\u0938\u094d\u092f\u0947\u0924\u093e\u0928\u093f \u091c\u093e\u092f\u0928\u094d\u0924\u0947 \u0935\u093f\u0935\u0943\u0926\u094d\u0927\u0947 \u0915\u0941\u0930\u0941\u0928\u0928\u094d\u0926\u0928 \u0965 \u0967\u0969 \u0965","Arjuna, being ignorant of the true nature of things, reluctance to do anything, mistakes, and delusion - these behaviors arise in tamas , when this quality predominates the others."],t.w)
B.Q5=new A.e(B.c,["\u092f\u0926\u093e \u0938\u0924\u094d\u0924\u094d\u0935\u0947 \u092a\u094d\u0930\u0935\u0943\u0926\u094d\u0927\u0947 \u0924\u0941 \u092a\u094d\u0930\u0932\u092f\u092e\u094d \u092f\u093e\u0924\u093f \u0926\u0947\u0939\u092d\u0943\u0924\u094d \u0964\n\u0924\u0926\u093e \u0909\u0924\u094d\u0924\u092e \u0935\u093f\u0926\u093e\u092e\u094d \u0932\u094b\u0915\u093e\u0928\u094d \u0905\u092e\u0932\u093e\u0928\u094d \u092a\u094d\u0930\u0924\u093f\u092a\u0926\u094d\u092f\u0924\u0947 \u0965 \u0967\u096a \u0965","When an owner of a body is resorbed in a predominance of sattva , then he proceeds to unspoilt communities with supreme knowledge."],t.w)
B.NQ=new A.e(B.c,["\u0930\u091c\u0938\u093f \u092a\u094d\u0930\u0932\u092f\u092e\u094d \u0917\u0924\u094d\u0935\u093e \u0915\u0930\u094d\u092e\u0938\u0919\u094d\u0917\u093f\u0937\u0941 \u091c\u093e\u092f\u0924\u0947 \u0964","When the body perishes in rajas , the person is re-born among people who are attached to activity."],t.w)
B.Sn=new A.e(B.c,["\u0924\u0925\u093e \u092a\u094d\u0930\u0932\u0940\u0928\u0903 \u0924\u092e\u0938\u093f \u092e\u0942\u0922 \u092f\u094b\u0928\u093f\u0937\u0941 \u091c\u093e\u092f\u0924\u0947 \u0965 \u0967\u096b \u0965","Similarly, a person who dies in tamas is born in a womb that brings ignorance."],t.w)
B.Nn=new A.e(B.c,["\u0915\u0930\u094d\u092e\u0923\u0903 \u0938\u0941\u0915\u0943\u0924\u0938\u094d\u092f\u093e\u0939\u0941\u0903 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u0928\u093f\u0930\u094d\u092e\u0932\u092e\u094d \u092b\u0932\u092e\u094d \u0964\n\u0930\u091c\u0938\u0938\u094d\u0924\u0941 \u092b\u0932\u092e\u094d \u0926\u0941\u0903\u0916\u092e\u094d \u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0924\u092e\u0938\u0903 \u092b\u0932\u092e\u094d \u0965 \u0967\u096c \u0965","The outcome of action that\u2019s done well is said to be sattva , untainted by other qualities. On the other hand, the outcome of action driven by desire is sorrow. The outcome of lethargy is ignorance."],t.w)
B.QN=new A.e(B.c,["\u0938\u0924\u094d\u0924\u094d\u0935\u0924\u094d \u0938\u0928\u094d\u091c\u093e\u092f\u0924\u0947 \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0930\u091c\u0938\u094b \u0932\u094b\u092d \u090f\u0935 \u091a \u0964\n\u092a\u094d\u0930\u092e\u093e\u0926 \u092e\u094b\u0939\u094c \u0924\u092e\u0938\u0903 \u092d\u0935\u0924\u0903 \u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u090f\u0935 \u091a \u0965 \u0967\u096d \u0965","Knowledge arises from sattva . From rajas , it\u2019s only avarice. From tamas , mistakes and misconceptions arise, certainly followed by ignorance."],t.w)
B.Ps=new A.e(B.c,["\u090a\u0930\u094d\u0927\u094d\u0935\u092e\u094d \u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u0938\u0924\u094d\u0924\u094d\u0935\u0938\u094d\u0925\u093e\u0903 \u092e\u0927\u094d\u092f\u0947 \u0924\u093f\u0937\u094d\u0920\u0928\u094d\u0924\u093f \u0930\u093e\u091c\u0938\u093e\u0903 \u0964\n\u091c\u0918\u0928\u094d\u092f \u0917\u0941\u0923\u0935\u0943\u0924\u094d\u0924\u093f\u0938\u094d\u0925\u093e\u0903 \u0905\u0927\u094b \u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u0924\u093e\u092e\u0938\u093e\u0903 \u0965 \u0967\u096e \u0965","People who are situated in sattva ascend to eminence. Those with a high rajas quotient stay mediocre. Those in tamas stay and behave in undesirable ways. They attain lower life-forms."],t.w)
B.T2=new A.e(B.c,["\u0928\u093e\u0928\u094d\u092f\u092e\u094d \u0917\u0941\u0923\u0947\u092d\u094d\u092f\u0903 \u0915\u0930\u094d\u0924\u093e\u0930\u092e\u094d \u092f\u0926\u093e \u0926\u094d\u0930\u0937\u094d\u091f\u093e\u0928\u0941\u092a\u0936\u094d\u092f\u0924\u093f \u0964\n\u0917\u0941\u0923\u0947\u092d\u094d\u092f\u0903 \u091a \u092a\u0930\u092e\u094d \u0935\u0947\u0924\u094d\u0924\u093f \u092e\u0926\u094d\u092d\u093e\u0935\u092e\u094d \u0938\u094b\u093d\u0927\u093f\u0917\u091a\u094d\u091b\u0924\u093f \u0965 \u0967\u096f \u0965","An intelligent person doesn\u2019t see any cause of outcomes, Other than the three qualities . And when he knows beyond these qualities , he gains My state of being."],t.w)
B.VO=new A.e(B.c,["\u0917\u0941\u0923\u093e\u0928\u094d \u090f\u0924\u093e\u0928\u0924\u0940\u0924\u094d\u092f \u0924\u094d\u0930\u0940\u0928\u094d \u0926\u0947\u0939\u0940 \u0926\u0947\u0939\u0938\u092e\u0941\u0926\u094d\u092d\u0935\u093e\u0928\u094d \u0964\n\u091c\u0928\u094d\u092e \u092e\u0943\u0924\u094d\u092f\u0941 \u091c\u0930\u093e \u0926\u0941\u0903\u0916\u0948\u0903 \u0935\u093f\u092e\u0941\u0915\u094d\u0924\u094b\u093d\u092e\u0943\u0924\u092e\u094d \u0905\u0936\u094d\u0928\u0941\u0924\u0947 \u0965 \u0968\u0966 \u0965","Having crossed over these three qualities that come from the body, the owner of the body enjoys the ever-lasting. He is free from the sorrow of birth, death and old age."],t.w)
B.UF=new A.e(B.c,["\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a -\n\u0915\u0948\u0930\u094d\u0932\u093f\u0919\u094d\u0917\u0948\u0903 \u0924\u094d\u0930\u0940\u0928\u094d \u0917\u0941\u0923\u093e\u0928\u094d \u090f\u0924\u093e\u0928\u094d \u0905\u0924\u0940\u0924\u094b \u092d\u0935\u0924\u093f \u092a\u094d\u0930\u092d\u094b \u0964\n\u0915\u093f\u092e\u094d \u0906\u091a\u093e\u0930\u0903 \u0915\u0925\u092e\u094d \u091a\u0948\u0924\u093e\u0928\u094d \u0924\u094d\u0930\u0940\u0928\u094d \u0917\u0941\u0923\u093e\u0928\u094d \u0905\u0924\u093f\u0935\u0930\u094d\u0924\u0924\u0947 \u0965 \u0968\u0967 \u0965","Arjuna said: A person who has crossed over these three qualities - with what characteristics is he present? Lord, what is his behavior and how does he cross over these three qualities ?"],t.w)
B.T0=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u092a\u094d\u0930\u0915\u093e\u0936\u092e\u094d \u091a \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d \u091a \u092e\u094b\u0939\u092e\u094d \u090f\u0935 \u091a \u092a\u093e\u0928\u094d\u0921\u0935 \u0964\n\u0928 \u0926\u094d\u0935\u0947\u0937\u094d\u091f\u093f \u0938\u092e\u094d\u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093e\u0928\u093f \u0928 \u0928\u093f\u0935\u0943\u0924\u094d\u0924\u093e\u0928\u093f \u0915\u093e\u0902\u0915\u094d\u0937\u0924\u093f \u0965 \u0968\u0968 \u0965","The Lord said \u2013 Arjuna, this person doesn\u2019t loathe the presence of realization, activity, and misunderstanding. In their absence, he doesn't yearn for them either."],t.w)
B.UW=new A.e(B.c,["\u0909\u0926\u093e\u0938\u0940\u0928\u0935\u0924\u094d \u0906\u0938\u0940\u0928\u094b \u0917\u0941\u0923\u0948\u0930\u094d\u092f\u094b \u0928 \u0935\u093f\u091a\u093e\u0932\u094d\u092f\u0924\u0947 \u0964\n\u0917\u0941\u0923\u093e \u0935\u0930\u094d\u0924\u0928\u094d\u0924 \u0907\u0924\u094d\u092f\u0947\u0935 \u092f\u094b\u093d\u0935\u0924\u093f\u0937\u094d\u0920\u0924\u093f \u0928\u0947\u0902\u0917\u0924\u0947 \u0965 \u0968\u0969 \u0965","The person who is not thrown around by the three qualities , who stays his course isn\u2019t shaken. He remains as if inert, considering that these qualities would keep manifesting as their effects."],t.w)
B.P1=new A.e(B.c,["\u0938\u092e \u0926\u0941\u0903\u0916 \u0938\u0941\u0916\u0903 \u0938\u094d\u0935\u0938\u094d\u0925\u0903 \u0938\u092e \u0932\u094b\u0937\u094d\u091f\u093e\u0936\u094d\u092e \u0915\u093e\u0928\u094d\u091a\u0928\u0903 \u0964\n\u0924\u0941\u0932\u094d\u092f \u092a\u094d\u0930\u093f\u092f\u093e\u092a\u094d\u0930\u093f\u092f\u094b \u0927\u0940\u0930\u0903 \u0924\u0941\u0932\u094d\u092f \u0928\u093f\u0928\u094d\u0926\u093e\u0924\u094d\u092e \u0938\u092e\u094d\u0938\u094d\u0924\u0941\u0924\u093f\u0903 \u0965 \u0968\u096a \u0965\n\u092e\u093e\u0928\u093e\u092a\u092e\u093e\u0928\u092f\u094b\u0903 \u0924\u0941\u0932\u094d\u092f\u0903 \u0924\u0941\u0932\u094d\u092f\u094b \u092e\u093f\u0924\u094d\u0930\u093e\u0930\u093f \u092a\u0915\u094d\u0937\u092f\u094b\u0903 \u0964\n\u0938\u0930\u094d\u0935\u093e\u0930\u092e\u094d\u092d \u092a\u0930\u093f\u0924\u094d\u092f\u093e\u0917\u0940 \u0917\u0941\u0923\u093e\u0924\u0940\u0924\u0903 \u0938 \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0968\u096b \u0965","Being himself - same in comfort and sorrow, having the same outlook towards a lump of clay, a stone and gold, weighing the favorable and the unfavorable equally, same with insults and praises - he knows the Self from the body. Weighing honor and shame equally, considering friendly and unfriendly people equally, this person leaves attachment to material pursuits and is said to have crossed over the qualities ."],t.w)
B.UH=new A.e(B.c,["\u092e\u093e\u092e\u094d \u091a \u092f\u094b\u093d\u0935\u094d\u092f\u092d\u093f\u091a\u093e\u0930\u0947\u0923 \u092d\u0915\u094d\u0924\u093f\u092f\u094b\u0917\u0947\u0928 \u0938\u0947\u0935\u0924\u0947 \u0964\n\u0938 \u0917\u0941\u0923\u093e\u0928\u094d \u0938\u092e\u0924\u0940\u0924\u094d\u092f\u0948\u0924\u093e\u0928\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u092d\u0942\u092f\u093e\u092f \u0915\u0932\u094d\u092a\u0924\u0947 \u0965 \u0968\u096c \u0965","And the person who serves and experiences Me with constant devotion will completely overcome these qualities . He is cut out to experience the Self in its true form."],t.w)
B.NO=new A.e(B.c,["\u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b \u0939\u093f \u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u093e\u093d\u0939\u092e\u094d \u0905\u092e\u0943\u0924\u0938\u094d\u092f \u0905\u0935\u094d\u092f\u092f\u0938\u094d\u092f \u091a \u0964\n\u0936\u093e\u0936\u094d\u0935\u0924\u0938\u094d\u092f \u091a \u0927\u0930\u094d\u092e\u0938\u094d\u092f \u0938\u0941\u0916\u0938\u094d\u092f \u090f\u0915\u093e\u0928\u094d\u0924\u093f\u0915\u0938\u094d\u092f \u091a \u0965 \u0968\u096d \u0965","I am the basis of the Self, which is without death and decay. I am the basis of the ever-lasting practice of devotion and of complete joy."],t.w)
B.NY=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u090a\u0930\u094d\u0927\u094d\u0935 \u092e\u0942\u0932\u092e\u094d \u0905\u0927\u0903 \u0936\u093e\u0916\u092e\u094d \u0905\u0936\u094d\u0935\u0924\u094d\u0925\u092e\u094d \u092a\u094d\u0930\u093e\u0939\u0941\u0930\u0935\u094d\u092f\u092f\u092e\u094d \u0964\n\u091b\u0928\u094d\u0926\u093e\u092e\u094d\u0938\u093f \u092f\u0938\u094d\u092f \u092a\u0930\u094d\u0923\u093e\u0928\u093f \u092f\u0938\u094d\u0924\u092e\u094d \u0935\u0947\u0926 \u0938 \u0935\u0947\u0926\u0935\u093f\u0924\u094d \u0965 \u0967 \u0965","The Lord says: It is said that the material world is like a pepal tree that does not wear out, with its roots at the top and branches at the bottom. Its leaves are the Vedas. The person who knows this tree is the one who knows the Vedas."],t.w)
B.SA=new A.e(B.c,["\u0905\u0927\u0903 \u091a \u090a\u0930\u094d\u0927\u094d\u0935\u092e\u094d \u092a\u094d\u0930\u0938\u0943\u0924\u093e\u0903 \u0924\u0938\u094d\u092f \u0936\u093e\u0916\u093e\u0903\n\u0917\u0941\u0923 \u092a\u094d\u0930\u0935\u0943\u0926\u094d\u0927\u093e \u0935\u093f\u0937\u092f \u092a\u094d\u0930\u0935\u093e\u0932\u093e\u0903 \u0964\n\u0905\u0927\u0903 \u091a \u092e\u0942\u0932\u0928\u093f \u0905\u0928\u0941\u0938\u0928\u094d\u0924\u0924\u093e\u0928\u093f\n\u0915\u0930\u094d\u092e\u093e\u0928\u0941\u092c\u0928\u094d\u0927\u0940\u0928\u093f \u092e\u0928\u0941\u0937\u094d\u092f \u0932\u094b\u0915\u0947 \u0965 \u0968 \u0965","Its branches have expanded with the three qualities . Its shoots and sprouts are the stimuli in the environment. They have spread wide, both above and below. The branches below in the world of humans bind them with actions. The root has progressively become dense."],t.w)
B.NS=new A.e(B.c,["\u0928 \u0930\u0942\u092a\u092e\u094d \u0905\u0938\u094d\u092f\u0947\u0939 \u0924\u0925\u094b\u092a\u0932\u092d\u094d\u092f\u0924\u0947 \n\u0928\u093e\u0928\u094d\u0924\u094b \u0928 \u091a\u093e\u093d\u0926\u093f\u0903 \u0928 \u091a \u0938\u092e\u094d\u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u093e \u0964","Over here, the form of this tree is not apparent in the manner described before. We cannot see its end, its beginning, or the basis for its continued existence."],t.w)
B.NB=new A.e(B.c,["\u0905\u0936\u094d\u0935\u0924\u094d\u0925\u092e\u094d \u090f\u0928\u092e\u094d \u0938\u0941\u0935\u093f\u0930\u0942\u0922\u092e\u0942\u0932\u092e\u094d\n\u0905\u0938\u0919\u094d\u0917 \u0936\u0938\u094d\u0924\u094d\u0930\u0947\u0923 \u0926\u0943\u0922\u0947\u0928 \u091b\u093f\u0924\u094d\u0935\u093e \u0965 \u0969 \u0965\n\u0924\u0924\u0903 \u092a\u0926\u092e\u094d \u0924\u0924\u094d \u092a\u0930\u093f\u092e\u093e\u0930\u094d\u0917\u093f\u0924\u0935\u094d\u092f\u092e\u094d\n\u092f\u0938\u094d\u092e\u093f\u0928\u094d \u0917\u0924\u093e \u0928 \u0928\u093f\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u093f \u092d\u0942\u092f\u0903 \u0964","Having cut off this pepal tree with its overgrown roots using the weapon of decoupling and strength, that goal must be sought - the state from which people do not return anymore."],t.w)
B.UP=new A.e(B.c,["\u0924\u092e\u094d \u090f\u0935 \u091a\u093e\u0926\u094d\u092f\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u092e\u094d \u092a\u094d\u0930\u092a\u0926\u094d\u092f\u0947\n\u092f\u0924\u0903 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u0903 \u092a\u094d\u0930\u0938\u0943\u0924\u093e \u092a\u0941\u0930\u093e\u0923\u0940 \u0965 \u096a \u0965",'Seek the goal diligently- "I surrender to that very Ancient Person, from whom all existence came forth long ago."'],t.w)
B.SV=new A.e(B.c,["\u0928\u093f\u0930\u094d\u092e\u093e\u0928\u092e\u094b\u0939\u093e \u091c\u093f\u0924 \u0938\u0902\u0917\u0926\u094b\u0937\u093e\u0903\n\u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u0928\u093f\u0924\u094d\u092f\u093e \u0935\u093f\u0928\u093f\u0935\u0943\u0924\u094d\u0924 \u0915\u093e\u092e\u093e\u0903 \u0964\n\u0926\u094d\u0935\u0928\u094d\u0926\u094d\u0935\u0948\u0903 \u0935\u093f\u092e\u0941\u0915\u094d\u0924\u093e\u0903 \u0938\u0941\u0916 \u0926\u0941\u0903\u0916 \u0938\u0902\u091c\u094d\u091e\u0948\u0903\n\u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u0905\u092e\u0942\u0922\u093e\u0903 \u092a\u0926\u092e\u094d \u0905\u0935\u094d\u092f\u092f\u092e\u094d \u0924\u0924\u094d \u0965 \u096b \u0965","Those who are free of ignorance, those who are free of the illusion that the body is the Self, those who have won over the flaw of attachments, those who are constantly situated in the knowledge of the Self, those who have rid themselves of desire, those who are free from dualities that people call comfort and sorrow - they go to the place that never withers."],t.w)
B.WC=new A.e(B.c,["\u0928 \u0924\u0924\u094d \u092d\u093e\u0938\u092f\u0924\u0947 \u0938\u0942\u0930\u094d\u092f\u094b \u0928 \u0936\u0936\u093e\u0902\u0915\u094b \u0928 \u092a\u093e\u0935\u0915\u0903 \u0964\n\u092f\u0924\u094d \u0917\u0924\u094d\u0935\u093e \u0928 \u0928\u093f\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u0947 \u0924\u0924\u094d \u0927\u093e\u092e \u092a\u0930\u092e\u092e\u094d \u092e\u092e \u0965 \u096c \u0965","The sun cannot throw light to reveal it, nor can the moon, nor can any source of light such as fire. After reaching this, they do not return. That abode is My supreme attribute."],t.w)
B.VB=new A.e(B.c,["\u092e\u092e\u0948\u0935\u093e\u092e\u094d\u0936\u094b \u091c\u0940\u0935\u0932\u094b\u0915\u0947 \u091c\u0940\u0935\u092d\u0942\u0924\u0903 \u0938\u0928\u093e\u0924\u0928\u0903 \u0964\n\u092e\u0928\u0903 \u0937\u0937\u094d\u0920\u093e\u0928\u093f \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0923\u093f \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0938\u094d\u0925\u093e\u0928\u093f \u0915\u0930\u094d\u0937\u0924\u093f \u0965 \u096d \u0965","In this material world, where every Self is bound in the environment, the ever-existing Self is definitely a part of Me. It pulls together the six sense-organs along with the mind \u2013 all of them come from the environment."],t.w)
B.SP=new A.e(B.c,["\u0936\u0930\u0940\u0930\u092e\u094d \u092f\u0926\u0935\u093e\u092a\u094d\u0928\u094b\u0924\u093f \u092f\u091a\u094d\u091a\u093e\u092a\u093f \u0909\u0924\u094d\u0915\u094d\u0930\u093e\u092e\u0924\u0940\u0936\u094d\u0935\u0930\u0903 \u0964\n\u0917\u0943\u0939\u0940\u0924\u094d\u0935 \u090f\u0924\u093e\u0928\u093f \u0938\u092e\u094d\u092f\u093e\u0924\u093f \u0935\u093e\u092f\u0941\u0930\u094d\u0917\u0928\u094d\u0927\u093e\u0928\u094d \u0907\u0935\u093e\u0936\u092f\u093e\u0924\u094d \u0965 \u096e \u0965","The owner carries the essence of the body it gets to own, and the one that it leaves. It departs like the wind that takes the fragrance from its source."],t.w)
B.Wm=new A.e(B.c,["\u0936\u094d\u0930\u094b\u0924\u094d\u0930\u092e\u094d \u091a\u0915\u094d\u0937\u0941\u0903 \u0938\u094d\u092a\u0930\u094d\u0936\u0928\u092e\u094d \u091a \u0930\u0938\u0928\u092e\u094d \u0918\u094d\u0930\u093e\u0923\u092e\u094d \u090f\u0935 \u091a \u0964\n\u0905\u0927\u093f\u0937\u094d\u0920\u093e\u092f \u092e\u0928\u0903 \u091a\u093e\u092f\u092e\u094d \u0935\u093f\u0937\u092f\u093e\u0928\u094d \u0909\u092a\u0938\u0947\u0935\u0924\u0947 \u0965 \u096f \u0965","This Self employs the ears, eyes, skin, tongue, nose and the mind to experience the stimuli in the material world."],t.w)
B.Uh=new A.e(B.c,["\u0909\u0924\u094d\u0915\u094d\u0930\u093e\u092e\u0928\u094d\u0924\u092e\u094d \u0938\u094d\u0925\u093f\u0924\u092e\u094d \u0935\u093e\u093d\u092a\u093f \u092d\u0941\u0928\u094d\u091c\u093e\u0928\u092e\u094d \u0935\u093e \u0917\u0941\u0923\u093e\u0928\u094d\u0935\u093f\u0924\u092e\u094d \u0964\n\u0935\u093f\u092e\u0942\u0922\u093e \u0928\u093e\u0928\u0941\u092a\u0936\u094d\u092f\u0928\u094d\u0924\u093f \u092a\u0936\u094d\u092f\u0928\u094d\u0924\u093f \u091c\u094d\u091e\u093e\u0928 \u091a\u0915\u094d\u0937\u0941\u0937\u093e\u0903 \u0965 \u0967\u0966 \u0965","The ignorant do not recognize the Self when it departs from the body, or when it is situated in their own body, or even when it's experiencing the material world, when it is bound in the three qualities . Those endowed with the eyes of knowledge do see it."],t.w)
