B.OE=new A.e(B.c,["\u092f\u0924\u094d \u0906\u0926\u093f\u0924\u094d\u092f\u0917\u0924\u092e\u094d \u0924\u0947\u091c\u094b \u091c\u0917\u0924\u094d \u092d\u093e\u0938\u092f\u0924\u0947\u093d\u0916\u093f\u0932\u092e\u094d \u0964\n\u092f\u0924\u094d \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u0938\u093f \u092f\u0924\u094d \u091a\u093e\u0917\u094d\u0928\u094c \u0924\u0924\u094d \u0924\u0947\u091c\u094b \u0935\u093f\u0926\u094d\u0927\u093f \u092e\u093e\u092e\u0915\u092e\u094d \u0965 \u0967\u0968 \u0965","Know that the brilliance that comes from the Sun, which illuminates the entire universe, the luster that comes from the moon, even the light that comes from fire - that light is mine."],t.w)
B.Qp=new A.e(B.c,["\u0917\u093e\u092e\u093e\u0935\u093f\u0936\u094d\u092f \u091a \u092d\u0942\u0924\u093e\u0928\u093f \u0927\u093e\u0930\u092f\u093e\u092e\u093f \u0905\u0939\u092e\u094d \u0913\u091c\u0938\u093e \u0964\n\u092a\u0941\u0937\u094d\u0923\u093e\u092e\u093f \u091a\u094c\u0937\u0927\u0940\u0903 \u0938\u0930\u094d\u0935\u093e\u0903 \u0938\u094b\u092e\u094b \u092d\u0942\u0924\u094d\u0935\u093e \u0930\u0938\u093e\u0924\u094d\u092e\u0915\u0903 \u0965 \u0967\u0969 \u0965","Pervading the earth, I sustain all the beings here by My strength. I nurture all plants. I am the essence of taste, I am the nectar."],t.w)
B.Ua=new A.e(B.c,["\u0905\u0939\u092e\u094d \u0935\u0948\u0936\u094d\u0935\u093e\u0928\u0930\u094b \u092d\u0942\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u093e\u0923\u093f\u0928\u093e\u092e\u094d \u0926\u0947\u0939\u092e\u094d \u0906\u0936\u094d\u0930\u093f\u0924\u0903 \u0964\n\u092a\u094d\u0930\u093e\u0923\u093e\u092a\u093e\u0928 \u0938\u092e\u093e\u092f\u0941\u0915\u094d\u0924\u0903 \u092a\u091a\u093e\u092e\u094d\u092f\u0928\u094d\u0928\u092e\u094d \u091a\u0924\u0941\u0930\u094d\u0935\u093f\u0927\u092e\u094d \u0965 \u0967\u096a \u0965","I embed Myself in the bodies of animals in the form of the chemistry of digestion. Together with inhalation and exhalation, I digest the four types of food."],t.w)
B.T4=new A.e(B.c,["\u0938\u0930\u094d\u0935\u0938\u094d\u092f \u091a\u093e\u0939\u092e\u094d \u0939\u0943\u0926\u093f \u0938\u0928\u094d\u0928\u093f\u0935\u093f\u0937\u094d\u091f\u094b\n\u092e\u0924\u094d\u0924\u0903 \u0938\u094d\u092e\u0943\u0924\u093f\u0930\u094d\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0905\u092a\u094b\u0939\u0928\u092e\u094d \u091a \u0964\n\u0935\u0947\u0926\u0948\u0936\u094d\u091a \u0938\u0930\u094d\u0935\u0948\u0930\u0939\u092e\u0947\u0935 \u0935\u0947\u0926\u094d\u092f\u094b\n\u0935\u0947\u0926\u093e\u0928\u094d\u0924\u0915\u0943\u0924\u094d \u0935\u0947\u0926 \u0935\u093f\u0926\u0947\u0935 \u091a\u093e\u0939\u092e\u094d \u0965 \u0967\u096b \u0965","I am at the heart of everything. Awareness, memory and the ability to reason come from Me. I alone am to be known from all the Vedas. I make the end of the Vedas and I am the One who knows the Vedas."],t.w)
B.Vx=new A.e(B.c,["\u0926\u094d\u0935\u093e\u0935\u093f\u092e\u094c \u092a\u0941\u0930\u0941\u0937\u094c \u0932\u094b\u0915\u0947 \u0915\u094d\u0937\u0930\u0936\u094d\u091a\u093e\u0915\u094d\u0937\u0930 \u090f\u0935 \u091a \u0964\n\u0915\u094d\u0937\u0930\u0903 \u0938\u0930\u094d\u0935\u093e\u0923\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u0915\u0942\u091f\u0938\u094d\u0925\u0903 \u0905\u0915\u094d\u0937\u0930 \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096c \u0965","The people in My Universe are of two types - perishable and imperishable. All beings you see here are perishable. The ones who stay without deforming are said to be the imperishable."],t.w)
B.U_=new A.e(B.c,["\u0909\u0924\u094d\u0924\u092e\u0903 \u092a\u0941\u0930\u0941\u0937\u0938\u094d\u0924\u0941 \u0905\u0928\u094d\u092f\u0903 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0947\u0924\u093f \u0909\u0926\u093e\u0939\u0943\u0924\u0903 \u0964\n\u092f\u094b \u0932\u094b\u0915\u0924\u094d\u0930\u092f\u092e\u094d \u0906\u0935\u093f\u0936\u094d\u092f \u092c\u093f\u092d\u0930\u094d\u0924\u093f \u0905\u0935\u094d\u092f\u092f\u0903 \u0908\u0936\u094d\u0935\u0930\u0903 \u0965 \u0967\u096d \u0965","However, the Supreme Person is another one. He is known as the Ultimate Self. He pervades the three domains and supports them. He never wears out. He is the Supreme Lord."],t.w)
B.Oe=new A.e(B.c,["\u092f\u0938\u094d\u092e\u093e\u0924\u094d \u0915\u094d\u0937\u0930\u092e\u094d \u0905\u0924\u0940\u0924\u094b\u093d\u0939\u092e\u094d \u0905\u0915\u094d\u0937\u0930\u093e\u0924\u094d \u0905\u092a\u093f \u091a\u094b\u0924\u094d\u0924\u092e\u0903 \u0964\n\u0905\u0924\u094b\u093d\u0938\u094d\u092e\u093f \u0932\u094b\u0915\u0947 \u0935\u0947\u0926\u0947 \u091a \u092a\u094d\u0930\u0925\u093f\u0924\u0903 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e\u0903 \u0965 \u0967\u096e \u0965","As I am beyond the perishable and also superior to the imperishable, I am well-known in the world and in the Vedas as the Supreme Person."],t.w)
