B.Uz=new A.e(B.c,["\u0907\u0924\u093f \u0917\u0941\u0939\u094d\u092f\u0924\u092e\u092e\u094d \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u092e\u094d \u0907\u0926\u092e\u094d \u0909\u0915\u094d\u0924\u092e\u094d \u092e\u092f\u093e \u0905\u0928\u0918 \u0964\n\u090f\u0924\u0924\u094d \u092c\u0941\u0926\u094d\u0927\u094d\u0935\u093e \u092c\u0941\u0926\u094d\u0927\u093f\u092e\u093e\u0928\u094d \u0938\u094d\u092f\u093e\u0924\u094d \u0915\u0943\u0924 \u0915\u0943\u0924\u094d\u092f\u0903 \u091a \u092d\u093e\u0930\u0924 \u0965 \u0968\u0966 \u0965","Flawless Arjuna, in this way, this knowledge, which is supremely concealed, has been spelt out by Me. Knowing this, you are endowed with intellect and shall have done everything there is to do."],t.w)
B.Tz=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0905\u092d\u092f\u092e\u094d \u0938\u0924\u094d\u0924\u094d\u0935 \u0938\u092e\u094d\u0936\u0941\u0926\u094d\u0927\u093f\u0903 \u091c\u094d\u091e\u093e\u0928\u092f\u094b\u0917 \u0935\u094d\u092f\u0935\u0938\u094d\u0925\u093f\u0924\u093f\u0903 \u0964\n\u0926\u093e\u0928\u092e\u094d \u0926\u092e\u0903 \u091a \u092f\u091c\u094d\u091e\u0903 \u091a \u0938\u094d\u0935\u093e\u0927\u094d\u092f\u093e\u092f\u0903 \u0924\u092a \u0906\u0930\u094d\u091c\u0935\u092e\u094d \u0965 \u0967 \u0965\n\u0905\u0939\u093f\u0902\u0938\u093e \u0938\u0924\u094d\u092f\u092e\u094d \u0905\u0915\u094d\u0930\u094b\u0927\u0903 \u0924\u094d\u092f\u093e\u0917\u0903 \u0936\u093e\u0928\u094d\u0924\u093f\u0903 \u0905\u092a\u0948\u0936\u0941\u0928\u092e\u094d \u0964\n\u0926\u092f\u093e \u092d\u0942\u0924\u0947\u0937\u0941 \u0905\u0932\u094b\u0932\u0941\u092a\u094d\u0924\u094d\u0935\u092e\u094d \u092e\u093e\u0930\u094d\u0926\u0935\u092e\u094d \u0939\u094d\u0930\u0940\u0903 \u0905\u091a\u093e\u092a\u0932\u092e\u094d \u0965 \u0968 \u0965\n\u0924\u0947\u091c\u0903 \u0915\u094d\u0937\u092e\u093e \u0927\u0943\u0924\u093f\u0903 \u0936\u094c\u091a\u092e\u094d \u0905\u0926\u094d\u0930\u094b\u0939\u094b \u0928\u093e\u0924\u093f\u092e\u093e\u0928\u093f\u0924\u093e \u0964\n\u092d\u0935\u0928\u094d\u0924\u093f \u0938\u092e\u094d\u092a\u0926\u092e\u094d \u0926\u0948\u0935\u0940\u092e\u094d \u0905\u092d\u093f\u091c\u093e\u0924\u0938\u094d\u092f \u092d\u093e\u0930\u0924 \u0965 \u0969 \u0965","The Lord said - Arjuna, the characteristics of a person who is born into the Lord's principles are: Freedom from fear; A clear mind; Settled in the knowledge of the Self; Generosity; Control over the organs; Worship of the Lord; Recitation of the scriptures; Dedication of thought into performance; Consistency in thought, speech and action; Intolerance towards violence; Saying it 'as it is', in a way that's beneficial; Freedom from anger; Leaving things that don\u2019t benefit the Self; Being content with the Self; Not speaking ill of others; Compassion towards all beings; Without attachments in material subjects; Without being harsh; Modesty; Unwavering; The brilliance of leadership; Forgiveness; Resolve; Cleanliness; Being without putting another at a disadvantage; Being without inappropriate pride."],t.w)
B.Oj=new A.e(B.c,["\u0921\u092e\u094d\u092d\u094b \u0926\u0930\u094d\u092a\u0903 \u0905\u0924\u093f\u092e\u093e\u0928\u0903 \u091a \u0915\u094d\u0930\u094b\u0927\u0903 \u092a\u093e\u0930\u0941\u0937\u094d\u092f\u092e\u0947\u0935 \u091a \u0964\n\u0905\u091c\u094d\u091e\u093e\u0928\u092e\u094d \u091a\u093e\u092d\u093f\u091c\u093e\u0924\u0938\u094d\u092f \u092a\u093e\u0930\u094d\u0925 \u0938\u092e\u094d\u092a\u0926\u092e\u094d \u0906\u0938\u0941\u0930\u0940\u092e\u094d \u0965 \u096a \u0965","Arjuna, a person with an attitude of non-compliance of the Lord's instructions has the following characteristics: Being righteous just to show-off; Intoxicated by the experience of material attractions; Stuck in self-esteem; Anger; Harshness; and Ignorance."],t.w)
B.Wg=new A.e(B.c,["\u0926\u0948\u0935\u0940 \u0938\u092e\u094d\u092a\u0924\u094d \u0935\u093f\u092e\u094b\u0915\u094d\u0937\u093e\u092f \u0928\u092c\u0928\u094d\u0927\u0928\u093e\u092f\u093e\u0938\u0941\u0930\u0940 \u092e\u0924\u093e \u0964","Compliance to the Lord's instructions is an asset for liberation . The path of disregarding for these instructions is to bind a person in the material world."],t.w)
B.W_=new A.e(B.c,["\u092e\u093e \u0936\u0941\u091a\u0903 \u0938\u092e\u094d\u092a\u0926\u092e\u094d \u0926\u0948\u0935\u0940\u092e\u094d \u0905\u092d\u093f\u091c\u093e\u0924\u094b\u093d\u0938\u093f \u092a\u093e\u0928\u094d\u0921\u0935 \u0965 \u096b \u0965","Arjuna, don't worry. You are born with the property of complying to My instructions ."],t.w)
