B.VZ=new A.e(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0924\u094d\u0930\u093f\u0935\u093f\u0927\u093e \u092d\u0935\u0924\u093f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0926\u0947\u0939\u093f\u0928\u093e\u092e\u094d \u0938\u093e \u0938\u094d\u0935\u092d\u093e\u0935\u091c\u093e \u0964\n\u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915\u0940 \u0930\u093e\u091c\u0938\u0940 \u091a\u0948\u0935 \u0924\u093e\u092e\u0938\u0940 \u091a\u0947\u0924\u093f \u0924\u093e\u092e\u094d \u0936\u0943\u0923\u0941 \u0965 \u0968 \u0965","The Lord said - Those who own a body have focus of three types: serene, resourceful and lazy. It comes from their own state of being. Listen to them."],t.w)
B.TH=new A.e(B.c,["\u0938\u0924\u094d\u0935\u093e\u0928\u0941\u0930\u0942\u092a\u093e \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u092d\u0935\u0924\u093f \u092d\u093e\u0930\u0924 \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092e\u092f\u094b \u0905\u092f\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b \u092f\u094b \u092f\u0924\u094d \u0936\u094d\u0930\u0926\u094d\u0927\u0903 \u0938 \u090f\u0935 \u0938\u0903 \u0965 \u0969 \u0965","Arjuna, each person's focus is according to the essence of his character. This person is defined by his focus. Whoever has a focus, he is that itself."],t.w)
