B.Oh=new A.e(B.c,["\u0905\u0936\u093e\u0938\u094d\u0924\u094d\u0930\u0935\u093f\u0939\u093f\u0924\u092e\u094d \u0918\u094b\u0930\u092e\u094d \u0924\u092a\u094d\u092f\u0928\u094d\u0924\u0947 \u092f\u0947 \u0924\u092a\u094b \u091c\u0928\u093e\u0903 \u0964\n\u0926\u092e\u094d\u092d\u093e\u0939\u0902\u0915\u093e\u0930 \u0938\u092e\u094d\u092f\u0941\u0915\u094d\u0924\u093e\u0903 \u0915\u093e\u092e \u0930\u093e\u0917 \u092c\u0932\u093e\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0965 \u096b \u0965\n\u0915\u0930\u094d\u0936\u092f\u0928\u094d\u0924\u0903 \u0936\u0930\u0940\u0930\u0938\u094d\u0925\u092e\u094d \u092d\u0942\u0924\u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0905\u091a\u0947\u0924\u0938\u0903 \u0964\n\u092e\u093e\u092e\u094d \u091a\u0948\u0935\u093e\u0928\u094d\u0924\u0903 \u0936\u0930\u0940\u0930\u0938\u094d\u0925\u092e\u094d \u0924\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u0938\u0941\u0930 \u0928\u093f\u0936\u094d\u091a\u092f\u093e\u0928\u094d \u0965 \u096c \u0965","People who are associated with hypocrisy and arrogance find their strength in desire and pleasure. They torment themselves with awful struggle, going against My instructions in the scriptures. They attenuate the colony of elements present as the body along with Me, present as the core of the body. They are lifeless. Know them as people who have resolved to disregard My instructions."],t.w)
B.Pw=new A.e(B.c,["\u0906\u0939\u093e\u0930\u0938\u094d\u0924\u094d\u0935\u092a\u093f \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u094b \u092d\u0935\u0924\u093f \u092a\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u091c\u094d\u091e\u0903 \u0924\u092a\u0903 \u0924\u0925\u093e \u0926\u093e\u0928\u092e\u094d \u0924\u0947\u0937\u093e\u092e\u094d \u092d\u0947\u0926\u092e\u094d \u0907\u092e\u092e\u094d \u0936\u0943\u0923\u0941 \u0965 \u096d \u0965","Everyone\u2019s favorite food also falls into three categories. Same is the case with worship, discipline and charity. Listen to the distinctions between them."],t.w)
