B.Pa=new A.e(B.c,["\u0915\u091f\u094d\u0935\u092e\u094d\u0932 \u0932\u0935\u0923 \u0905\u0924\u094d\u092f\u0941\u0937\u094d\u0923 \u0924\u0940\u0915\u094d\u0937\u094d\u0923 \u0930\u0942\u0915\u094d\u0937 \u0935\u093f\u0926\u093e\u0939\u093f\u0928\u0903 \u0964\n\u0906\u0939\u093e\u0930\u093e \u0930\u093e\u091c\u0938\u0938\u094d\u092f \u0907\u0937\u094d\u091f\u093e \u0926\u0941\u0903\u0916 \u0936\u094b\u0915\u093e\u092e\u092f \u092a\u094d\u0930\u0926\u093e\u0903 \u0965 \u096f \u0965","The favorite foods of a person in rajas are those that are difficult, giving distress and indigestion. They are pungent, sour, salty, full of heat, sharp and rough to the taste, having scorching effects."],t.w)
B.Qb=new A.e(B.c,["\u092f\u093e\u0924\u092f\u093e\u092e\u092e\u094d \u0917\u0924\u0930\u0938\u092e\u094d \u092a\u0942\u0924\u093f \u092a\u0930\u094d\u092f\u0941\u0937\u093f\u0924\u092e\u094d \u091a \u092f\u0924\u094d \u0964\n\u0909\u091a\u094d\u091b\u093f\u0937\u094d\u091f\u092e\u094d \u0905\u092a\u093f \u091a\u093e\u092e\u0947\u0927\u094d\u092f\u092e\u094d \u092d\u094b\u091c\u0928\u092e\u094d \u0924\u093e\u092e\u0938 \u092a\u094d\u0930\u093f\u092f\u092e\u094d \u0965 \u0967\u0966 \u0965","Creatures that are in tamas like to eat food that is aged, having lost its natural flavor, foul-smelling, stale, even left-over fragments and other dirty things."],t.w)
B.Wa=new A.e(B.c,["\u0905\u092b\u0932\u093e\u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u092f\u091c\u094d\u091e\u094b \u0935\u093f\u0927\u093f \u0926\u0943\u0937\u094d\u091f\u094b \u092f \u0907\u091c\u094d\u092f\u0924\u0947 \u0964\n\u092f\u0937\u094d\u091f\u0935\u094d\u092f\u092e\u094d \u090f\u0935\u0947\u0924\u093f \u092e\u0928\u0903 \u0938\u092e\u093e\u0927\u093e\u092f \u0938 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u0903 \u0965 \u0967\u0967 \u0965","The worship that is offered in devotion, devoid of expectations, done with consideration to the methods in the scriptures, with the mind being content that 'I just need to worship' - This worship is in sattva ."],t.w)
