B.PJ=new A.e(B.c,["\u0935\u093f\u0927\u093f\u0939\u0940\u0928\u092e\u094d \u0905\u0938\u0943\u0937\u094d\u091f\u093e\u0928\u094d\u0928\u092e\u094d \u092e\u0928\u094d\u0924\u094d\u0930\u0939\u0940\u0928\u092e\u094d \u0905\u0926\u0915\u094d\u0937\u093f\u0923\u092e\u094d \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0935\u093f\u0930\u0939\u093f\u0924\u092e\u094d \u092f\u091c\u094d\u091e\u092e\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u092a\u0930\u093f\u091a\u0915\u094d\u0937\u0924\u0947 \u0965 \u0967\u0969 \u0965","A ritual that disregards all methods with inappropriate materials, devoid of prayer and offering done without focus is condemned to be in the quality of tamas ."],t.w)
