B.VU=new A.e(B.c,["\u0905\u0928\u0941\u0926\u094d\u0935\u0947\u0917\u0915\u0930\u092e\u094d \u0935\u093e\u0915\u094d\u092f\u092e\u094d \u0938\u0924\u094d\u092f\u092e\u094d \u092a\u094d\u0930\u093f\u092f \u0939\u093f\u0924\u092e\u094d \u091a \u092f\u0924\u094d \u0964\n\u0938\u094d\u0935\u093e\u0927\u094d\u092f\u093e\u092f\u093e\u092d\u094d\u092f\u0938\u0928\u092e\u094d \u091a\u0948\u0935 \u0935\u093e\u0915\u094d \u092e\u092f\u092e\u094d \u0924\u092a \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096b \u0965","A sentence that doesn't cause agitation, is authentic, liked and comforting, with a study of the Self built into it - this is known as discipline of speech."],t.w)
