B.Pn=new A.e(B.c,["\u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e \u092a\u0930\u092f\u093e \u0924\u092a\u094d\u0924\u092e\u094d \u0924\u092a\u0903 \u0924\u0924\u094d \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u092e\u094d \u0928\u0930\u0948\u0903 \u0964\n\u0905\u092b\u0932\u093e\u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u092f\u0941\u0915\u094d\u0924\u0948\u0903 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u092a\u0930\u093f\u091a\u0915\u094d\u0937\u0924\u0947 \u0965 \u0967\u096d \u0965","When these three disciplines are implemented as The Lord's worship, by people with supreme focus, without being bogged down by expectations, - this is seen as being in the quality of sattva ."],t.w)
B.Up=new A.e(B.c,["\u0938\u0924\u094d\u0915\u093e\u0930 \u092e\u093e\u0928 \u092a\u0942\u091c\u093e\u0930\u094d\u0925\u092e\u094d \u0924\u092a\u094b \u0926\u092e\u094d\u092d\u0947\u0928 \u091a\u0948\u0935 \u092f\u0924\u094d \u0964\n\u0915\u094d\u0930\u093f\u092f\u0924\u0947 \u0924\u0924\u094d \u0907\u0939 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u092e\u094d \u0930\u093e\u091c\u0938\u092e\u094d \u091a\u0932\u092e\u094d \u0905\u0927\u094d\u0930\u0941\u0935\u092e\u094d \u0965 \u0967\u096e \u0965","Discipline that's practiced to be revered, to gain fame, respect, pride and with the only aim of showing-off - such discipline here is said to be in the quality of rajas . It is perishable and unstable."],t.w)
