B.OH=new A.e(B.c,["\u092f\u091c\u094d\u091e\u0947 \u0924\u092a\u0938\u093f \u0926\u093e\u0928\u0947 \u091a \u0938\u094d\u0925\u093f\u0924\u093f\u0903 \u0938\u0924\u094d \u0907\u0924\u093f \u091a\u094b\u091a\u094d\u092f\u0924\u0947 \u0964\n\u0915\u0930\u094d\u092e \u091a\u0948\u0935 \u0924\u0926\u0930\u094d\u0925\u0940\u092f\u092e\u094d \u0938\u0924\u094d \u0907\u0924\u094d\u092f\u0947\u0935\u093e\u092d\u093f\u0927\u0940\u092f\u0924\u0947 \u0965 \u0968\u096d \u0965","Standing in worship, discipline and charity is also called as 'sat'. The actions and people who perform them are also referred to by the word 'sat' itself."],t.w)
